INSERT IGNORE INTO `concept_description` VALUES
(9346,130812,'A prolonged febrile illness commonly caused by serotypes of Salmonella paratyphi. It is similar to typhoid fever but less severe.','en',1,'2007-10-18 04:28:24',1,NULL,'9346FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9347,130813,'A prolonged febrile illness commonly caused by serotypes of Salmonella paratyphi. It is similar to typhoid fever but less severe.','en',1,'2007-10-18 04:28:24',1,NULL,'9347FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9348,130814,'A prolonged febrile illness commonly caused by serotypes of Salmonella paratyphi. It is similar to typhoid fever but less severe.','en',1,'2007-10-18 04:28:24',1,NULL,'9348FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9349,130816,'Abnormally increased activity of the parathyroid glands, which may be primary or secondary (HYPERPARATHYRODISM, SECONDARY). Primary hyperparathyroidism is associated with neoplasia or hyperplasia. The excess of parathyroid hormone leads to alteration in function of bone, renal tubules, and gastrointestinal mucosa. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9349FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9350,130831,'Infections or infestations with parasitic organisms. They are often contracted through contact with an intermediate vector, but may occur as the result of direct exposure.','en',1,'2007-10-18 04:28:24',1,NULL,'9350FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9351,130832,'Suppurative inflammation of the tissues of the internal structures of the eye; not all layers of the uvea are affected. Fungi, necrosis of intraocular tumors, and retained intraocular foreign bodies often cause a purulent endophthalmitis.','en',1,'2007-10-18 04:28:24',1,NULL,'9351FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9352,130839,'The term applied to a group of relatively uncommon inflammatory, maculopapular, scaly eruptions of unknown etiology and resistant to conventional treatment. Eruptions are both psoriatic and lichenoid in appearance, but the diseases are distinct from psoriasis, lichen planus, or other recognized dermatoses. Proposed nomenclature divides parapsoriasis into two distinct subgroups, PITYRIASIS LICHENOIDES and parapsoriasis en plaques (small- and large-plaque parapsoriasis).','en',1,'2007-10-18 04:28:24',1,NULL,'9352FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9353,130840,'The term applied to a group of relatively uncommon inflammatory, maculopapular, scaly eruptions of unknown etiology and resistant to conventional treatment. Eruptions are both psoriatic and lichenoid in appearance, but the diseases are distinct from psoriasis, lichen planus, or other recognized dermatoses. Proposed nomenclature divides parapsoriasis into two distinct subgroups, PITYRIASIS LICHENOIDES and parapsoriasis en plaques (small- and large-plaque parapsoriasis).','en',1,'2007-10-18 04:28:24',1,NULL,'9353FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9354,130841,'The term applied to a group of relatively uncommon inflammatory, maculopapular, scaly eruptions of unknown etiology and resistant to conventional treatment. Eruptions are both psoriatic and lichenoid in appearance, but the diseases are distinct from psoriasis, lichen planus, or other recognized dermatoses. Proposed nomenclature divides parapsoriasis into two distinct subgroups, PITYRIASIS LICHENOIDES and parapsoriasis en plaques (small- and large-plaque parapsoriasis).','en',1,'2007-10-18 04:28:24',1,NULL,'9354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9355,130843,'Severe or complete loss of motor function in the lower extremities and lower portions of the trunk. This condition is most often associated with SPINAL CORD DISEASES, although BRAIN DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; NEUROMUSCULAR DISEASES; and MUSCULAR DISEASES may also cause bilateral leg weakness.','en',1,'2007-10-18 04:28:24',1,'2016-09-18 02:24:29','9355FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9356,130844,'Chronic mental disorders in which there has been an insidious development of a permanent and unshakeable delusional system (persecutory delusions or delusions of jealousy), accompanied by preservation of clear and orderly thinking. Emotional responses and behavior are consistent with the delusional state.','en',1,'2007-10-18 04:28:24',1,NULL,'9356FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9357,130846,'Disorders that include recurrent, intense sexually arousing fantasies, sexual urges, or behaviors generally involving nonhuman objects, suffering of oneself or partners, or children or other nonconsenting partners. (from DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'9357FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9358,130847,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'9358FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9359,130848,'Accumulation of purulent material in tissues, organs, or circumscribed spaces, usually associated with signs of infection.','en',1,'2007-10-18 04:28:24',1,NULL,'9359FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9360,130849,'Mild to moderate loss of bilateral lower extremity motor function, which may be a manifestation of SPINAL CORD DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; MUSCULAR DISEASES; INTRACRANIAL HYPERTENSION; parasagittal brain lesions; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'9360FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9361,130850,'A chronic form of schizophrenia characterized primarily by the presence of persecutory or grandiose delusions, often associated with hallucination.','en',1,'2007-10-18 04:28:24',1,NULL,'9361FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9362,130851,'A chronic form of schizophrenia characterized primarily by the presence of persecutory or grandiose delusions, often associated with hallucination.','en',1,'2007-10-18 04:28:24',1,NULL,'9362FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9363,130852,'A personality disorder characterized by the avoidance of accepting deserved blame and an unwarranted view of others as malevolent. The latter is expressed as suspiciousness, hypersensitivity, and mistrust.','en',1,'2007-10-18 04:28:24',1,NULL,'9363FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9364,130855,'In patients with neoplastic diseases a wide variety of clinical pictures which are indirect and usually remote effects produced by tumor cell metabolites or other products.','en',1,'2007-10-18 04:28:24',1,NULL,'9364FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9365,130857,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'9365FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9366,130860,'Inflammation of the parametrium, the extension of the subserous coat of the supracervical portion of the uterus laterally between the layers of the broad ligament. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9366FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9368,130864,'A general term most often used to describe severe or complete loss of muscle strength due to motor system disease from the level of the cerebral cortex to the muscle fiber. This term may also occasionally refer to a loss of sensory function. (From Adams et al., Principles of Neurology, 6th ed, p45)','en',1,'2007-10-18 04:28:24',1,NULL,'9368FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9369,130867,'Obstruction of the intestines that is functional, not mechanical.','en',1,'2007-10-18 04:28:24',1,NULL,'9369FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9370,130868,'Paralysis of one or both vocal cords, which produces hoarseness or aphonia. This condition may be caused by diseases of the medulla (e.g., LATERAL MEDULLARY SYNDROME), VAGUS NERVE, or recurrent laryngeal nerve. Neuromuscular junction diseases and local myopathic processes may also affect vocal cord function. (Adams et al., Principles of Neurology, 6th ed, p1380)','en',1,'2007-10-18 04:28:24',1,NULL,'9370FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9371,130872,'Paralysis of one or both vocal cords, which produces hoarseness or aphonia. This condition may be caused by diseases of the medulla (e.g., LATERAL MEDULLARY SYNDROME), VAGUS NERVE, or recurrent laryngeal nerve. Neuromuscular junction diseases and local myopathic processes may also affect vocal cord function. (Adams et al., Principles of Neurology, 6th ed, p1380)','en',1,'2007-10-18 04:28:24',1,NULL,'9371FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9372,130873,'Paralysis of one or both vocal cords, which produces hoarseness or aphonia. This condition may be caused by diseases of the medulla (e.g., LATERAL MEDULLARY SYNDROME), VAGUS NERVE, or recurrent laryngeal nerve. Neuromuscular junction diseases and local myopathic processes may also affect vocal cord function. (Adams et al., Principles of Neurology, 6th ed, p1380)','en',1,'2007-10-18 04:28:24',1,NULL,'9372FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9373,130874,'Obstruction of the intestines that is functional, not mechanical.','en',1,'2007-10-18 04:28:24',1,NULL,'9373FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9374,130879,'A catarrhal disorder of the upper respiratory tract, which may be viral, a mixed infection, or an allergic reaction. It is marked by acute coryza, slight rise in temperature, chilly sensations, and general indisposition. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9374FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9375,130887,'Infections with viruses of the family PARAMYXOVIRIDAE. This includes MORBILLIVIRUS INFECTIONS, PARAMYXOVIRUS INFECTIONS, PNEUMOVIRUS INFECTIONS, and RUBULAVIRUS INFECTIONS.','en',1,'2007-10-18 04:28:24',1,NULL,'9375FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9378,130892,'A relatively rare, usually benign neoplasm originating in the chemoreceptor tissue of the carotid body, glomus jugulare, and aortic bodies. It consists histologically of rounded or ovoid hyperchromatic cells that tend to be grouped in an alveolus-like pattern within a scant to moderate amount of fibrous stroma and a few large thin-walled vascular channels. They are uncommon before the age of 20, with a female predominance in some series. (Stedman, 25th ed; from DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p570-1)','en',1,'2007-10-18 04:28:24',1,NULL,'9378FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9380,130895,'A neural crest tumor usually derived from the chromoreceptor tissue of a paraganglion, such as the carotid body, or medulla of the adrenal gland (usually called a chromaffinoma or pheochromocytoma). It is more common in women than in men. (Stedman, 25th ed; from Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'9380FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9381,130899,'Herniation of the lower esophagus and/or portion of the stomach through the esophageal hiatus.','en',1,'2007-10-18 04:28:24',1,NULL,'9381FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9382,130902,'Conditions that impair the transmission or perception of auditory impulses and information from the level of the ear to the temporal cortices, including the sensorineural pathways.','en',1,'2007-10-18 04:28:24',1,NULL,'9382FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9383,130903,'A mycosis affecting the skin, mucous membranes, lymph nodes, and internal organs. It is caused by Paracoccidioides brasiliensis. It is also called paracoccidioidal granuloma. Superficial resemblance of P. brasiliensis to Blastomyces brasiliensis (BLASTOMYCES) may cause misdiagnosis.','en',1,'2007-10-18 04:28:24',1,NULL,'9383FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9384,130907,'An acneiform eruption occurring mostly in middle-aged adults and appearing generally on the forehead, cheeks, nose, and chin. Three types are recognized: granulomatous, glandular hyperplastic with rhinophyma, and ocular.','en',1,'2007-10-18 04:28:24',1,NULL,'9384FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9385,130908,'Diseases in which skin eruptions or rashes are a prominent manifestation. Classically, six such diseases were described with similar rashes; they were numbered in the order in which they were reported. Only the fourth (Duke''s disease), fifth (ERYTHEMA INFECTIOSUM), and sixth (EXANTHEMA SUBITUM) numeric designations survive as occasional synonyms in current terminology.','en',1,'2007-10-18 04:28:24',1,NULL,'9385FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9386,130911,'Rare, autosomal recessive disorder occurring between the first and fifth years of life. It is characterized by palmoplantar keratoderma with periodontitis followed by the premature shedding of both deciduous and permanent teeth.','en',1,'2007-10-18 04:28:24',1,NULL,'9386FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9388,130925,'Acute suppurative inflammation of the inner eye with necrosis of the sclera (and sometimes the cornea) and extension of the inflammation into the orbit. Pain may be severe and the globe may rupture. In endophthalmitis the globe does not rupture.','en',1,'2007-10-18 04:28:24',1,NULL,'9388FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9389,130929,'A condition of the bladder occurring predominantly in women, with an inflammatory lesion, usually in the vertex, and involving the entire thickness of the wall, appearing as a small patch of brownish red mucosa, surrounded by a network of radiating vessels. The lesions, known as Fenwick-Hunner or Hunner ulcers, may heal superficially, and are notoriously difficult to detect. Typically, there is urinary frequency and pain on bladder filling and at the end of micturition. It is also called chronic interstitial cystitis. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9389FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9390,130930,'A type of anxiety disorder characterized by unexpected panic attacks that last minutes or, rarely, hours. Panic attacks begin with intense apprehension, fear or terror and, often, a feeling of impending doom. Symptoms experienced during a panic attack include dyspnea or sensations of being smothered; dizziness, loss of balance or faintness; choking sensations; palpitations or accelerated heart rate; shakiness; sweating; nausea or other form of abdominal distress; depersonalization or derealization; paresthesias; hot flashes or chills; chest discomfort or pain; fear of dying and fear of not being in control of oneself or going crazy. Agoraphobia may also develop. Similar to other anxiety disorders, it may be inherited as an autosomal dominant trait.','en',1,'2007-10-18 04:28:24',1,NULL,'9390FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9391,130931,'A type of anxiety disorder characterized by unexpected panic attacks that last minutes or, rarely, hours. Panic attacks begin with intense apprehension, fear or terror and, often, a feeling of impending doom. Symptoms experienced during a panic attack include dyspnea or sensations of being smothered; dizziness, loss of balance or faintness; choking sensations; palpitations or accelerated heart rate; shakiness; sweating; nausea or other form of abdominal distress; depersonalization or derealization; paresthesias; hot flashes or chills; chest discomfort or pain; fear of dying and fear of not being in control of oneself or going crazy. Agoraphobia may also develop. Similar to other anxiety disorders, it may be inherited as an autosomal dominant trait.','en',1,'2007-10-18 04:28:24',1,NULL,'9391FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
