(9428,130968,'Diminution or cessation of secretion of one or more hormones from the anterior pituitary gland (including LH; FSH; SOMATOTROPIN; and CORTICOTROPIN). This may result from surgical or radiation ablation, non-secretory PITUITARY NEOPLASMS, metastatic tumors, infarction, PITUITARY APOPLEXY, infiltrative or granulomatous processes, and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'9428FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9429,130971,'Presence of fluid in the pleural cavity resulting from excessive transudation or exudation from the pleural surfaces. It is a sign of disease and not a diagnosis in itself.','en',1,'2007-10-18 04:28:24',1,NULL,'9429FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9430,130972,'Absence of or reduced pancreatic exocrine secretion into the duodenum and resultant poor digestion of lipids, vitamins, nitrogen, and carbohydrates.','en',1,'2007-10-18 04:28:24',1,NULL,'9430FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9431,130974,'Abnormal passage communicating with the pancreas.','en',1,'2007-10-18 04:28:24',1,NULL,'9431FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9432,130975,'The presence of abnormally low levels of lipoproteins in the serum.','en',1,'2007-10-18 04:28:24',1,NULL,'9432FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9433,130976,'Accumulation or retention of free fluid within the peritoneal cavity.','en',1,'2007-10-18 04:28:24',1,NULL,'9433FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9434,130984,'Destructive lesions of the thoracic inlet with involvement of the brachial and sympathetic plexus or carcinoma of the lung apex. It is characterized by pain in the shoulder region radiating toward the axilla and scapula, sensory and motor disorders and wasting of the muscles of the hand, the Bernard-Horner syndrome, and compression of the blood vessels with edema. (Jablonski''s Dictionary of Syndromes and Eponymic Diseases, 2d ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9434FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9435,130987,'Any variation from the normal rhythm or rate of the heart beat.','en',1,'2007-10-18 04:28:24',1,'2015-12-31 16:23:30','9435FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9436,130988,'An abnormal response to a stimulus applied to the sensory components of the nervous system. This may take the form of increased, decreased, or absent reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'9436FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9437,130989,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'9437FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9438,130990,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'9438FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9439,130993,'A heterogeneous group of primarily familial disorders characterized by myoclonic seizures, tonic-clonic seizures, ataxia, progressive intellectual deterioration, and neuronal degeneration. These include LAFORA DISEASE; MERRF SYNDROME; NEURONAL CEROID-LIPOFUSCINOSIS; sialidosis (see MUCOLIPIDOSES), and UNVERRICHT-LUNDBORG SYNDROME.','en',1,'2007-10-18 04:28:24',1,NULL,'9439FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9440,131006,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'9440FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9441,131009,'Accumulation of watery fluid in the cavity of a joint. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9441FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9442,131013,'Persistent abnormal erection of the penis, usually without sexual desire, and accompanied by pain and tenderness. It is seen in diseases and injuries of the spinal cord, and may be caused by vesical calculus and certain injuries to the penis. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9442FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9443,131014,'Disorders that feature impairment of eye movements as a primary manifestation of disease. These conditions may be divided into infranuclear, nuclear, and supranuclear disorders. Diseases of the eye muscles or oculomotor cranial nerves (III, IV, and VI) are considered infranuclear. Nuclear disorders are caused by disease of the oculomotor, trochlear, or abducens nuclei in the BRAIN STEM. Supranuclear disorders are produced by dysfunction of higher order sensory and motor systems that control eye movements, including neural networks in the CEREBRAL CORTEX; BASAL GANGLIA; CEREBELLUM; and BRAIN STEM. Ocular torticollis refers to a head tilt that is caused by an ocular misalignment. Opsoclonus refers to rapid, conjugate oscillations of the eyes in multiple directions, which may occur as a parainfectious or paraneoplastic condition (e.g., OPSOCLONUS-MYOCLONUS SYNDROME). (Adams et al., Principles of Neurology, 6th ed, p240)','en',1,'2007-10-18 04:28:24',1,NULL,'9443FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
