(9551,131690,'Infections by the genus BARTONELLA. Bartonella bacilliformis can cause acute febrile anemia, designated Oroya fever, and a benign skin eruption, called verruga peruana. BARTONELLA QUINTANA causes TRENCH FEVER, while BARTONELLA HENSELAE is the etiologic agent of bacillary angiomatosis (ANGIOMATOSIS, BACILLARY) and is also one of the causes of CAT-SCRATCH DISEASE in immunocompetent patients.','en',1,'2007-10-18 04:28:24',1,NULL,'9551FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
