(9562,131714,'Neurologic disorders associated with exposure to inorganic and organic forms of MERCURY. Acute intoxication may be associated with gastrointestinal disturbances, mental status changes, and PARAPARESIS. Chronic exposure to inorganic mercury usually occurs in industrial workers, and manifests as mental confusion, prominent behavioral changes (including psychosis), DYSKINESIAS, and NEURITIS. Alkyl mercury poisoning may occur through ingestion of contaminated seafood or grain, and its characteristic features include POLYNEUROPATHY; ATAXIA; vision loss; NYSTAGMUS; and DEAFNESS. (From Joynt, Clinical Neurology, 1997, Ch20, pp10-15)','en',1,'2007-10-18 04:28:24',1,NULL,'9562FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
