(9697,132394,'An inflammatory reaction involving the folds of the skin surrounding the fingernail. It is characterized by acute or chronic purulent, tender, and painful swellings of the tissues around the nail, caused by an abscess of the nail fold. The pathogenic yeast causing paronychia is most frequently Candida albicans. Saprophytic fungi may also be involved. The causative bacteria are usually Staphylococcus, Pseudomonas aeruginosa, or Streptococcus. (Andrews'' Diseases of the Skin, 8th ed, p271)','en',1,'2007-10-18 04:28:24',1,NULL,'9697FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9698,132395,'Disorders in which there is a loss of ego boundaries or a gross impairment in reality testing with delusions or prominent hallucinations. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'9698FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
