(9701,132410,'Any impairment, arrest, or reversal of the normal flow of intestinal contents toward the anus.','en',1,'2007-10-18 04:28:24',1,NULL,'9701FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9702,132414,'A group of inherited and sporadic disorders which share progressive ataxia in combination with atrophy of the CEREBELLUM; PONS; and inferior olivary nuclei. Additional clinical features may include MUSCLE RIGIDITY; NYSTAGMUS; RETINAL DEGENERATION; MUSCLE SPASTICITY; DEMENTIA; URINARY INCONTINENCE; and OPHTHALMOPLEGIA. The familial form has an earlier onset (second decade) and may feature spinal cord atrophy. The sporadic form tends to present in the fifth or sixth decade, and is considered a clinical subtype of MULTIPLE SYSTEM ATROPHY. (From Adams et al., Principles of Neurology, 6th ed, p1085)','en',1,'2007-10-18 04:28:24',1,NULL,'9702FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9703,132417,'Inability to form or excrete urine.','en',1,'2007-10-18 04:28:24',1,NULL,'9703FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9704,132419,'Deficiency in the number of spermatozoa in semen. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9704FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9705,132426,'Clinical or subclinical disturbances of cortical function due to a sudden, abnormal, excessive, and disorganized discharge of brain cells. Clinical manifestations include abnormal motor, sensory and psychic phenomena. Recurrent seizures are usually referred to as EPILEPSY or \"seizure disorder.\"','en',1,'2007-10-18 04:28:24',1,NULL,'9705FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9706,132427,'Subjectively experienced sensations in the absence of an appropriate stimulus, but which are regarded by the individual as real. They may be of organic origin or associated with MENTAL DISORDERS.','en',1,'2007-10-18 04:28:24',1,NULL,'9706FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9707,132428,'Age as a constituent element or influence contributing to the production of a result. It may be applicable to the cause or the effect of a circumstance. It is used with human or animal concepts but should be differentiated from AGING, a physiological process, and TIME FACTORS which refers only to the passage of time.','en',1,'2007-10-18 04:28:24',1,NULL,'9707FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9708,132429,'A febrile disease of the Mediterranean area, the Crimea, Africa, and India, caused by infection with RICKETTSIA CONORII.','en',1,'2007-10-18 04:28:24',1,NULL,'9708FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9709,132450,'Failure or imperfection of vision at night or in dim light, with good vision only on bright days. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9709FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9711,132453,'Cysts found in the jaws and arising from epithelium involved in tooth formation. They include follicular cysts (e.g., primordial cyst, dentigerous cyst, multilocular cyst), lateral periodontal cysts, and radicular cysts. They may become keratinized (odontogenic keratocysts). Follicular cysts may give rise to ameloblastomas and, in rare cases, undergo malignant transformation.','en',1,'2007-10-18 04:28:24',1,NULL,'9711FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9712,132454,'A localized arrested tooth development which appears to involve most commonly the anterior teeth, usually on one side of the midline, most often the maxillary central and lateral incisors. Roentgenographically, the teeth have a ghostlike appearance. Calcification and bits of prismatic enamel may be found in the pulp and the enamel is thin and absent in part. (Jablonski, Illustrated Dictionary of Dentistry, 1982)','en',1,'2007-10-18 04:28:24',1,NULL,'9712FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9713,132455,'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-10-18 04:28:24',1,NULL,'9713FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9714,132456,'A group of disorders marked by progressive degeneration of motor neurons in the spinal cord resulting in weakness and muscular atrophy, usually without evidence of injury to the corticospinal tracts. Diseases in this category include Werdnig-Hoffmann disease and later onset SPINAL MUSCULAR ATROPHIES OF CHILDHOOD, most of which are hereditary. The adult onset variant of this condition is referred to as progressive muscular atrophy. (Adams et al., Principles of Neurology, 6th ed, p1089)','en',1,'2007-10-18 04:28:24',1,NULL,'9714FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9715,132458,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'9715FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9716,132459,'Inflammation of the cornea.','en',1,'2007-10-18 04:28:24',1,NULL,'9716FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9717,132460,'Inflammation of the cornea.','en',1,'2007-10-18 04:28:24',1,NULL,'9717FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9718,132462,'A plague-like disease of rodents, transmissible to man. It is caused by FRANCISELLA TULARENSIS and is characterized by fever, chills, headache, backache, and weakness.','en',1,'2007-10-18 04:28:24',1,NULL,'9718FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9719,132464,'Heterogeneous group of autosomal recessive disorders comprising at least four recognized types, all having in common varying degrees of hypopigmentation of the skin, hair, and eyes. The two most common are the tyrosinase-positive and tyrosinase-negative types.','en',1,'2007-10-18 04:28:24',1,NULL,'9719FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9720,132465,'Disorders that feature impairment of eye movements as a primary manifestation of disease. These conditions may be divided into infranuclear, nuclear, and supranuclear disorders. Diseases of the eye muscles or oculomotor cranial nerves (III, IV, and VI) are considered infranuclear. Nuclear disorders are caused by disease of the oculomotor, trochlear, or abducens nuclei in the BRAIN STEM. Supranuclear disorders are produced by dysfunction of higher order sensory and motor systems that control eye movements, including neural networks in the CEREBRAL CORTEX; BASAL GANGLIA; CEREBELLUM; and BRAIN STEM. Ocular torticollis refers to a head tilt that is caused by an ocular misalignment. Opsoclonus refers to rapid, conjugate oscillations of the eyes in multiple directions, which may occur as a parainfectious or paraneoplastic condition (e.g., OPSOCLONUS-MYOCLONUS SYNDROME). (Adams et al., Principles of Neurology, 6th ed, p240)','en',1,'2007-10-18 04:28:24',1,NULL,'9720FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9721,132466,'Infections caused by nematode larvae which never develop into the adult stage and migrate through various body tissues. They commonly infect the skin, eyes, and viscera in man. Ancylostoma brasiliensis causes cutaneous larva migrans. Toxocara causes visceral larva migrans.','en',1,'2007-10-18 04:28:24',1,NULL,'9721FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9722,132467,'Deeply perforating or puncturing type intraocular injuries.','en',1,'2007-10-18 04:28:24',1,NULL,'9722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9723,132468,'Filarial infection of the eyes transmitted from person to person by bites of Onchocerca volvulus-infected black flies. The microfilariae of Onchocerca are thus deposited beneath the skin. They migrate through various tissues including the eye. Those persons infected have impaired vision and up to 20% are blind. The incidence of eye lesions has been reported to be as high as 30% in Central America and parts of Africa.','en',1,'2007-10-18 04:28:24',1,NULL,'9723FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9724,132472,'A condition in which the intraocular pressure is elevated above normal and which may lead to glaucoma.','en',1,'2007-10-18 04:28:24',1,NULL,'9724FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9725,132474,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-10-18 04:28:24',1,NULL,'9725FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9726,132476,'Group of chronic blistering diseases characterized histologically by acantholysis and blister formation within the epidermis.','en',1,'2007-10-18 04:28:24',1,NULL,'9726FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9727,132477,'A fungal infection that may appear in two forms: 1) a primary lesion characterized by the formation of a small cutaneous nodule and small nodules along the lymphatics that may heal within several months; and 2) chronic granulomatous lesions characterized by thick crusts, warty growths, and unusual vascularity and infection in the middle or upper lobes of the lung.','en',1,'2007-10-18 04:28:24',1,NULL,'9727FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9728,132478,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9728FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9729,132482,'Albinism affecting the eye in which pigment of the hair and skin is normal or only slightly diluted. The classic type is X-linked (Nettleship-Falls), but an autosomal recessive form also exists. Ocular abnormalities may include reduced pigmentation of the iris, nystagmus, photophobia, strabismus, and decreased visual acuity.','en',1,'2007-10-18 04:28:24',1,NULL,'9729FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9730,132487,'Progressive loss of the hard substance of a tooth by chemical processes that do not involve bacterial action. (Jablonski, Dictionary of Dentistry, 1992, p296)','en',1,'2007-10-18 04:28:24',1,NULL,'9730FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9731,132492,'A recurrent contact dermatitis caused by substances found in the work place.','en',1,'2007-10-18 04:28:24',1,NULL,'9731FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9732,132493,'The pathologic wearing away of the tooth substance by brushing, bruxism, clenching, and other mechanical causes. It is differentiated from TOOTH ATTRITION in that this type of wearing away is the result of tooth-to-tooth contact, as in mastication, occurring only on the occlusal, incisal, and proximal surfaces. It differs also from TOOTH EROSION, the progressive loss of the hard substance of a tooth by chemical processes not involving bacterial action. (From Jablonski, Dictionary of Dentistry, 1992, p2)','en',1,'2007-10-18 04:28:24',1,NULL,'9732FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9733,132494,'Black, tarry feces containing digested blood.','en',1,'2007-10-18 04:28:24',1,NULL,'9733FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9734,132495,'Obstruction of a vessel by a blood clot that has been transported from a distant site by the blood stream.','en',1,'2007-10-18 04:28:24',1,NULL,'9734FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9735,132497,'Calculi of the ureter, usually the result of the passage of one originating in the kidney. It occurs usually in mid-life, rarely in children; and is more frequent in males than females. (From CMIT, 5th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9735FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9736,132502,'Conditions which affect the structure or function of the pupil of the eye, including disorders of innervation to the pupillary constrictor or dilator muscles, and disorders of pupillary reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'9736FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9737,132503,'Conditions characterized by recurrent paroxysmal neuronal discharges which arise from a focal region of the brain. Partial seizures are divided into simple and complex, depending on whether consciousness is unaltered (simple partial seizure) or disturbed (complex partial seizure). Both types may feature a wide variety of motor, sensory, and autonomic symptoms. Partial seizures may be classified by associated clinical features or anatomic location of the seizure focus. A secondary generalized seizure refers to a partial seizure that spreads to involve the brain diffusely. (From Adams et al., Principles of Neurology, 6th ed, pp317)','en',1,'2007-10-18 04:28:24',1,NULL,'9737FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9738,132505,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'9738FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9739,132509,'Hernia through the obturator foramen.','en',1,'2007-10-18 04:28:24',1,NULL,'9739FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9740,132510,'Any impairment, arrest, or reversal of the normal flow of intestinal contents toward the anus.','en',1,'2007-10-18 04:28:24',1,NULL,'9740FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9741,132511,'A disorder characterized by recurrent apneas during sleep despite persistent respiratory efforts. It is due to upper airway obstruction. The respiratory pauses may induce HYPERCAPNIA or HYPOXIA. Cardiac ARRHYTHMIA and elevation of systemic and pulmonary arterial pressures may occur. Frequent partial arousals occur throughout sleep, resulting in relative SLEEP DEPRIVATION and daytime tiredness. Associated conditions include OBESITY; ACROMEGALY; MYXEDEMA; micrognathia; MYOTONIC DYSTROPHY; adenotonsilar dystrophy; and NEUROMUSCULAR DISEASES. (From Adams et al., Principles of Neurology, 6th ed, p395)','en',1,'2007-10-18 04:28:24',1,NULL,'9741FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9742,132514,'Impairment of biliary flow at any level from the hepatocyte to Vater''s ampulla.','en',1,'2007-10-18 04:28:24',1,NULL,'9742FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9743,132515,'Excessive accumulation of cerebrospinal fluid within the cranium which may be associated with dilation of cerebral ventricles, INTRACRANIAL HYPERTENSION; HEADACHE; lethargy; URINARY INCONTINENCE; and ATAXIA (and in infants macrocephaly). This condition may be caused by obstruction of cerebrospinal fluid pathways due to neurologic abnormalities, INTRACRANIAL HEMORRHAGES; CENTRAL NERVOUS SYSTEM INFECTIONS; BRAIN NEOPLASMS; CRANIOCEREBRAL TRAUMA; and other conditions. Impaired resorption of cerebrospinal fluid from the arachnoid villi results in a communicating form of hydrocephalus. Hydrocephalus ex-vacuo refers to ventricular dilation that occurs as a result of brain substance loss from CEREBRAL INFARCTION and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'9743FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9744,132519,'Liver cirrhosis in which there is interference with intrahepatic bile flow. It includes primary biliary cirrhosis, an intrahepatic disturbance of bile secretion affecting predominantly middle-aged women and with segmental destruction and, later, absence of septal bile ducts (cirrhosis is the end stage); and secondary biliary cirrhosis, which is produced by prolonged mechanical obstruction of large intrahepatic or extrahepatic bile ducts.','en',1,'2007-10-18 04:28:24',1,NULL,'9744FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
