(9755,132610,'A personality disorder characterized by an emotionally constricted manner that is unduly conventional, serious, formal, and stingy, by preoccupation with trivial details, rules, order, organization, schedules, and lists, by stubborn insistence on having things one''s own way without regard for the effects on others, by excessive devotion to work and productivity to the detriment of interpersonal relationships, and by indecisiveness due to fear of making mistakes. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9755FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9756,132611,'An anxiety disorder characterized by recurrent, persistent obsessions or compulsions. Obsessions are the intrusive ideas, thoughts, or images that are experienced as senseless or repugnant. Compulsions are repetitive and seemingly purposeful behavior which the individual generally recognizes as senseless and from which the individual does not derive pleasure although it may provide a release from tension.','en',1,'2007-10-18 04:28:24',1,'2016-07-06 23:17:46','9756FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9757,132612,'A personality disorder characterized by an emotionally constricted manner that is unduly conventional, serious, formal, and stingy, by preoccupation with trivial details, rules, order, organization, schedules, and lists, by stubborn insistence on having things one''s own way without regard for the effects on others, by excessive devotion to work and productivity to the detriment of interpersonal relationships, and by indecisiveness due to fear of making mistakes. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9757FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
