(9778,132779,'Accumulation of blood in the cranial epidural space due to rupture of the middle meningeal artery or rarely the meningeal vein, often associated with a temporal or parietal bone fracture. The hematoma tends to expand rapidly, compressing the dura and underlying brain. Clinical features include the acute or subacute onset of headache, VOMITING, alterations of mentation, and hemiparesis (see HEMIPLEGIA). The natural history of the process is progression to coma and eventually death. (Adams et al., Principles of Neurology, 6th ed, p885)','en',1,'2007-10-18 04:28:24',1,NULL,'9778FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
