(9791,132841,'A circumscribed stable malformation of the skin and occasionally of the oral mucosa, which is not due to external causes and therefore presumed to be of hereditary origin. The excess (or deficiency) of tissue may involve epidermal, connective tissue, adnexal, nervous, or vascular elements. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9791FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9792,132843,'An autosomal recessive metabolic disorder caused by deficiencies in the mitochondrial GLYCINE cleavage system; an enzyme system with four components: P-, T-, H-, and L-proteins. Deficiency of the P-protein is the most prevalent form. Neonatal and juvenile presentations have been reported. Neonatal onset is more common and may be fatal. Clinical features include SEIZURES; hypotonia; APNEA; and COMA. When the illness presents in childhood there tends to be an associated progressive DEMENTIA accompanied by extrapyramidal signs. (Menkes, Textbook of Child Neurology, 5th ed, p46; Jpn J Hum Genet 1997 Mar;42(1):13-22)','en',1,'2007-10-18 04:28:24',1,NULL,'9792FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9793,132844,'An autosomal recessive metabolic disorder caused by deficiencies in the mitochondrial GLYCINE cleavage system; an enzyme system with four components: P-, T-, H-, and L-proteins. Deficiency of the P-protein is the most prevalent form. Neonatal and juvenile presentations have been reported. Neonatal onset is more common and may be fatal. Clinical features include SEIZURES; hypotonia; APNEA; and COMA. When the illness presents in childhood there tends to be an associated progressive DEMENTIA accompanied by extrapyramidal signs. (Menkes, Textbook of Child Neurology, 5th ed, p46; Jpn J Hum Genet 1997 Mar;42(1):13-22)','en',1,'2007-10-18 04:28:24',1,NULL,'9793FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9795,132860,'Chronic, non-specific disorders of unknown etiology. Includes Crohn disease and ulcerative colitis. Extracolonic manifestations are often associated with Inflammatory Bowel Disease (IBD) and involve the liver, joints and skin.','en',1,'2007-10-18 04:28:24',1,NULL,'9795FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
