(9798,132871,'General term for syndromes of malnutrition due to failure of normal intestinal absorption of nutrients.','en',1,'2007-10-18 04:28:24',1,NULL,'9798FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9799,132875,'A chronic endemic form of hypoplasia of the dental enamel caused by drinking water with a high fluorine content during the time of tooth formation, and characterized by defective calcification that gives a white chalky appearance to the enamel, which gradually undergoes brown discoloration. (Jablonski''s Dictionary of Dentistry, 1992, p286)','en',1,'2007-10-18 04:28:24',1,NULL,'9799FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9800,132876,'An aphasia characterized by impairment of expressive language (speech, writing, signs) and relative preservation of receptive language abilities (i.e., comprehension). This condition is caused by lesions of the motor association cortex in the frontal lobe (Broca''s area and adjacent cortical and white matter regions). The deficits range from almost complete muteness to a reduction in the fluency and rate of speech. CEREBROVASCULAR ACCIDENTS (in particular INFARCTION, MIDDLE CEREBRAL ARTERY) are a relatively common cause of this condition. (From Adams et al., Principles of Neurology, 6th ed, pp478-9)','en',1,'2007-10-18 04:28:24',1,NULL,'9800FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9801,132879,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'9801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9802,132880,'Non-fatal immersion or submersion in water. The subject is resuscitable.','en',1,'2007-10-18 04:28:24',1,NULL,'9802FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
