(9809,132917,'The excessive use of marijuana with associated psychological symptoms and impairment in social or occupational functioning.','en',1,'2007-10-18 04:28:24',1,NULL,'9809FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9810,132928,'A primary, chronic disease with genetic, psychosocial, and environmental factors influencing its development and manifestations. The disease is often progressive and fatal. It is characterized by impaired control over drinking, preoccupation with the drug alcohol, use of alcohol despite adverse consequences, and distortions in thinking, most notably denial. Each of these symptoms may be continuous or periodic. (Morse & Flavin for the Joint Commission of the National Council on Alcoholism and Drug Dependence and the American Society of Addiction Medicine to Study the Definition and Criteria for the Diagnosis of Alcoholism: in JAMA 1992;268:1012-4)','en',1,'2007-10-18 04:28:24',1,NULL,'9810FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9811,132930,'A prolonged seizure or seizures repeated frequently enough to prevent recovery between episodes occurring over a period of 20-30 minutes. The most common subtype is generalized tonic-clonic status epilepticus, a potentially fatal condition associated with neuronal injury and respiratory and metabolic dysfunction. Nonconvulsive forms include petit mal status and complex partial status, which may manifest as behavioral disturbances. Simple partial status epilepticus consists of persistent motor, sensory, or autonomic seizures that do not impair cognition (see also EPILEPSIA PARTIALIS CONTINUA). Subclinical status epilepticus generally refers to seizures occurring in an unresponsive or comatose individual in the absence of overt signs of seizure activity. (From N Engl J Med 1998 Apr 2;338(14):970-6; Neurologia 1997 Dec;12 Suppl 6:25-30)','en',1,'2007-10-18 04:28:24',1,NULL,'9811FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9812,132939,'A chronic, congenital ichthyosis inherited as an autosomal recessive trait. Infants are usually born encased in a collodion membrane which sheds within a few weeks. Scaling is generalized and marked with grayish-brown quadrilateral scales, adherent at their centers and free at the edges. In some cases, scales are so thick that they resemble armored plate.','en',1,'2007-10-18 04:28:24',1,NULL,'9812FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9813,132945,'Acute or chronic pain located in the posterior regions of the trunk, including the thoracic, lumbar, sacral, or adjacent regions.','en',1,'2007-10-18 04:28:24',1,NULL,'9813FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9814,132969,'A reduction in the number of circulating erythrocytes or in the quantity of hemoglobin.','en',1,'2007-10-18 04:28:24',1,NULL,'9814FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9815,132972,'A decrease in the number of GRANULOCYTES (BASOPHILS, EOSINOPHILS, and NEUTROPHILS).','en',1,'2007-10-18 04:28:24',1,NULL,'9815FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9816,132975,'Noises, normal and abnormal, heard on auscultation over any part of the respiratory tract.','en',1,'2007-10-18 04:28:24',1,NULL,'9816FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9817,132976,'Sounds that are perceived in the absence of any external noise source which may take the form of buzzing, ringing, clicking, pulsations, and other noises. Objective tinnitus refers to noises generated from within the ear or adjacent structures that can be heard by other individuals. The term subjective tinnitus is used when the sound is audible only to the affected individual. Tinnitus may occur as a manifestation of COCHLEAR DISEASES; VESTIBULOCOCHLEAR NERVE DISEASES; INTRACRANIAL HYPERTENSION; CRANIOCEREBRAL TRAUMA; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'9817FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9818,132977,'An erythematous eruption commonly associated with drug reactions or infection and characterized by inflammatory nodules that are usually tender, multiple, and bilateral. These nodules are located predominantly on the shins with less common occurrence on the thighs and forearms. They undergo characteristic color changes ending in temporary bruise-like areas. This condition usually subsides in 3-6 weeks without scarring or atrophy.','en',1,'2007-10-18 04:28:24',1,NULL,'9818FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9819,132982,'Malignant lymphoma in which the lymphomatous cells are clustered into identifiable nodules within the lymph nodes. The nodules resemble to some extent the germinal centers of lymph node follicles and most likely represent neoplastic proliferation of lymph node-derived follicular center B-lymphocytes. This class of lymphoma usually occurs in older persons, is commonly multinodal, and possibly extranodal. Patients whose lymphomas present a follicular or nodular pattern generally have a more indolent course than those presenting with a diffuse pattern.','en',1,'2007-10-18 04:28:24',1,NULL,'9819FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
