(9835,133019,'A condition occurring as a result of exposure to a rapid fall in ambient pressure. Gases, nitrogen in particular, come out of solution and form bubbles in body fluid and blood. These gas bubbles accumulate in joint spaces and the peripheral circulation impairing tissue oxygenation causing disorientation, severe pain, and potentially death.','en',1,'2007-10-18 04:28:24',1,NULL,'9835FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
