(9837,133027,'Sleep hyperhidrosis, more commonly known as the night sweats, is the occurrence of excessive sweating (hyperhidrosis) during sleep. The sufferer may or may not also suffer from excessive perspiration while awake. Sleep hyperhidrosis may occur at any age, but is most commonly seen in early adulthood.\r\nref: http://en.wikipedia.org/wiki/Night_sweats','en',1,'2007-11-02 20:10:01',1,'2016-02-25 03:39:56','9837FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
