(9847,133045,'An acute febrile, contagious, viral disease of birds caused by a Paramyxovirus (NEWCASTLE DISEASE VIRUS). It is characterized by respiratory and nervous symptoms in fowl and is transmissible to man causing a severe, but transient conjunctivitis.','en',1,'2007-10-18 04:28:24',1,NULL,'9847FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9848,133053,'A macular lesion on the side of the face, involving the conjunctiva and lids, as well as the adjacent facial skin, sclera, ocular muscles, and periosteum. Histological features vary from those of a mongolian spot to those of a blue nevus.','en',1,'2007-10-18 04:28:24',1,NULL,'9848FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
