(9857,133070,'A disorder of amino acid transport characterized by the childhood (or rarely adult) onset of photosensitive dermatitis and intermittent neurologic symptoms. Ataxia, personality changes, migraine headaches, and photophobia may occur periodically. The disorder results from impaired sodium-dependent transport of neutral amino acids across the brush border membrane of the small intestine and renal tubular epithelium. (From Menkes, Textbook of Child Neurology, 5th ed, pp59-60)','en',1,'2007-10-18 04:28:24',1,NULL,'9857FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9858,133071,'Simultaneous inflammation of the cornea and conjunctiva.','en',1,'2007-10-18 04:28:24',1,NULL,'9858FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9860,133073,'Neurologic disorders caused by exposure to toxic substances through ingestion, injection, cutaneous application, or other method. This includes conditions caused by biologic, chemical, and pharmaceutical agents.','en',1,'2007-10-18 04:28:24',1,NULL,'9860FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9861,133076,'Disorders of the peripheral nervous system associated with the deposition of AMYLOID in nerve tissue. Familial, primary (nonfamilial), and secondary forms have been described. Some familial subtypes demonstrate an autosomal dominant pattern of inheritance. Clinical manifestations include sensory loss, mild weakness, autonomic dysfunction, and CARPAL TUNNEL SYNDROME. (Adams et al., Principles of Neurology, 6th ed, p1349)','en',1,'2007-10-18 04:28:24',1,NULL,'9861FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9862,133082,'Intense or aching pain that occurs along the course or distribution of a peripheral or cranial nerve.','en',1,'2007-10-18 04:28:24',1,NULL,'9862FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9863,133083,'A inherited degenerative disease characterized by neuronal cytoplasmic inclusions which stain positively for ceroid and lipofuscin. Affected individuals develop retinal degeneration, seizures, myoclonus, ataxia, rigidity, and progressive dementia. Clinically there are four subtypes, divided by age of onset of symptoms: infantile (Santavuori-Haltia type), late infantile (Jansky-Bielschowsky type), juvenile (Spielmeyer-Vogt type), and adult (Kuf''s disease). The late infantile and juvenile forms may both also be referred to as Batten Disease and Batten-Mayou Disease. (Adams et al., Principles of Neurology, 6th ed, p957)','en',1,'2007-10-18 04:28:24',1,NULL,'9863FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9864,133084,'A rare neuromuscular disorder with onset usually in late childhood or early adulthood, characterized by intermittent or continuous widespread involuntary muscle contractions; FASCICULATION; hyporeflexia; MUSCLE CRAMP; MUSCLE WEAKNESS; HYPERHIDROSIS; TACHYCARDIA; and MYOKYMIA. Involvement of pharyngeal or laryngeal muscles may interfere with speech and breathing. The continuous motor activity persists during sleep and general anesthesia (distinguishing this condition from STIFF-PERSON SYNDROME). Familial and acquired (primarily autoimmune) forms have been reported. (From Ann NY Acad Sci 1998 May 13;841:482-496; Adams et al., Principles of Neurology, 6th ed, p1491)','en',1,'2007-10-18 04:28:24',1,NULL,'9864FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9865,133085,'A general term encompassing lower MOTOR NEURON DISEASE; PERIPHERAL NERVOUS SYSTEM DISEASES; and certain MUSCULAR DISEASES. Manifestations include MUSCLE WEAKNESS; FASCICULATION; muscle ATROPHY; SPASM; MYOKYMIA; MUSCLE HYPERTONIA, myalgias, and MUSCLE HYPOTONIA.','en',1,'2007-10-18 04:28:24',1,NULL,'9865FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9866,133086,'A syndrome characterized by acute OPTIC NEURITIS in combination with acute MYELITIS, TRANSVERSE. Demyelinating and/or necrotizing lesions form in one or both optic nerves and in the spinal cord. The onset of optic neuritis and myelitis may be simultaneous or separated by several months. (J Neurol Neurosurg Psychiatry 1996 Apr;60(4):382-387)','en',1,'2007-10-18 04:28:24',1,NULL,'9866FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9867,133088,'A general term encompassing lower MOTOR NEURON DISEASE; PERIPHERAL NERVOUS SYSTEM DISEASES; and certain MUSCULAR DISEASES. Manifestations include MUSCLE WEAKNESS; FASCICULATION; muscle ATROPHY; SPASM; MYOKYMIA; MUSCLE HYPERTONIA, myalgias, and MUSCLE HYPOTONIA.','en',1,'2007-10-18 04:28:24',1,NULL,'9867FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9868,133091,'A condition due to congenital lack of thyroid hormone, marked by arrested physical and mental development, dystrophy of the bones and soft parts, and lowered basal metabolism. It is the congenital form of thyroid deficiency, while MYXEDEMA is the acquired form. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9868FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9869,133093,'Conditions which feature clinical manifestations resembling primary Parkinson disease that are caused by a known or suspected condition. Examples include parkinsonism caused by vascular injury, drugs, trauma, toxin exposure, neoplasms, infections and degenerative or hereditary conditions. Clinical features may include bradykinesia, rigidity, parkinsonian gait, and masked facies. In general, tremor is less prominent in secondary parkinsonism than in the primary form. (From Joynt, Clinical Neurology, 1998, Ch38, pp39-42)','en',1,'2007-10-18 04:28:24',1,NULL,'9869FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9870,133097,'A potentially fatal syndrome associated primarily with the use of neuroleptic agents (see ANTIPSYCHOTIC AGENTS) which are in turn associated with dopaminergic receptor blockade (see RECEPTORS, DOPAMINE) in the BASAL GANGLIA and HYPOTHALAMUS, and sympathetic dysregulation. Clinical features include diffuse MUSCLE RIGIDITY; TREMOR; high FEVER; diaphoresis; labile blood pressure; cognitive dysfunction; and autonomic disturbances. Serum CPK level elevation and a leukocytosis may also be present. (From Adams et al., Principles of Neurology, 6th ed, p1199; Psychiatr Serv 1998 Sep;49(9):1163-72)','en',1,'2007-10-18 04:28:24',1,NULL,'9870FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9871,133099,'A form of arboviral encephalitis endemic to Central America and the northern latitudes of South America. The causative organism (ENCEPHALITIS VIRUS, VENEZUELAN EQUINE) is transmitted to humans and horses via the bite of several mosquito species. Human viral infection may be asymptomatic or remain restricted to a mild influenza-like illness. Encephalitis, usually not severe, occurs in a small percentage of cases and may rarely feature SEIZURES and COMA. (From Joynt, Clinical Neurology, 1996, Ch26, pp9-10)','en',1,'2007-10-18 04:28:24',1,NULL,'9871FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9872,133100,'Encephalitis caused by neurotropic viruses that are transmitted via the bite of TICKS. In Europe, the diseases are caused by ENCEPHALITIS VIRUSES, TICK-BORNE, which give rise to Russian spring-summer encephalitis, central European encephalitis, louping ill encephalitis, and related disorders. Powassan encephalitis occurs in North America and Russia and is caused by the Powassan virus. ASEPTIC MENINGITIS and rarely encephalitis may complicate COLORADO TICK FEVER which is endemic to mountainous regions of the western United States. (From Joynt, Clinical Neurology, 1996, Ch26, pp14-5)','en',1,'2007-10-18 04:28:24',1,NULL,'9872FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9873,133102,'A condition associated with compression of the BRACHIAL PLEXUS; SUBCLAVIAN ARTERY; and SUBCLAVIAN VEIN at the thoracic outlet and caused by a complete or incomplete anomalous cervical rib or fascial band connecting the tip of a cervical rib with the first thoracic rib. Clinical manifestations may include pain in the neck and shoulder which radiates into the upper extremity, PARESIS or PARALYSIS of brachial plexus innervated muscles; sensory loss; PARESTHESIAS; ISCHEMIA; and EDEMA. (Adams et al., Principles of Neurology, 6th ed, p214)','en',1,'2007-10-18 04:28:24',1,NULL,'9873FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9874,133103,'A neurovascular syndrome associated with compression of the BRACHIAL PLEXUS; SUBCLAVIAN ARTERY; and SUBCLAVIAN VEIN at the superior thoracic outlet. This may result from a variety of anomalies such as a cervical rib (CERVICAL RIB SYNDROME), anomalous fascial bands, and abnormalities of the origin or insertion of the anterior or medial scalene muscles. Clinical features may include pain in the shoulder and neck region which radiates into the arm, PARESIS or PARALYSIS of brachial plexus innervated muscles, PARESTHESIA, loss of sensation, reduction of arterial pulses in the affected extremity, ISCHEMIA, and EDEMA. (Adams et al., Principles of Neurology, 6th ed, pp214-5).','en',1,'2007-10-18 04:28:24',1,NULL,'9874FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9875,133104,'Chronic progressive degeneration of the stress-bearing portion of a joint, with bizarre hypertrophic changes at the periphery. It is probably a complication of a variety of neurologic disorders, particularly TABES DORSALIS, involving loss of sensation, which leads to relaxation of supporting structures and chronic instability of the joint. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9875FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9876,133106,'An autosomal dominant disorder characterized by a high incidence of bilateral acoustic neuromas as well as other benign intracranial tumors including meningiomas, ependymomas, spinal neurofibromas, and gliomas. The disease has been linked to mutations of the NF2 gene (see GENES, NEUROFIBROMATOSIS 2) on chromosome 22 (22q12) and usually presents clinically in the first or second decade of life.','en',1,'2007-10-18 04:28:24',1,NULL,'9876FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9877,133107,'A group of disorders characterized by an autosomal dominant pattern of inheritance with high rates of spontaneous mutation and multiple neurofibromas or neurilemmomas. NEUROFIBROMATOSIS 1 (generalized neurofibromatosis) accounts for approximately 95% of cases, although multiple additional subtypes (e.g., NEUROFIBROMATOSIS 2, neurofibromatosis 3, etc.) have been described. (From Neurochirurgie 1998 Nov;44(4):267-72)','en',1,'2007-10-18 04:28:24',1,NULL,'9877FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9878,133109,'Congenital malformations of the central nervous system and adjacent structures related to defective neural tube closure during the first trimester of pregnancy generally occurring between days 18-29 of gestation. Ectodermal and mesodermal malformations (mainly involving the skull and vertebrae) may occur as a result of defects of neural tube closure. (From Joynt, Clinical Neurology, 1992, Ch55, pp31-41)','en',1,'2007-10-18 04:28:24',1,NULL,'9878FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9879,133110,'A group of carcinomas which share a characteristic morphology, often being composed of clusters and trabecular sheets of round \"blue cells\", granular chromatin, and an attenuated rim of poorly demarcated cytoplasm. Neuroendocrine tumors include carcinoids, small (\"oat\") cell carcinomas, medullary carcinoma of the thyroid, Merkel cell tumor, cutaneous neuroendocrine carcinoma, pancreatic islet cell tumors, and pheochromocytoma. Neurosecretory granules are found within the tumor cells. (Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,'2015-06-12 21:20:25','9879FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9880,133111,'A group of carcinomas which share a characteristic morphology, often being composed of clusters and trabecular sheets of round \"blue cells\", granular chromatin, and an attenuated rim of poorly demarcated cytoplasm. Neuroendocrine tumors include carcinoids, small (\"oat\") cell carcinomas, medullary carcinoma of the thyroid, Merkel cell tumor, cutaneous neuroendocrine carcinoma, pancreatic islet cell tumors, and pheochromocytoma. Neurosecretory granules are found within the tumor cells. (Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'9880FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9881,133112,'An extremely variable eczematous skin disease that is presumed to be a response to prolonged vigorous scratching, rubbing, or pinching to relieve intense pruritus. It varies in intensity, severity, course, and morphologic expression in different individuals. Neurodermatitis is believed by some to be psychogenic. The circumscribed or localized form is often referred to as lichen simplex chronicus.','en',1,'2007-10-18 04:28:24',1,NULL,'9881FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9882,133116,'A nonspecific term referring both to the pathologic finding of swelling of distal portions of axons in the brain and to disorders which feature this finding. Neuroaxonal dystrophy is seen in various genetic diseases, vitamin deficiencies, and aging. Infantile neuroaxonal dystrophy is an autosomal recessive disease characterized by arrested psychomotor development at 6 months to 2 years of age, ataxia, brain stem dysfunction, and quadriparesis. Juvenile and adult forms also occur. Pathologic findings include brain atrophy and widespread accumulation of axonal spheroids throughout the neuroaxis, peripheral nerves, and dental pulp. (From Davis & Robertson, Textbook of Neuropathology, 2nd ed, p927)','en',1,'2007-10-18 04:28:24',1,NULL,'9882FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9883,133117,'An intervertebral disk in which the nucleus pulposus has protruded through surrounding fibrocartilage. This occurs most frequently in the lower lumbar region.','en',1,'2007-10-18 04:28:24',1,NULL,'9883FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9884,133118,'An intervertebral disk in which the nucleus pulposus has protruded through surrounding fibrocartilage. This occurs most frequently in the lower lumbar region.','en',1,'2007-10-18 04:28:24',1,NULL,'9884FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9885,133119,'An intervertebral disk in which the nucleus pulposus has protruded through surrounding fibrocartilage. This occurs most frequently in the lower lumbar region.','en',1,'2007-10-18 04:28:24',1,NULL,'9885FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9886,133120,'An intervertebral disk in which the nucleus pulposus has protruded through surrounding fibrocartilage. This occurs most frequently in the lower lumbar region.','en',1,'2007-10-18 04:28:24',1,NULL,'9886FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9887,133121,'A neoplasm that arises from SCHWANN CELLS of the cranial, peripheral, and autonomic nerves. Clinically, these tumors may present as a cranial neuropathy, abdominal or soft tissue mass, intracranial lesion, or with spinal cord compression. Histologically, these tumors are encapsulated, highly vascular, and composed of a homogenous pattern of biphasic fusiform-shaped cells that may have a palisaded appearance. (From DeVita Jr et al., Cancer: Principles and Practice of Oncology, 5th ed, pp964-5)','en',1,'2007-10-18 04:28:24',1,NULL,'9887FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9888,133123,'A transient loss of consciousness and postural tone caused by diminished blood flow to the brain (i.e., BRAIN ISCHEMIA). Presyncope refers to the sensation of lightheadedness and loss of strength that precedes a syncopal event or accompanies an incomplete syncope. (From Adams et al., Principles of Neurology, 6th ed, pp367-9)','en',1,'2007-10-18 04:28:24',1,NULL,'9888FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9891,133126,'A common nonarticular rheumatic syndrome characterized by myalgia and multiple points of focal muscle tenderness to palpation (trigger points). Muscle pain is typically aggravated by inactivity or exposure to cold. This condition is often associated with general symptoms, such as sleep disturbances, fatigue, stiffness, HEADACHES, and occasionally DEPRESSION. There is significant overlap between fibromyalgia and the chronic fatigue syndrome (FATIGUE SYNDROME, CHRONIC). Fibromyalgia may arise as a primary or secondary disease process. It is most frequent in females aged 20 to 50 years. (From Adams et al., Principles of Neurology, 6th ed, p1494-95)','en',1,'2007-10-18 04:28:24',1,'2014-07-12 01:43:22','9891FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9892,133127,'Congenital malformations of the central nervous system and adjacent structures related to defective neural tube closure during the first trimester of pregnancy generally occurring between days 18-29 of gestation. Ectodermal and mesodermal malformations (mainly involving the skull and vertebrae) may occur as a result of defects of neural tube closure. (From Joynt, Clinical Neurology, 1992, Ch55, pp31-41)','en',1,'2007-10-18 04:28:24',1,NULL,'9892FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9893,133128,'Hearing loss resulting from damage to the sensory mechanism internal from the oval and round windows.','en',1,'2007-10-18 04:28:24',1,NULL,'9893FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9894,133134,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'9894FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
