(9936,133238,'Neoplasms which originate from pineal parenchymal cells that tend to enlarge the gland and be locally invasive. The two major forms are pineocytoma and the more malignant pineoblastoma. Pineocytomas have moderate cellularity and tend to form rosette patterns. Pineoblastomas are highly cellular tumors containing small, poorly differentiated cells. These tumors occasionally seed the neuroaxis or cause obstructive HYDROCEPHALUS or Parinaud''s syndrome. GERMINOMA; CARCINOMA, EMBRYONAL; GLIOMA; and other neoplasms may arise in the pineal region with germinoma being the most common pineal region tumor. (From DeVita et al., Cancer: Principles and Practice of Oncology, 5th ed, p2064; Adams et al., Principles of Neurology, 6th ed, p670)','en',1,'2007-10-18 04:28:24',1,NULL,'9936FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9937,133240,'An invariably benign, encapsulated, firm round mass at the bifurcation of the common carotid artery, with nests of large polyhedral cells in alveolar or organoid arrangement. It is usually asymptomatic but large masses may encroach upon the parapharyngeal space and produce dysphagia, pain, and cranial nerve palsies. (Dorland, 27th ed; DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, pp570-71)','en',1,'2007-10-18 04:28:24',1,NULL,'9937FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9942,133277,'A benign pituitary-region neoplasm that originates from Rathke''s pouch. The two major histologic and clinical subtypes are adamantinous (or classical) craniopharyngioma and papillary craniopharyngioma. The adamantinous form presents in children and adolescents as an expanding cystic lesion in the pituitary region. The cystic cavity is filled with a black viscous substance and histologically the tumor is composed of adamantinomatous epithelium and areas of calcification and necrosis. Papillary craniopharyngiomas occur in adults, and histologically feature a squamous epithelium with papillations. (From Joynt, Clinical Neurology, 1998, Ch14, p50)','en',1,'2007-10-18 04:28:24',1,NULL,'9942FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(9947,133284,'Rare, slow-growing, benign intraventricular tumors, often asymptomatic and discovered incidentally. The tumors are classified histologically as ependymomas and demonstrate a proliferation of subependymal fibrillary astrocytes among the ependymal tumor cells. (From Clin Neurol Neurosurg 1997 Feb;99(1):17-22)','en',1,'2007-10-18 04:28:24',1,'2013-05-18 11:15:17','9947FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
