(10015,133438,'An acute viral infection involving the respiratory tract. It is marked by inflammation of the nasal mucosa, the pharynx, and conjunctiva, and by headache and severe, often generalized, myalgia.','en',1,'2007-10-18 04:28:24',1,NULL,'10015FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10016,133441,'Refers to any inflammation of the sclera including episcleritis, a benign condition affecting only the episclera, which is generally short-lived and easily treated. Classic scleritis, on the other hand, affects deeper tissue and is characterized by higher rates of visual acuity loss and even mortality, particularly in necrotizing form. Its characteristic symptom is severe and general head pain. Scleritis has also been associated with systemic collagen disease. Etiology is unknown but is thought to involve a local immune response. Treatment is difficult and includes administration of anti-inflammatory and immunosuppressive agents such as corticosteroids. Inflammation of the sclera may also be secondary to inflammation of adjacent tissues, such as the conjunctiva.','en',1,'2007-10-18 04:28:24',1,NULL,'10016FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10017,133443,'A fulminating group A streptococcal infection beginning with severe or extensive cellulitis that spreads to involve the superficial and deep fascia, producing thrombosis of the subcutaneous vessels and gangrene of the underlying tissues. A cutaneous lesion usually serves as a portal of entry for the infection, but sometimes no such lesion is found. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10017FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
