(10044,133516,'Diseases of the nail plate and tissues surrounding it. The concept is limited to primates.','en',1,'2007-10-18 04:28:24',1,NULL,'10044FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10045,133517,'Common form of habitual body manipulation which is an expression of tension.','en',1,'2007-10-18 04:28:24',1,NULL,'10045FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10046,133520,'A hereditary disorder occurring in two forms: the complete form (Franceschetti''s syndrome) is characterized by antimongoloid slant of the palpebral fissures, coloboma of the lower lid, micrognathia and hypoplasia of the zygomatic arches, and microtia. It is transmitted as an autosomal trait. The incomplete form (Treacher Collins syndrome) is characterized by the same anomalies in less pronounced degree. It occurs sporadically, but an autosomal dominant mode of transmission is suspected. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10046FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10047,133524,'A liposarcoma containing myxomatous tissue. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10047FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10048,133525,'A condition due to congenital lack of thyroid hormone, marked by arrested physical and mental development, dystrophy of the bones and soft parts, and lowered basal metabolism. It is the congenital form of thyroid deficiency, while MYXEDEMA is the acquired form. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10048FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10049,133529,'A condition characterized by a dry, waxy type of swelling with abnormal deposits of mucin in the skin and other tissues. It is produced by a functional insufficiency of the thyroid gland, resulting in deficiency of thyroid hormone. The skin becomes puffy around the eyes and on the cheeks and the face is dull and expressionless with thickened nose and lips. The congenital form of the disease is CRETINISM.','en',1,'2007-10-18 04:28:24',1,NULL,'10049FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10051,133534,'A dominantly inherited muscle disease that begins in early childhood and is characterized by severe myotonia (delayed relaxation of a muscle) after forceful voluntary contractions. Muscular hypertrophy is common and myotonia may impair ambulation and other movements. Myotonia typically becomes less severe with repetitive voluntary contractions of the affected muscles. Generalized myotonia (of Becker) is an autosomal recessive variant of myotonia congenita that may feature more severe myotonia and muscle wasting. (From Adams et al., Principles of Neurology, 6th ed, pp1476-7; Joynt, Clinical Neurology, 1997, Ch53, p18)','en',1,'2007-10-18 04:28:24',1,NULL,'10051FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10052,133536,'A dominantly inherited muscle disease that begins in early childhood and is characterized by severe myotonia (delayed relaxation of a muscle) after forceful voluntary contractions. Muscular hypertrophy is common and myotonia may impair ambulation and other movements. Myotonia typically becomes less severe with repetitive voluntary contractions of the affected muscles. Generalized myotonia (of Becker) is an autosomal recessive variant of myotonia congenita that may feature more severe myotonia and muscle wasting. (From Adams et al., Principles of Neurology, 6th ed, pp1476-7; Joynt, Clinical Neurology, 1997, Ch53, p18)','en',1,'2007-10-18 04:28:24',1,NULL,'10052FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10053,133537,'An involuntary contraction of a muscle or group of muscles. Spasms may involve skeletal muscle (MUSCLE, SKELETAL) or smooth muscle (MUSCLE, SMOOTH).','en',1,'2007-10-18 04:28:24',1,NULL,'10053FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10054,133540,'A refractive error in which rays of light entering the eye parallel to the optic axis are brought to a focus in front of the retina, as a result of the eyeball being too long from front to back. It is also called nearsightedness because the near point is less distant than it is in emmetropia with an equal amplitude of accommodation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10054FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10055,133547,'Enlargement or overgrowth of the prostate gland as a result of an increase in the number of its constituent cells.','en',1,'2007-10-18 04:28:24',1,NULL,'10055FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10056,133548,'Successive and rapid contractions of motor units associated with chronic nerve injury. The discharges arise from the peripheral aspects of regenerating nerves, and clinically impart a nearly continuous undulation of the body surface overlying the muscle. (Adams et al., Principles of Neurology, 6th ed, p1491)','en',1,'2007-10-18 04:28:24',1,NULL,'10056FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10057,133553,'A clinically diverse group of epilepsy syndromes characterized either by myoclonic seizures or by myoclonus in association with other seizure types. Myoclonic epilepsy syndromes are divided into three subtypes based on etiology: familial, cryptogenic, and symptomatic (i.e., occurring secondary to known disease processes such as infections, hypoxic-ischemic injuries, trauma, etc.).','en',1,'2007-10-18 04:28:24',1,NULL,'10057FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
