(10073,133579,'Congenital malformations of the central nervous system and adjacent structures related to defective neural tube closure during the first trimester of pregnancy generally occurring between days 18-29 of gestation. Ectodermal and mesodermal malformations (mainly involving the skull and vertebrae) may occur as a result of defects of neural tube closure. (From Joynt, Clinical Neurology, 1992, Ch55, pp31-41)','en',1,'2007-10-18 04:28:24',1,NULL,'10073FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10074,133580,'Congenital, or rarely acquired, herniation of meningeal and spinal cord tissue through a bony defect in the vertebral column. The majority of these defects occur in the lumbosacral region. Clinical features include PARAPLEGIA, loss of sensation in the lower body, and incontinence. This condition may be associated with the ARNOLD-CHIARI MALFORMATION and HYDROCEPHALUS. (From Joynt, Clinical Neurology, 1992, Ch55, pp35-6)','en',1,'2007-10-18 04:28:24',1,NULL,'10074FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10075,133581,'Inflammation of the spinal cord. Relatively common etiologies include infections; AUTOIMMUNE DISEASES; SPINAL CORD; and ischemia (see also SPINAL CORD VASCULAR DISEASES). Clinical features generally include weakness, sensory loss, localized pain, incontinence, and other signs of autonomic dysfunction.','en',1,'2007-10-18 04:28:24',1,NULL,'10075FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10076,133587,'Exudative and proliferative inflammatory alterations of the endocardium, characterized by the presence of vegetations on the surface of the endocardium or in the endocardium itself, and most commonly involving a heart valve, but sometimes affecting the inner lining of the cardiac chambers or the endocardium elsewhere. It may occur as a primary disorder or as a complication of or in association with another disease. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10076FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
