(10089,133603,'Arthritis caused by bacteria, rickettsiae, mycoplasmas, viruses, fungi, or parasites. Bacterial arthritis is frequently caused by Staphylococcus aureus, Streptococcus pneumoniae, Haemophilus influenzae, and Neisseria gonorrhoeae. Viral arthritis is less common than bacterial arthritis and may be a manifestation of such viral diseases as mumps, rubella, hepatitis, etc.','en',1,'2007-10-18 04:28:24',1,NULL,'10089FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10090,133609,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'10090FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10091,133614,'A benign tumor of fibrous or fully developed connective tissue.','en',1,'2007-10-18 04:28:24',1,NULL,'10091FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10092,133617,'A common nonarticular rheumatic syndrome characterized by myalgia and multiple points of focal muscle tenderness to palpation (trigger points). Muscle pain is typically aggravated by inactivity or exposure to cold. This condition is often associated with general symptoms, such as sleep disturbances, fatigue, stiffness, HEADACHES, and occasionally DEPRESSION. There is significant overlap between fibromyalgia and the chronic fatigue syndrome (FATIGUE SYNDROME, CHRONIC). Fibromyalgia may arise as a primary or secondary disease process. It is most frequent in females aged 20 to 50 years. (From Adams et al., Principles of Neurology, 6th ed, p1494-95)','en',1,'2007-10-18 04:28:24',1,NULL,'10092FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10093,133618,'Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharnyx, larnyx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'10093FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10094,133619,'Abnormal increase in skeletal or smooth muscle tone. Skeletal muscle hypertonicity may be associated with PYRAMIDAL TRACT lesions or BASAL GANGLIA DISEASES.','en',1,'2007-10-18 04:28:24',1,NULL,'10094FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10095,133622,'A general term for a group of inherited disorders which are characterized by progressive degeneration of skeletal muscles (MUSCLE, SKELETAL).','en',1,'2007-10-18 04:28:24',1,NULL,'10095FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10097,133624,'Term generally used to describe complaints related to refractive error, ocular muscle imbalance, including pain or aching around the eyes, burning and itchiness of the eyelids, ocular fatigue, and headaches.','en',1,'2007-10-18 04:28:24',1,NULL,'10097FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10098,133628,'A collective term for muscle and ligament injuries without dislocation or fracture. A sprain is a joint injury in which some of the fibers of a supporting ligament are ruptured but the continuity of the ligament remains intact. A strain is an overstretching or overexertion of some part of the musculature.','en',1,'2007-10-18 04:28:24',1,NULL,'10098FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10100,133630,'That phase of a muscle twitch during which a muscle returns to a resting position.','en',1,'2007-10-18 04:28:24',1,NULL,'10100FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10101,133631,'A group of inherited metabolic disorders involving the enzymes responsible for the synthesis and degradation of glycogen. In some patients, prominent liver involvement is presented. In others, more generalized storage of glycogen occurs, sometimes with prominent cardiac involvement.','en',1,'2007-10-18 04:28:24',1,NULL,'10101FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10102,133637,'A state arrived at through prolonged and strong contraction of a muscle. Studies in athletes during prolonged submaximal exercise have shown that muscle fatigue increases in almost direct proportion to the rate of muscle glycogen depletion. Muscle fatigue in short-term maximal exercise is associated with oxygen lack and an increased level of blood and muscle lactic acid, and an accompanying increase in hydrogen-ion concentration in the exercised muscle.','en',1,'2007-10-18 04:28:24',1,NULL,'10102FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10103,133640,'Metabolic disorders affecting amino acid metabolism. They are present at birth, although they may not become symptomatic until later in life. The majority of these disorders are inherited and present in the neonatal period with metabolic disturbances (e.g., ACIDOSIS) and neurologic manifestations.','en',1,'2007-10-18 04:28:24',1,NULL,'10103FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10105,133644,'Infections of the brain caused by arthopod-borne viruses (i.e., arboviruses) primarily from the families TOGAVIRIDAE; FLAVIVIRIDAE; BUNYAVIRIDAE; REOVIRIDAE; and RHABDOVIRIDAE. Life cycles of these viruses are characterized by ZOONOSES, with birds and lower mammals serving as intermediate hosts. The virus is transmitted to humans by the bite of mosquitoes (CULICIDAE) or TICKS. Clinical manifestations include fever, headache, alterations of mentation, focal neurologic deficits, and COMA. (From Clin Microbiol Rev 1994 Jan;7(1):89-116; Walton, Brain''s Diseases of the Nervous System, 10th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'10105FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10106,133645,'An infectious disease clinically similar to epidemic louse-borne typhus (TYPHUS, EPIDEMIC LOUSE-BORNE), but caused by RICKETTSIA TYPHI, which is transmitted from rat to man by the rat flea, Xenopsylla cheopis.','en',1,'2007-10-18 04:28:24',1,NULL,'10106FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10108,133653,'Obstruction of a vessel by a blood clot that has been transported from a distant site by the blood stream.','en',1,'2007-10-18 04:28:24',1,NULL,'10108FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
