(10137,133721,'A complication of a localized area of pneumonia or when a neoplasm becomes necrotic and contains purulent material that cannot drain easily from the area because of partial or complete bronchial obstruction. (Harrison''s Principles of Internal Medicine, 12th ed, p1068)','en',1,'2007-10-18 04:28:24',1,NULL,'10137FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
