(10139,133725,'A circumscribed collection of purulent exudate in the brain, due to bacterial and other infections. The majority are caused by spread of infected material from a focus of suppuration elsewhere in the body, notably the PARANASAL SINUSES, middle ear (see EAR, MIDDLE), HEART (see also ENDOCARDITIS, BACTERIAL), and LUNG. Penetrating CRANIOCEREBRAL TRAUMA and NEUROSURGICAL PROCEDURES may also be associated with this condition. Clinical manifestations include HEADACHE, SEIZURES, focal neurologic deficits, and alterations of consciousness. (Adams et al., Principles of Neurology, 6th ed, pp712-6)','en',1,'2007-10-18 04:28:24',1,NULL,'10139FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10140,133726,'Physical insults or injuries occurring simultaneously in several parts of the body.','en',1,'2007-10-18 04:28:24',1,'2012-11-02 22:38:55','10140FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10141,133729,'Traumatic injuries involving the cranium and intracranial structures (i.e., BRAIN; CRANIAL NERVES; MENINGES; and other structures). Injuries may be classified by whether or not the skull is penetrated (i.e., penetrating vs. nonpenetrating) or whether there is an associated hemorrhage.','en',1,'2007-10-18 04:28:24',1,NULL,'10141FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10142,133730,'Physical insults or injuries occurring simultaneously in several parts of the body.','en',1,'2007-10-18 04:28:24',1,'2014-10-08 18:57:46','10142FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10144,133736,'Fractures of the skull which may result from penetrating or nonpenetrating head injuries or rarely BONE DISEASES (see also FRACTURES, SPONTANEOUS). Skull fractures may be classified by location (e.g., SKULL FRACTURE, BASILAR), radiographic appearance (e.g., linear), or based upon cranial integrity (e.g., SKULL FRACTURE, DEPRESSED).','en',1,'2007-10-18 04:28:24',1,'2016-02-08 02:39:24','10144FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10145,133742,'A disturbance of lipid metabolism with abnormal deposit of lipids in the cells. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10145FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10146,133743,'Abnormal development of cartilage and bone.','en',1,'2007-10-18 04:28:24',1,NULL,'10146FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10147,133744,'A type of multiple endocrine neoplasia occurring as an isolated congenital presentation or as a distinct autosomal dominant disease. It is characterized by the 100% incidence of medullary thyroid carcinoma and frequent pheochromocytomas; patients seldom exhibit hyperparathyroidism. It is distinguished from MEN 2a by its characteristic physical appearance resulting from numerous neural defects including mucosal neuromas of the eyelids, lips, and tongue. The neural abnormalities also include widespread neurogangliomatosis of the gastrointestinal tract leading to abnormal gut motility. Treatment usually requires total thyroidectomy following evaluation for the presence of pheochromocytomas.','en',1,'2007-10-18 04:28:24',1,NULL,'10147FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10148,133745,'A rare syndrome characterized by hyperplasia and/or neoplasms of the pituitary, parathyroid glands, and pancreatic islets. Hyperparathyroidism occurs in 90% of the cases and is usually the first manifestation of the syndrome. The most frequent pancreatic manifestation is gastrinoma typically leading to Zollinger-Ellison Syndrome. The appearance of this condition has been limited to the loss of allelic heterozygosity at the 11q13 locus on the long arm of chromosome 11. Patients overall exhibit long survival times. Chemotherapy is rare and surgical management is generally dependent on the genetic expression in individual patients. (From Holland et al., Cancer Medicine, 3d ed, pp1169-72)','en',1,'2007-10-18 04:28:24',1,NULL,'10148FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10153,133756,'Broken bones in the vertebral column.','en',1,'2007-10-18 04:28:24',1,NULL,'10153FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10154,133774,'The number of offspring a female has borne. It is contrasted with GRAVIDITY, which refers to the number of pregnancies, regardless of outcome.','en',1,'2007-10-18 04:28:24',1,NULL,'10154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10155,133776,'An imprecise term refering to dementia associated with CEREBROVASCULAR DISORDERS, including CEREBRAL INFARCTION (single or multiple), and conditions associated with chronic cerebral ischemia. Diffuse, cortical, and subcortical subtypes have been described. (From Gerontol Geriatr 1998 Feb;31(1):36-44)','en',1,'2007-10-18 04:28:24',1,NULL,'10155FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10156,133777,'An imprecise term refering to dementia associated with CEREBROVASCULAR DISORDERS, including CEREBRAL INFARCTION (single or multiple), and conditions associated with chronic cerebral ischemia. Diffuse, cortical, and subcortical subtypes have been described. (From Gerontol Geriatr 1998 Feb;31(1):36-44)','en',1,'2007-10-18 04:28:24',1,NULL,'10156FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10157,133778,'An imprecise term refering to dementia associated with CEREBROVASCULAR DISORDERS, including CEREBRAL INFARCTION (single or multiple), and conditions associated with chronic cerebral ischemia. Diffuse, cortical, and subcortical subtypes have been described. (From Gerontol Geriatr 1998 Feb;31(1):36-44)','en',1,'2007-10-18 04:28:24',1,NULL,'10157FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10158,133779,'Loss of higher cortical functions with retained awareness due to multiple cortical or subcortical CEREBRAL INFARCTION. Memory, judgement, attention span, and impulse control are often impaired, and may be accompanied by PSEUDOBULBAR PALSY, hemiparesis, reflex abnormalities, and other signs of localized neurologic dysfunction. (From Adams et al., Principles of Neurology, 6th ed, p1060)','en',1,'2007-10-18 04:28:24',1,NULL,'10158FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10159,133783,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'10159FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10160,133785,'Softening or loss of brain tissue following CEREBRAL INFARCTION; cerebral ischemia (see BRAIN ISCHEMIA), infection, CRANIOCEREBRAL TRAUMA, or other injury. The term is often used during gross pathologic inspection to describe blurred cortical margins and decreased consistency of brain tissue following infarction. Multicystic encephalomalacia refers to the formation of multiple cystic cavities of various sizes in the cerebral cortex of neonates and infants following injury, most notably perinatal hypoxia-ischemic events. (From Davis et al., Textbook of Neuropathology, 2nd ed, p665; J Neuropathol Exp Neurol, 1995 Mar;54(2):268-75)','en',1,'2007-10-18 04:28:24',1,NULL,'10160FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10161,133787,'A condition marked by softening of the bones (due to impaired mineralization, with excess accumulation of osteoid), with pain, tenderness, muscular weakness, anorexia, and loss of weight, resulting from deficiency of vitamin D and calcium. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10161FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10162,133797,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'10162FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10163,133798,'Diseases in which skin eruptions or rashes are a prominent manifestation. Classically, six such diseases were described with similar rashes; they were numbered in the order in which they were reported. Only the fourth (Duke''s disease), fifth (ERYTHEMA INFECTIOSUM), and sixth (EXANTHEMA SUBITUM) numeric designations survive as occasional synonyms in current terminology.','en',1,'2007-10-18 04:28:24',1,NULL,'10163FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10165,133802,'Infection in humans and animals caused by any fungus in the order Mucorales (e.g., Absidia, Mucor, Rhizopus etc.) There are many clinical types associated with infection of the central nervous system, lung, gastrointestinal tract, skin, orbit and paranasal sinuses. In humans, it usually occurs as an opportunistic infection in patients with a chronic debilitating disease, particularly uncontrolled diabetes, or who are receiving immunosuppressive agents. (From Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10165FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10166,133804,'Purulent infections of the conjunctiva by several species of gram-negative, gram-positive, or acid-fast organisms. Some of the more commonly found genera causing conjunctival infections are Haemophilus, Streptococcus, Neisseria, and Chlamydia.','en',1,'2007-10-18 04:28:24',1,NULL,'10166FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10167,133806,'Mucopolysaccharidosis characterized by excessive dermatan and heparan sulfates in the urine and Hurler-like features. It is caused by a deficiency of beta-glucuronidase.','en',1,'2007-10-18 04:28:24',1,NULL,'10167FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10168,133807,'Group of lysosomal storage diseases each caused by an inherited deficiency of an enzyme involved in the degradation of glycosaminoglycans (mucopolysaccharides). The diseases are progressive and often display a wide spectrum of clinical severity within one enzyme deficiency.','en',1,'2007-10-18 04:28:24',1,NULL,'10168FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10169,133808,'A disturbance of lipid metabolism with abnormal deposit of lipids in the cells. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10169FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10170,133809,'Systemic lysosomal storage disease caused by a deficiency of alpha-L-iduronidase and characterized by progressive physical deterioration with urinary excretion of dermatan sulfate and heparan sulfate. There are three recognized phenotypes representing a spectrum of clinical severity from severe to mild: Hurler''s syndrome, Hurler-Scheie syndrome and Scheie''s syndrome (formerly mucopolysaccharidosis V). Symptoms may include dwarfism, hepatosplenomegaly, gargoyle-like facies, corneal clouding, cardiac complications, and noisy breathing.','en',1,'2007-10-18 04:28:24',1,NULL,'10170FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10171,133810,'Group of lysosomal storage diseases each caused by an inherited deficiency of an enzyme involved in the degradation of glycosaminoglycans (mucopolysaccharides). The diseases are progressive and often display a wide spectrum of clinical severity within one enzyme deficiency.','en',1,'2007-10-18 04:28:24',1,NULL,'10171FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10172,133811,'Mucopolysaccharidosis characterized by heparitin sulfate in the urine, progressive mental retardation, mild dwarfism, and other skeletal disorders. There are four clinically indistinguishable but biochemically distinct forms, each due to a deficiency of a different enzyme.','en',1,'2007-10-18 04:28:24',1,NULL,'10172FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10173,133812,'Mucopolysaccharidosis characterized by heparitin sulfate in the urine, progressive mental retardation, mild dwarfism, and other skeletal disorders. There are four clinically indistinguishable but biochemically distinct forms, each due to a deficiency of a different enzyme.','en',1,'2007-10-18 04:28:24',1,NULL,'10173FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10174,133813,'Systemic lysosomal storage disease caused by a deficiency of alpha-L-iduronidase and characterized by progressive physical deterioration with urinary excretion of dermatan sulfate and heparan sulfate. There are three recognized phenotypes representing a spectrum of clinical severity from severe to mild: Hurler''s syndrome, Hurler-Scheie syndrome and Scheie''s syndrome (formerly mucopolysaccharidosis V). Symptoms may include dwarfism, hepatosplenomegaly, gargoyle-like facies, corneal clouding, cardiac complications, and noisy breathing.','en',1,'2007-10-18 04:28:24',1,NULL,'10174FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10175,133814,'Systemic lysosomal storage disease caused by a deficiency of alpha-L-iduronidase and characterized by progressive physical deterioration with urinary excretion of dermatan sulfate and heparan sulfate. There are three recognized phenotypes representing a spectrum of clinical severity from severe to mild: Hurler''s syndrome, Hurler-Scheie syndrome and Scheie''s syndrome (formerly mucopolysaccharidosis V). Symptoms may include dwarfism, hepatosplenomegaly, gargoyle-like facies, corneal clouding, cardiac complications, and noisy breathing.','en',1,'2007-10-18 04:28:24',1,NULL,'10175FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10176,133815,'Systemic lysosomal storage disease caused by a deficiency of alpha-L-iduronidase and characterized by progressive physical deterioration with urinary excretion of dermatan sulfate and heparan sulfate. There are three recognized phenotypes representing a spectrum of clinical severity from severe to mild: Hurler''s syndrome, Hurler-Scheie syndrome and Scheie''s syndrome (formerly mucopolysaccharidosis V). Symptoms may include dwarfism, hepatosplenomegaly, gargoyle-like facies, corneal clouding, cardiac complications, and noisy breathing.','en',1,'2007-10-18 04:28:24',1,NULL,'10176FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10177,133816,'Group of lysosomal storage diseases each caused by an inherited deficiency of an enzyme involved in the degradation of glycosaminoglycans (mucopolysaccharides). The diseases are progressive and often display a wide spectrum of clinical severity within one enzyme deficiency.','en',1,'2007-10-18 04:28:24',1,NULL,'10177FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10178,133817,'A group of inherited metabolic diseases characterized by the accumulation of excessive amounts of acid mucopolysaccharides, sphingolipids, and/or glycolipids in visceral and mesenchymal cells. Abnormal amounts of sphingolipids or glycolipids are present in neural tissue. Mental retardation and skeletal changes, most notably dysostosis multiplex, occur frequently. (From Joynt, Clinical Neurology, 1992, Ch56, pp36-7)','en',1,'2007-10-18 04:28:24',1,NULL,'10178FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10180,133820,'A mycosis affecting the skin, mucous membranes, lymph nodes, and internal organs. It is caused by Paracoccidioides brasiliensis. It is also called paracoccidioidal granuloma. Superficial resemblance of P. brasiliensis to Blastomyces brasiliensis (BLASTOMYCES) may cause misdiagnosis.','en',1,'2007-10-18 04:28:24',1,NULL,'10180FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10181,133821,'Infection with a fungus of the species CRYPTOCOCCUS NEOFORMANS.','en',1,'2007-10-18 04:28:24',1,NULL,'10181FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10182,133831,'A disorder of immunoglobulin synthesis in which large quantities of abnormal heavy chains are excreted in the urine. The amino acid sequences of the N- (amino-) terminal regions of these chains are normal, but they have a deletion extending from part of the variable domain through the first domain of the constant region, so that they cannot form cross-links to the light chains. The defect arises through faulty coupling of the variable (V) and constant (C) region genes.','en',1,'2007-10-18 04:28:24',1,NULL,'10182FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10183,133832,'Conditions which feature clinical manifestations resembling primary Parkinson disease that are caused by a known or suspected condition. Examples include parkinsonism caused by vascular injury, drugs, trauma, toxin exposure, neoplasms, infections and degenerative or hereditary conditions. Clinical features may include bradykinesia, rigidity, parkinsonian gait, and masked facies. In general, tremor is less prominent in secondary parkinsonism than in the primary form. (From Joynt, Clinical Neurology, 1998, Ch38, pp39-42)','en',1,'2007-10-18 04:28:24',1,NULL,'10183FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10184,133834,'A chronic cerebral vasculopathy primarily occurring in childhood and characterized by slowly progressive carotid artery narrowing and occlusion at the base of the brain. An extensive network of anastomoses forms between branches of the carotid arteries, resulting in a characteristic angiographic appearance. The condition may be idiopathic (classic moyamoya disease) or occur in association with ANEMIA, SICKLE CELL; DOWN SYNDROME; CRANIOCEREBRAL TRAUMA; RADIOTHERAPY induced arterial injury; NEUROFIBROMATOSIS; and other diseases. Clinical manifestations include hemiparesis, headache, seizures, and delayed mental development. In older individuals, this disease may present as SUBARACHNOID HEMORRHAGE. (From Adams et al., Principles of Neurology, 6th ed, p831; Clin Neurol Neurosurg 1997 Oct;99 Suppl 2:S36-8)','en',1,'2007-10-18 04:28:24',1,NULL,'10184FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10185,133835,'Abnormal breathing through the mouth, usually associated with obstructive disorders of the nasal passages.','en',1,'2007-10-18 04:28:24',1,NULL,'10185FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10186,133837,'A chronic endemic form of hypoplasia of the dental enamel caused by drinking water with a high fluorine content during the time of tooth formation, and characterized by defective calcification that gives a white chalky appearance to the enamel, which gradually undergoes brown discoloration. (Jablonski''s Dictionary of Dentistry, 1992, p286)','en',1,'2007-10-18 04:28:24',1,NULL,'10186FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10187,133838,'A chronic endemic form of hypoplasia of the dental enamel caused by drinking water with a high fluorine content during the time of tooth formation, and characterized by defective calcification that gives a white chalky appearance to the enamel, which gradually undergoes brown discoloration. (Jablonski''s Dictionary of Dentistry, 1992, p286)','en',1,'2007-10-18 04:28:24',1,NULL,'10187FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10189,133925,'Habitual, repeated, rapid contraction of certain muscles, resulting in stereotyped individualized actions that can be voluntarily suppressed for only brief periods. They often involve the face, vocal cords, neck, and less often the extremities. Examples include repetitive throat clearing, vocalizations, sniffing, pursing the lips, and excessive blinking. Tics tend to be aggravated by emotional stress. When frequent they may interfere with speech and INTERPERSONAL RELATIONS. Conditions which feature frequent and prominent tics as a primary manifestation of disease are referred to as TIC DISORDERS. (From Adams et al., Principles of Neurology, 6th ed, pp109-10)','en',1,'2007-10-18 04:28:24',1,NULL,'10189FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10190,133926,'Marked impairments in the development of motor coordination such that the impairment interferes with activities of daily living. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'10190FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10191,133930,'Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharnyx, larnyx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'10191FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10192,133931,'A group of cognitive disorders characterized by the inability to perform previously learned skills that cannot be attributed to deficits of motor or sensory function. The two major subtypes of this condition are ideomotor (see APRAXIA, IDEOMOTOR) and ideational apraxia, which refers to loss of the ability to mentally formulate the processes involved with performing an action. For example, dressing apraxia may result from an inability to mentally formulate the act of placing clothes on the body. Apraxias are generally associated with lesions of the dominant PARIETAL LOBE and supramarginal gyrus. (From Adams et al., Principles of Neurology, 6th ed, pp56-7)','en',1,'2007-10-18 04:28:24',1,NULL,'10192FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10193,133932,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'10193FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10194,133934,'Sickness caused by motion, as sea sickness, train sickness, car sickness, and air sickness.','en',1,'2007-10-18 04:28:24',1,NULL,'10194FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10195,133935,'Physical motion, i.e., a change in position of a body or subject as a result of an external force. It is  distinguished from MOVEMENT, a process resulting from biological activity.','en',1,'2007-10-18 04:28:24',1,NULL,'10195FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10196,133936,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'10196FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10197,133937,'A group of viral diseases of diverse etiology but having many similar clinical characteristics; increased capillary permeability, leukopenia, and thrombocytopenia are common to all. Hemorrhagic fevers are characterized by sudden onset, fever, headache, generalized myalgia, backache, conjunctivitis, and severe prostration, followed by various hemorrhagic symptoms. Hemorrhagic fever with kidney involvement is HEMORRHAGIC FEVER WITH RENAL SYNDROME.','en',1,'2007-10-18 04:28:24',1,NULL,'10197FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10199,133942,'Genetic disorder of mucopolysaccharide metabolism characterized by skeletal abnormalities, joint instability, development of cervical myelopathy, and excessive urinary keratan sulfate. There are two biochemically distinct forms, each due to a deficiency of a different enzyme.','en',1,'2007-10-18 04:28:24',1,NULL,'10199FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10200,133945,'Disorders related or resulting from abuse or mis-use of opioids.','en',1,'2007-10-18 04:28:24',1,NULL,'10200FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10201,133947,'A chronic, localized hardening and thickening of the skin. Lesions may be categorized as morphea (guttate, profunda, pansclerotic) or linear (with or without melorheostosis or hemiatrophy). It is twice as common in women as in men. The condition is characterized by skin ischemia, lymphocytic infiltrates, swollen collagen bundles, and thickening of the dermis with reduction of subcutaneous fat.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 16:29:13','10201FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10202,133949,'Pernicious vomiting of pregnancy. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10202FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10203,133952,'The condition of weighing two, three, or more times the ideal weight, so called because it is associated with many serious and life-threatening disorders.','en',1,'2007-10-18 04:28:24',1,NULL,'10203FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10204,133953,'Loss of epithelial tissue from the surface of the cornea due to progressive erosion and necrosis of the tissue; usually caused by bacterial, fungal, or viral infection.','en',1,'2007-10-18 04:28:24',1,NULL,'10204FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10205,133955,'Subjectively experienced sensations in the absence of an appropriate stimulus, but which are regarded by the individual as real. They may be of organic origin or associated with MENTAL DISORDERS.','en',1,'2007-10-18 04:28:24',1,NULL,'10205FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
