(10213,133967,'A fetus or infant with such pronounced developmental anomalies as to be grotesque and usually nonviable. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10213FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10214,133968,'FIBROUS DYSPLASIA OF BONE involving only one bone.','en',1,'2007-10-18 04:28:24',1,NULL,'10214FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10215,133970,'A general term referring to a mild to moderate degree of muscular weakness, occasionally used as a synonym for PARALYSIS (severe or complete loss of motor function). In the older literature, paresis often referred specifically to paretic neurosyphilis (see NEUROSYPHILIS). \"General paresis\" and \"general paralysis\" may still carry that connotation. Bilateral lower extremity paresis is referred to as PARAPARESIS.','en',1,'2007-10-18 04:28:24',1,NULL,'10215FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10216,133971,'A common, acute infection usually caused by the Epstein-Barr virus (HERPESVIRUS 4, HUMAN). There is an increase in mononuclear white blood cells and other atypical lymphocytes, generalized lymphadenopathy, splenomegaly, and occasionally hepatomegaly with hepatitis.','en',1,'2007-10-18 04:28:24',1,NULL,'10216FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10217,133972,'Disease or trauma involving a single peripheral nerve in isolation, or out of proportion to evidence of diffuse peripheral nerve dysfunction. Mononeuropathy multiplex refers to a condition characterized by multiple isolated nerve injuries. Mononeuropathies may result from a wide variety of causes, including ISCHEMIA; traumatic injury; compression; CONNECTIVE TISSUE DISEASES; CUMULATIVE TRAUMA DISORDERS; and other conditions.','en',1,'2007-10-18 04:28:24',1,'2014-07-12 01:08:53','10217FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10218,133975,'Disease or trauma involving a single peripheral nerve in isolation, or out of proportion to evidence of diffuse peripheral nerve dysfunction. Mononeuropathy multiplex refers to a condition characterized by multiple isolated nerve injuries. Mononeuropathies may result from a wide variety of causes, including ISCHEMIA; traumatic injury; compression; CONNECTIVE TISSUE DISEASES; CUMULATIVE TRAUMA DISORDERS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'10218FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10219,133976,'Disease or trauma involving a single peripheral nerve in isolation, or out of proportion to evidence of diffuse peripheral nerve dysfunction. Mononeuropathy multiplex refers to a condition characterized by multiple isolated nerve injuries. Mononeuropathies may result from a wide variety of causes, including ISCHEMIA; traumatic injury; compression; CONNECTIVE TISSUE DISEASES; CUMULATIVE TRAUMA DISORDERS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'10219FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10220,133977,'Disorders in which there is a loss of ego boundaries or a gross impairment in reality testing with delusions or prominent hallucinations. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'10220FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10221,133992,'A visual symptom in which a single object is perceived by the visual cortex as two objects rather than one. Disorders associated with this condition include REFRACTIVE ERRORS; STRABISMUS; OCULOMOTOR NERVE DISEASES; TROCHLEAR NERVE DISEASES; ABDUCENS NERVE DISEASES; and diseases of the BRAIN STEM and OCCIPITAL LOBE.','en',1,'2007-10-18 04:28:24',1,NULL,'10221FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10223,134001,'A chromosome disorder associated either with an extra chromosome 21 or an effective trisomy for chromosome 21. Clinical manifestations include hypotonia, short stature, brachycephaly, upslanting palpebral fissures, epicanthus, Brushfield spots on the iris, protruding tongue, small ears, short, broad hands, fifth finger clinodactyly, Simian crease, and moderate to severe MENTAL RETARDATION. Cardiac and gastrointestinal malformations, a marked increase in the incidence of LEUKEMIA, and the early onset of ALZHEIMER DISEASE are also associated with this condition. Pathologic features include the development of NEUROFIBRILLARY TANGLES in neurons and the deposition of AMYLOID BETA-PROTEIN, similar to the pathology of ALZHEIMER DISEASE. (Menkes, Textbook of Child Neurology, 5th ed, p213)','en',1,'2007-10-18 04:28:24',1,NULL,'10223FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10224,134004,'A common, benign, usually self-limited viral infection of the skin and occasionally the conjunctivae by a poxvirus (MOLLUSCUM CONTAGIOSUM VIRUS). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10224FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10225,134006,'A trophoblastic disease characterized by hydrops of the mesenchymal portion of the villus. Its karyotype is paternal and usually homozygotic. The tumor is indistinguishable from chorioadenoma destruens or invasive mole ( = HYDATIDIFORM MOLE, INVASIVE) except by karyotype. There is no apparent relation by karyotype to CHORIOCARCINOMA. Hydatidiform refers to the presence of the hydropic state of some or all of the villi (Greek hydatis, a drop of water).','en',1,'2007-10-18 04:28:24',1,NULL,'10225FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10226,134008,'Two syndromes of oral, facial, and digital malformations. Type I (Papillon-Leage and Psaume syndrome, Gorlin-Psaume syndrome) is inherited as an X-linked dominant trait and is found only in females and XXY males. Type II (Mohr syndrome) is inherited as an autosomal recessive trait.','en',1,'2007-10-18 04:28:24',1,NULL,'10226FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
