(10247,134049,'A syndrome of gonadal dysgenesis in which there is a testis on one side and a \"streak gonad\" on the other. The phenotype is generally male, but may be female since the individual is a mosaic. Various karyotypes have been identified, including 45,XO/47,XYY; 45,XO/46,XY; and 45,XO/46,XYo.','en',1,'2007-10-18 04:28:24',1,NULL,'10247FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10248,134056,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'10248FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10249,134057,'Disorders of speech articulation caused by imperfect coordination of pharnyx, larnyx, tongue, or face muscles. This may result from CRANIAL NERVE DISEASES; NEUROMUSCULAR DISEASES; CEREBELLAR DISEASES; BASAL GANGLIA DISEASES; BRAIN STEM diseases; or diseases of the corticobulbar tracts (see PYRAMIDAL TRACTS). The cortical language centers are intact in this condition. (From Adams et al., Principles of Neurology, 6th ed, p489)','en',1,'2007-10-18 04:28:24',1,NULL,'10249FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
