(10297,134164,'A condition characterized by throbbing headaches which are preceded or accompanied by reversible symptoms that reflect cortical or brain stem dysfunction. The most common type of aura consists of a positive visual phenomenon, usually in the form of a scintillating scotoma. An aura may also take the form of other focal neurologic symptoms or signs, including loss of sensation or weakness in an extremity. In general, the aura precedes the headache by less than 60 minutes, develops over 4 minutes or longer, and has a duration of less than one hour. (From Adams et al., Principles of Neurology, 6th ed, p172; Cephalalgia 1988;8:Suppl 7:1-96)','en',1,'2007-10-18 04:28:24',1,NULL,'10297FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10298,134165,'A condition characterized by throbbing headaches which are preceded or accompanied by reversible symptoms that reflect cortical or brain stem dysfunction. The most common type of aura consists of a positive visual phenomenon, usually in the form of a scintillating scotoma. An aura may also take the form of other focal neurologic symptoms or signs, including loss of sensation or weakness in an extremity. In general, the aura precedes the headache by less than 60 minutes, develops over 4 minutes or longer, and has a duration of less than one hour. (From Adams et al., Principles of Neurology, 6th ed, p172; Cephalalgia 1988;8:Suppl 7:1-96)','en',1,'2007-10-18 04:28:24',1,NULL,'10298FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10299,134166,'A subtype of vascular headaches characterized by periodic unilateral pulsatile headaches which begin in childhood, adolescence, or early adult life and recur with diminishing frequency during advancing years. The two major subtypes are CLASSIC MIGRAINE (i.e., migraine with aura) and COMMON MIGRAINE (i.e., migraine without aura). Migrainous episodes may be associated with alterations in cerebral blood flow. (From Adams et al., Principles of Neurology, 6th ed, p172)','en',1,'2007-10-18 04:28:24',1,NULL,'10299FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
