(10362,134353,'Congenital, or rarely acquired, herniation of meningeal and spinal cord tissue through a bony defect in the vertebral column. The majority of these defects occur in the lumbosacral region. Clinical features include PARAPLEGIA, loss of sensation in the lower body, and incontinence. This condition may be associated with the ARNOLD-CHIARI MALFORMATION and HYDROCEPHALUS. (From Joynt, Clinical Neurology, 1992, Ch55, pp35-6)','en',1,'2007-10-18 04:28:24',1,NULL,'10362FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10363,134356,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'10363FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
