(10376,134385,'A condition characterized by neck stiffness, headache, and other symptoms suggestive of meningeal irritation, but without actual inflammation of the meninges (MENINGITIS). Spinal fluid pressure may be elevated but spinal fluid is normal. (DeJong, The Neurologic Examination, 4th ed, p673)','en',1,'2007-10-18 04:28:24',1,NULL,'10376FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10377,134386,'Hemorrhage within the intracranial or spinal subarachnoid space, most often resulting from INTRACRANIAL ANEURYSM rupture or CRANIOCEREBRAL TRAUMA (see also SUBARACHNOID HEMORRHAGE, TRAUMATIC). Clinical features include HEADACHE; NAUSEA; VOMITING, nuchal rigidity, variable neurologic deficits, intraocular subhyaloid hemorrhages, and a reduced level of consciousness which may progress to coma or death. Spasm of intracranial arteries (see VASOSPASM, INTRACRANIAL) frequently accompanies this condition and may lead to cerebral ischemia or CEREBRAL INFARCTION. (From N Engl J Med 1997 Jan 2;336(1):28-40)','en',1,'2007-10-18 04:28:24',1,NULL,'10377FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10378,134390,'A form of osteosclerosis or hyperostosis extending in a linear track through one of the long bones of an extremity, and consisting of proliferated ivory-like new bone. \"Melo-\" is from the Greek, limb and \"-rheostosis\" refers to streaks (rheo- from the Greek, flow), in the bones. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10378FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
