(10380,134392,'An idiopathic syndrome characterized by one or more of the following; recurrent orofacial swelling, relapsing facial paralysis, and fissured tongue (lingua plicata). The onset is usually in childhood and relapses are common. Cheilitis granulomatosa is a monosymptomatic variant of this condition. (Dermatol Clin 1996 Apr;14(2):371-9; Magalini & Magalini, Dictionary of Medical Syndromes, 4th ed, p531)','en',1,'2007-10-18 04:28:24',1,NULL,'10380FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
