(10382,134397,'A schwannoma that arises from the vestibular division of the vestibulocochlear nerve and tends to present in the fifth or sixth decade of life. Clinical manifestations include loss of hearing, headache, vertigo, facial pain, tinnitus, and facial weakness. Bilateral acoustic neuromas are associated with NEUROFIBROMATOSIS 2. (From Adams et al., Principles of Neurology, 6th ed, p673)','en',1,'2007-10-18 04:28:24',1,NULL,'10382FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
