(10386,134408,'A form of pigmented nevus showing intense melanocytic activity around the dermo-epidermal junction. Large numbers of spindle-shaped melanocytes proliferate downward toward the dermis and usually a large amount of pigment is present. It was first described in 1976 and the bulk of patients reported have been young females with the lesions presenting on the thighs. (From Rook et al., Textbook of Dermatology, 4th ed, 1992, p185)','en',1,'2007-10-18 04:28:24',1,NULL,'10386FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10387,134413,'A nevus in which nests of melanocytes are found in the dermis, but not at the epidermal-dermal junction. Benign pigmented nevi in adults are most commonly intradermal. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10387FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10388,134416,'A benign compound nevus occurring most often in children before puberty, composed of spindle and epithelioid cells located mainly in the dermis, sometimes in association with large atypical cells and multinucleate cells, and having a close histopathological resemblance to malignant melanoma. The tumor presents as a smooth to slightly scaly, round to oval, raised, firm papule or nodule, ranging in color from pink-tan to purplish red, often with surface telangiectasia. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10388FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
