(10393,134436,'A megaloblastic anemia occurring in children but more commonly in later life, characterized by histamine-fast achlorhydria, in which the laboratory and clinical manifestations are based on malabsorption of vitamin B 12 due to a failure of the gastric mucosa to secrete adequate and potent intrinsic factor. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10393FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10394,134441,'A nutritional condition produced by a deficiency of FOLIC ACID in the diet. Many plant and animal tissues contain folic acid, abundant in green leafy vegetables, yeast, liver, and mushrooms but destroyed by long-term cooking. Alcohol interferes with its intermediate metabolism and absorption. Folic acid deficiency may develop in long-term anticonvulsant therapy or with use of oral contraceptives. This deficiency causes anemia, macrocytic anemia, and megaloblastic anemia. It is indistinguishable from vitamin B 12 deficiency in peripheral blood and bone marrow findings, but the neurologic lesions seen in B 12 deficiency do not occur. (Merck Manual, 16th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10394FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10395,134453,'Nonlymphocytic leukemia in which 20-30% of the bone marrow or peripheral blood cells are of megakaryocyte lineage. Myelofibrosis or increased bone marrow reticulin is common.','en',1,'2007-10-18 04:28:24',1,NULL,'10395FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10396,134455,'Disorder of lower esophagogastric motility due to failure of the lower esophageal sphincter to relax with swallowing. It is sometimes caused by degeneration of the ganglion cells of the myenteric plexus or of the vagal motor nuclei.','en',1,'2007-10-18 04:28:24',1,NULL,'10396FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10397,134457,'Inherited disorders of mitochondria caused by abnormalities in mitochondrial DNA, primarily manifesting in brain and skeletal muscle tissue. Clinical subtypes include OPHTHALMOPLEGIA, CHRONIC PROGRESSIVE EXTERNAL; MERRF SYNDROME; MELAS SYNDROME; OPTIC ATROPHY, HEREDITARY; and LEIGH DISEASE. (Adams et al., Principles of Neurology, 6th ed, p930)','en',1,'2007-10-18 04:28:24',1,NULL,'10397FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
