(10589,134914,'A malignant tumor that arises from small cutaneous nerves, is locally aggressive, and has a potential for metastasis. Characteristic histopathologic features include proliferating atypical spindle cells with slender wavy and pointed nuclei, hypocellular areas, and areas featuring organized whorls of fibroblastic proliferation. The most common primary sites are the extremities, retroperitoneum, and trunk. These tumors tend to present in childhood, often in association with NEUROFIBROMATOSIS 1. (From DeVita et al., Cancer: Principles & Practice of Oncology, 5th ed, p1662; Mayo Clin Proc 1990 Feb;65(2):164-72)','en',1,'2007-10-18 04:28:24',1,NULL,'10589FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10590,134915,'Group of chronic blistering diseases characterized histologically by acantholysis and blister formation within the epidermis.','en',1,'2007-10-18 04:28:24',1,NULL,'10590FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10591,134917,'Inflammation of the external auditory canal. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10591FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10597,134938,'An adenocarcinoma with a hard (Greek skirrhos, hard) structure owing to the formation of dense connective tissue in the stroma. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10597FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10601,134951,'A common neoplasm of early childhood arising from neural crest cells in the sympathetic nervous system, and characterized by diverse clinical behavior, ranging from spontaneous remission to rapid metastatic progression and death. This tumor is the most common intraabdominal malignacy of childhood, but it may also arise from thorax, neck, or rarely occur in the central nervous system. Histologic features include uniform round cells with hyperchromatic nuclei arranged in nests and separated by fibrovascular septa. Neuroblastomas may be associated with the opsoclonus-myoclonus syndrome. (From DeVita et al., Cancer: Principles and Practice of Oncology, 5th ed, pp2099-2101; Curr Opin Oncol 1998 Jan;10(1):43-51)','en',1,'2007-10-18 04:28:24',1,NULL,'10601FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10602,134957,'A tumor derived from mesothelial tissue (peritoneum, pleura, pericardium). It appears as broad sheets of cells, with some regions containing spindle-shaped, sarcoma-like cells and other regions showing adenomatous patterns. Pleural mesotheliomas have been linked to exposure to asbestos. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10602FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10604,134960,'A carcinoma arising from MERKEL CELLS located in the basal layer of the epidermis and occurring most commonly as a primary neuroendocrine carcinoma of the skin. Merkel cells are tactile cells of neuroectodermal origin and histologically show neurosecretory granules. The skin of the head and neck are a common site of Merkel cell carcinoma, occurring generally in elderly patients. (Holland et al., Cancer Medicine, 3d ed, p1245)','en',1,'2007-10-18 04:28:24',1,NULL,'10604FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10608,134976,'An adenocarcinoma of the thyroid gland, in which the cells are arranged in the form of follicles. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10608FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10612,134988,'A malignant neoplasm made up of epithelial cells tending to infiltrate the surrounding tissues and give rise to metastases. It is a histological type of neoplasm but is often wrongly used as a synonym for \"cancer.\" (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10612FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10615,134993,'A carcinoma thought to be derived from epithelium of terminal bronchioles, in which the neoplastic tissue extends along the alveolar walls and grows in small masses within the alveoli. Involvement may be uniformly diffuse and massive, or nodular, or lobular. The neoplastic cells are cuboidal or columnar and form papillary structures. Mucin may be demonstrated in some of the cells and in the material in the alveoli, which also includes denuded cells. Metastases in regional lymph nodes, and in even more distant sites, are known to occur, but are infrequent. (From Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10615FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
