(10754,135248,'A malignant neoplasm derived from cells that are capable of forming melanin, which may occur in the skin of any part of the body, in the eye, or, rarely, in the mucous membranes of the genitalia, anus, oral cavity, or other sites. It occurs mostly in adults and may originate de novo or from a pigmented nevus or malignant lentigo. Melanomas frequently metastasize widely, and the regional lymph nodes, liver, lungs, and brain are likely to be involved. The incidence of malignant skin melanomas is rising rapidly in all parts of the world. (Stedman, 25th ed; from Rook et al., Textbook of Dermatology, 4th ed, p2445)','en',1,'2007-10-18 04:28:24',1,NULL,'10754FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10755,135250,'A sarcoma of young, often female, adults of the lower extremities and acral regions, intimately bound to tendons as circumscribed but unencapsulated melanin-bearing tumors of neuroectodermal origin. An ultrastructural finding simulates flattened and curved barrel staves, corresponding to the internal structures of premelanosomes. There is a 45-60% mortality in clear cell sarcoma. (Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'10755FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
