(10774,135302,'Malignant lymphoma in which the lymphomatous cells are clustered into identifiable nodules within the lymph nodes. The nodules resemble to some extent the germinal centers of lymph node follicles and most likely represent neoplastic proliferation of lymph node-derived follicular center B-lymphocytes. This class of lymphoma usually occurs in older persons, is commonly multinodal, and possibly extranodal. Patients whose lymphomas present a follicular or nodular pattern generally have a more indolent course than those presenting with a diffuse pattern.','en',1,'2007-10-18 04:28:24',1,NULL,'10774FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10775,135303,'Malignant lymphoma characterized by the presence of immunoblasts with uniformly round-to-oval nuclei, one or more prominent nucleoli, and abundant cytoplasm. This class may be subdivided into plasmacytoid and clear-cell types based on cytoplasmic characteristics. A third category, pleomorphous, may be analogous to some of the peripheral T-cell lymphomas (LYMPHOMA, T-CELL, PERIPHERAL) recorded in both the United States and Japan.','en',1,'2007-10-18 04:28:24',1,NULL,'10775FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
