(10778,135308,'Any of a group of malignant tumors of lymphoid tissue that differ from HODGKIN DISEASE, being more heterogeneous with respect to malignant cell lineage, clinical course, prognosis, and therapy. The only common feature among these tumors is the absence of ','en',1,'2007-10-18 04:28:24',1,NULL,'10778FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10779,135309,'Malignant lymphoma composed of large cells which may be both cleaved and noncleaved. The pattern is predominantly diffuse. Most of these lymphomas represent the malignant counterpart of B-lymphocytes at midstage in the process of differentiation.','en',1,'2007-10-18 04:28:24',1,NULL,'10779FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
