(10814,135388,'A recurrent disease of the oral mucosa of unknown etiology. It is characterized by small white ulcerative lesions, single or multiple, round or oval. Two to eight crops of lesions occur per year, lasting for 7 to 14 days and then heal without scarring. (From Jablonski''s Dictionary of Dentistry, 1992, p742)','en',1,'2007-10-18 04:28:24',1,NULL,'10814FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10815,135393,'A nutritional condition produced by a deficiency of magnesium in the diet, characterized by anorexia, nausea, vomiting, lethargy, and weakness. Symptoms are paresthesias, muscle cramps, irritability, decreased attention span, and mental confusion, possibly requiring months to appear. Deficiency of body magnesium can exist even when serum values are normal. In addition, magnesium deficiency may be organ-selective, since certain tissues become deficient before others. (Harrison''s Principles of Internal Medicine, 12th ed, p1936)','en',1,'2007-10-18 04:28:24',1,NULL,'10815FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
