(10827,135409,'Colloid or hyaline bodies lying beneath the retinal pigment epithelium. They may occur either secondary to changes in the choroid that affect the pigment epithelium or as an autosomal dominant disorder of the retinal pigment epithelium.','en',1,'2007-10-18 04:28:24',1,NULL,'10827FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10829,135411,'Bilateral hereditary disorders of the cornea, usually autosomal dominant, which may be present at birth but more frequently develop during adolescence and progress slowly throughout life. Central macular dystrophy is transmitted as an autosomal recessive defect.','en',1,'2007-10-18 04:28:24',1,NULL,'10829FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10830,135413,'A pituitary adenoma which secretes PROLACTIN, leading to HYPERPROLACTINEMIA. Clinical manifestations include AMENORRHEA; GALACTORRHEA; IMPOTENCE; HEADACHE; visual disturbances; and CEREBROSPINAL RHINORRHEA.','en',1,'2007-10-18 04:28:24',1,NULL,'10830FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10831,135417,'A plasma cell dyscrasia resembling leukemia with cells of lymphocytic, plasmacytic, or intermediate morphology, which secrete an IgM M component. There is diffuse infiltration of bone marrow and also, in many cases, of the spleen, liver, or lymph nodes. The circulating macroglobulin produces symptoms of hyperviscosity syndrome: weakness, fatigue, bleeding disorders, and visual disturbances. Peak incidence is in the sixth and seventh decades. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10831FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10832,135425,'Anemia characterized by larger than normal erythrocytes, increased mean corpuscular volume (MCV) and increased mean corpuscular hemoglobin (MCH).','en',1,'2007-10-18 04:28:24',1,NULL,'10832FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10833,135438,'An autosomal recessively inherited glycogen storage disease caused by GLUCAN 1,4-ALPHA-GLUCOSIDASE DEFICIENCY. Large amounts of GLYCOGEN accumulate in the LYSOSOMES of skeletal muscle (MUSCLE, SKELETAL); HEART; LIVER; SPINAL CORD; and BRAIN. Three forms have been described: infantile, childhood, and adult. The infantile form is fatal in infancy and presents with hypotonia and a hypertrophic cardiomyopathy (CARDIOMYOPATHY, HYPERTROPHIC). The childhood form usually presents in the second year of life with proximal weakness and respiratory symptoms. The adult form consists of a slowly progressive proximal myopathy. (From Muscle Nerve 1995;3:S61-9; Menkes,Textbook of Child Neurology, 5th ed, pp73-4)','en',1,'2007-10-18 04:28:24',1,NULL,'10833FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10834,135439,'A group of inherited metabolic disorders involving the enzymes responsible for the synthesis and degradation of glycogen. In some patients, prominent liver involvement is presented. In others, more generalized storage of glycogen occurs, sometimes with prominent cardiac involvement.','en',1,'2007-10-18 04:28:24',1,NULL,'10834FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10835,135440,'An autosomal recessively inherited glycogen storage disease caused by GLUCAN 1,4-ALPHA-GLUCOSIDASE DEFICIENCY. Large amounts of GLYCOGEN accumulate in the LYSOSOMES of skeletal muscle (MUSCLE, SKELETAL); HEART; LIVER; SPINAL CORD; and BRAIN. Three forms have been described: infantile, childhood, and adult. The infantile form is fatal in infancy and presents with hypotonia and a hypertrophic cardiomyopathy (CARDIOMYOPATHY, HYPERTROPHIC). The childhood form usually presents in the second year of life with proximal weakness and respiratory symptoms. The adult form consists of a slowly progressive proximal myopathy. (From Muscle Nerve 1995;3:S61-9; Menkes,Textbook of Child Neurology, 5th ed, pp73-4)','en',1,'2007-10-18 04:28:24',1,NULL,'10835FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10836,135447,'Malignant lymphoma in which neoplastic cells diffusely infiltrate the entire lymph node without any definite organized pattern. Patients whose lymphomas present a diffuse pattern generally have a more unfavorable survival outlook than those presenting with a follicular or nodular pattern.','en',1,'2007-10-18 04:28:24',1,NULL,'10836FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10837,135448,'Malignant lymphoma in which neoplastic cells diffusely infiltrate the entire lymph node without any definite organized pattern. Patients whose lymphomas present a diffuse pattern generally have a more unfavorable survival outlook than those presenting with a follicular or nodular pattern.','en',1,'2007-10-18 04:28:24',1,NULL,'10837FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10838,135449,'The most common aggressive form of non-Hodgkin lymphoma. It occurs in both diffuse and nodular form. The large cells may have cleaved and non-cleaved nuclei.','en',1,'2007-10-18 04:28:24',1,NULL,'10838FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10843,135454,'Clinically benign, histologically malignant, recurrent cutaneous eruption characterized by an infiltration of large atypical cells surrounded by inflammatory cells. The atypical cells resemble Reed-Sternberg cells of Hodgkin''s disease or the malignant cells of cutaneous T-cell lymphoma. In some cases, lymphomatoid papulosis progresses to lymphomatous conditions including mycosis fungoides, Hodgkin''s disease, cutaneous T-cell lymphoma, or Ki-1 lymphoma.','en',1,'2007-10-18 04:28:24',1,NULL,'10843FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10844,135455,'A multisystem disease chiefly affecting males, characterized by necrotizing granulomatous vasculitis involving the upper and lower respiratory tracts, glomerulonephritis, and variable degrees of systemic, small vessel vasculitis, which is generally considered to represent an aberrant hypersensitivity reaction to an unknown antigen. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10844FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10845,135456,'A general term for various neoplastic diseases of the lymphoid tissue.','en',1,'2007-10-18 04:28:24',1,NULL,'10845FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10847,135462,'Subacute inflammation of the inguinal lymph glands caused by certain immunotypes of CHLAMYDIA TRACHOMATIS. It is a sexually transmitted disease in the U.S. but is more widespread in developing countries. It is distinguished from granuloma venereum (see GRANULOMA INGUINALE), which is caused by Calymmatobacterium granulomatis.','en',1,'2007-10-18 04:28:24',1,NULL,'10847FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10848,135465,'Excess of normal lymphocytes in the blood or in any effusion.','en',1,'2007-10-18 04:28:24',1,NULL,'10848FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
