(10850,135471,'Diminution or cessation of secretion of one or more hormones from the anterior pituitary gland (including LH; FSH; SOMATOTROPIN; and CORTICOTROPIN). This may result from surgical or radiation ablation, non-secretory PITUITARY NEOPLASMS, metastatic tumors, infarction, PITUITARY APOPLEXY, infiltrative or granulomatous processes, and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'10850FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10851,135473,'A form of meningitis caused by LYMPHOCYTIC CHORIOMENINGITIS VIRUS. MICE and other rodents serve as the natural hosts, and infection in humans usually occurs through inhalation or ingestion of infectious particles. Clinical manifestations include an influenza-like syndrome followed by stiff neck, alterations of mentation, ATAXIA, and incontinence. Maternal infections may result in fetal malformations and injury, including neonatal HYDROCEPHALUS, aqueductal stenosis, CHORIORETINITIS, and MICROCEPHALY. (From Joynt, Clinical Neurology, 1996, Ch26, pp1-3)','en',1,'2007-10-18 04:28:24',1,NULL,'10851FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10852,135474,'A form of meningitis caused by LYMPHOCYTIC CHORIOMENINGITIS VIRUS. MICE and other rodents serve as the natural hosts, and infection in humans usually occurs through inhalation or ingestion of infectious particles. Clinical manifestations include an influenza-like syndrome followed by stiff neck, alterations of mentation, ATAXIA, and incontinence. Maternal infections may result in fetal malformations and injury, including neonatal HYDROCEPHALUS, aqueductal stenosis, CHORIORETINITIS, and MICROCEPHALY. (From Joynt, Clinical Neurology, 1996, Ch26, pp1-3)','en',1,'2007-10-18 04:28:24',1,NULL,'10852FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
