(10866,135497,'An infectious disease caused by a spirochete, BORRELIA BURGDORFERI, which is transmitted chiefly by Ixodes dammini (see IXODES) and pacificus ticks in the United States and Ixodes ricinis (see IXODES) in Europe. It is a disease with early and late cutaneous manifestations plus involvement of the nervous system, heart, eye, and joints in variable combinations. The disease was formerly known as Lyme arthritis and first discovered at Old Lyme, Connecticut.','en',1,'2007-10-18 04:28:24',1,NULL,'10866FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10867,135498,'An exfoliative disease of skin seen primarily in adults and characterized by flaccid bullae and spreading erythema so that the skin has the appearance of being scalded. It results primarily from a toxic reaction to various drugs, but occasionally occurs as a result of infection, neoplastic conditions, or other exposure.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 15:31:34','10867FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
