(10876,135529,'Disease involving a spinal nerve root (see SPINAL NERVE ROOTS) which may result from compression related to INTERVERTEBRAL DISK DISPLACEMENT; SPINAL CORD INJURIES; SPINAL DISEASES; and other conditions. Clinical manifestations include radicular pain, weakness, and sensory loss referable to structures innervated by the involved nerve root.','en',1,'2007-10-18 04:28:24',1,NULL,'10876FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10877,135545,'An intervertebral disk in which the nucleus pulposus has protruded through surrounding fibrocartilage. This occurs most frequently in the lower lumbar region.','en',1,'2007-10-18 04:28:24',1,NULL,'10877FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10878,135547,'Severe cellulitis of the submaxillary space with secondary involvement of the sublingual and submental space. It usually results from infection in the lower molar area or from a penetrating injury to the mouth floor. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'10878FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10879,135552,'A form of pre-excitation characterized by a short PR interval associated with a normal QRS complex.','en',1,'2007-10-18 04:28:24',1,NULL,'10879FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10880,135555,'Diseases of the urinary tract in both male and female. It does not include the male genitalia for which UROGENITAL DISEASES is used for general discussions of diseases of both the urinary tract and the genitalia.','en',1,'2007-10-18 04:28:24',1,NULL,'10880FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10881,135557,'Diseases characterized by a selective degeneration of the motor neurons of the spinal cord, brainstem, or motor cortex. Clinical subtypes are distinguished by the major site of degeneration. In AMYOTROPHIC LATERAL SCLEROSIS there is involvment of upper, lower, and brainstem motor neurons. In progressive muscular atrophy and related syndromes (see MUSCULAR ATROPHY, SPINAL) the motor neurons in the spinal cord are primarily affected. With progressive bulbar palsy (BULBAR PALSY, PROGRESSIVE), the initial degeneration occurs in the brainstem. In primary lateral sclerosis, the cortical neurons are affected in isolation. (Adams et al., Principles of Neurology, 6th ed, p1089)','en',1,'2007-10-18 04:28:24',1,NULL,'10881FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10882,135559,'Bleeding in the gastrointestinal tract.','en',1,'2007-10-18 04:28:24',1,NULL,'10882FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10883,135561,'Diseases of the cervical (and first thoracic) roots, nerve trunks, cords, and peripheral nerve components of the BRACHIAL PLEXUS. Clinical manifestations include regional pain, PARESTHESIA; MUSCLE WEAKNESS, and decreased sensation (HYPESTHESIA) in the upper extremity. These disorders may be associated with trauma (including BIRTH INJURIES); THORACIC OUTLET SYNDROME; NEOPLASMS; NEURITIS; RADIOTHERAPY; and other conditions. (From Adams et al., Principles of Neurology, 6th ed, pp1351-2)','en',1,'2007-10-18 04:28:24',1,NULL,'10883FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10884,135563,'A sex-linked recessive disorder of amino acid transport which affects the EYE; NERVOUS SYSTEM; and KIDNEY. Clinical manifestations include CATARACT; GLAUCOMA; developmental delay (which eventually leads to profound cognitive deficits); myopathy; peripheral neuropathy; and hypotonia. There is an associated generalized aminoaciduria of the FANCONI SYNDROME type; renal tubular acidosis (ADIDOSIS, RENAL TUBULAR); and hypophosphatemic RICKETS. This condition has been associated with deficient activity of the enzyme phosphatidylinositol 4,5-bisphosphate-5-phosphatase. (Menkes, Textbook of Child Neurology, 5th ed, p60; Am J Hum Genet 1997 Jun;60(6):1384-8)','en',1,'2007-10-18 04:28:24',1,NULL,'10884FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10885,135564,'Visual impairments limiting one or more of the basic functions of the eye: visual acuity, dark adaptation, color vision, or peripheral vision. These may result from EYE DISEASES; OPTIC NERVE DISEASES; VISUAL PATHWAY diseases; OCCIPITAL LOBE diseases; OCULAR MOTILITY DISORDERS; and other conditions. Visual disability refers to inability of the individual to perform specific visual tasks, such as reading, writing, orientation, or traveling unaided. (From Newell, Ophthalmology: Principles and Concepts, 7th ed, p132)','en',1,'2007-10-18 04:28:24',1,NULL,'10885FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10886,135566,'Vision considered to be inferior to normal vision as represented by accepted standards of acuity, field of vision, or motility. Low vision generally refers to visual disorders that are caused by diseases that cannot be corrected by refraction (e.g., MACULAR DEGENERATION; RETINITIS PIGMENTOSA; DIABETIC RETINOPATHY, etc.).','en',1,'2007-10-18 04:28:24',1,NULL,'10886FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10888,135570,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-10-18 04:28:24',1,NULL,'10888FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10891,135575,'A state of subnormal or depressed cardiac output, usually seen in patients with heart failure secondary to coronary artery, hypertensive, primary myocardial, valvular, or pericardial disease.','en',1,'2007-10-18 04:28:24',1,NULL,'10891FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10892,135578,'The classic form of typhus, caused by RICKETTSIA PROWAZEKII, which is transmitted from man to man by the louse Pediculus humanus corporis. This disease is characterized by the sudden onset of intense headache, malaise, and generalized myalgia followed by the formation of a macular skin eruption and vascular and neurologic disturbances.','en',1,'2007-10-18 04:28:24',1,NULL,'10892FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10893,135579,'An acute infection characterized by recurrent episodes of pyrexia alternating with asymptomatic intervals of apparent recovery. This condition has worldwide distribution and is caused by spirochetes of the genus BORRELIA. It is transmitted by the bites of either the body louse (Pediculus humanus corporis), for which humans are the reservoir, or by soft ticks of the genus Ornithodoros, for which rodents and other animals are the principal reservoirs. (From Dorland, 28th ed)-','en',1,'2007-10-18 04:28:24',1,NULL,'10893FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10894,135581,'A general name for small, wingless, parasitic insects, previously of the order Phthiraptera. Though exact taxonomy is still controversial, they can be grouped in the orders ANOPLURA (sucking lice), MALLOPHAGA (biting lice), and Rhynchophthirina (elephant-lice).','en',1,'2007-10-18 04:28:24',1,NULL,'10894FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10895,135582,'An acute tick-borne arbovirus infection causing meningoencephalomyelitis of sheep.','en',1,'2007-10-18 04:28:24',1,NULL,'10895FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10896,135583,'An abnormally disproportionate increase in the sensation of loudness in response to auditory stimuli of normal volume. COCHLEAR DISEASES; VESTIBULOCOCHLEAR NERVE DISEASES; FACIAL NERVE DISEASES; STAPES SURGERY; and other disorders may be associated with this condition.','en',1,'2007-10-18 04:28:24',1,NULL,'10896FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
