(10997,135880,'Disease involving the ULNAR NERVE from its origin in the BRACHIAL PLEXUS to its termination in the hand. Clinical manifestations may include PARESIS or PARALYSIS of wrist flexion, finger flexion, thumb adduction, finger abduction, and finger adduction. Sensation over the medial palm, fifth finger, and ulnar aspect of the ring finger may also be impaired. Common sites of injury include the AXILLA, cubital tunnel at the ELBOW, and Guyon''s canal at the wrist. (From Joynt, Clinical Neurology, 1995, Ch51 pp43-5)','en',1,'2007-10-18 04:28:24',1,NULL,'10997FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(10999,135887,'An inherited disorder transmitted as a sex-linked trait and caused by a deficiency of an enzyme of purine metabolism; HYPOXANTHINE PHOSPHORIBOSYLTRANSFERASE. Affected individuals are normal in the first year of life and then develop psychomotor retardation, extrapyramidal movement disorders, progressive spasticity, and seizures. Self-destructive behaviors such as biting of fingers and lips are seen frequently. Intellectual impairment may also occur but is typically not severe. Elevation of uric acid in the serum leads to the development of renal calculi and gouty arthritis. (Menkes, Textbook of Child Neurology, 5th ed, pp127)','en',1,'2007-10-18 04:28:24',1,NULL,'10999FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11000,135888,'A disease of the inner ear characterized by vertigo, tinnitus, and fluctuating hearing loss often accompanied by fullness in the affected ear. ENDOLYMPHATIC HYDROPS (swelling of the endolymph-containing structures) is the main pathologic finding.','en',1,'2007-10-18 04:28:24',1,NULL,'11000FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11001,135891,'A syndrome caused by obstruction of the terminal aorta. It usually occurs in males and is characterized by fatigue in the hips, thighs, or calves on exercising, absence of pulsation in the femoral arteries, impotence, and often pallor and coldness of the lower limbs. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11001FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11002,135894,'A severe form of LEPTOSPIROSIS caused by Leptospira interrogans serogroup icterohaemorrhagica and transmitted to man by the rat.','en',1,'2007-10-18 04:28:24',1,NULL,'11002FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11003,135897,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-10-18 04:28:24',1,NULL,'11003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11004,135898,'A chronic communicable infection which is a principal or polar form of LEPROSY. This disorder is caused by MYCOBACTERIUM LEPRAE and produces diffuse granulomatous skin lesions in the form of nodules, macules, or papules. The peripheral nerves are involved symmetrically and neural sequelae occur in the advanced stage.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 14:02:45','11004FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11005,135900,'Thickening of the inner table of the frontal bone, which may be associated with hypertrichosis and obesity. It most commonly affects women near menopause.','en',1,'2007-10-18 04:28:24',1,NULL,'11005FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11006,135904,'A cellular subtype of malignant melanoma. It is a pigmented lesion composed of melanocytes occurring on sun-exposed skin, usually the face and neck. The melanocytes are commonly multinucleated with a \"starburst\" appearance. It is considered by many to be the in situ phase of lentigo maligna melanoma.','en',1,'2007-10-18 04:28:24',1,NULL,'11006FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11007,135905,'Small circumscribed melanoses resembling, but differing histologically from, freckles. The concept includes senile lentigo (''liver spots'') and nevoid lentigo (nevus spilus, lentigo simplex) and may also occur in association with multiple congenital defects or congenital syndromes (e.g., Peutz-Jeghers syndrome).','en',1,'2007-10-18 04:28:24',1,NULL,'11007FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11008,135906,'Small circumscribed melanoses resembling, but differing histologically from, freckles. The concept includes senile lentigo (''liver spots'') and nevoid lentigo (nevus spilus, lentigo simplex) and may also occur in association with multiple congenital defects or congenital syndromes (e.g., Peutz-Jeghers syndrome).','en',1,'2007-10-18 04:28:24',1,NULL,'11008FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11009,135911,'A group of acquired and inborn metabolic disorders primarily of infancy characterized by the subacute onset of psychomotor retardation, hypotonia, ataxia, weakness, vision loss, eye movement abnormalities, seizures, dysphagia, and lactic acidosis. Pathological features include spongy degeneration of the neuropile of the basal ganglia, thalamus, brain stem, and spinal cord. Patterns of inheritance include X-linked recessive, autosomal recessive, and mitochondrial. Defects of the PYRUVATE DEHYDROGENASE COMPLEX and CYTOCHROME-C OXIDASE deficiency have been described as producing this syndrome. (From Menkes, Textbook of Child Neurology, 5th ed, p850)','en',1,'2007-10-18 04:28:24',1,NULL,'11009FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11010,135912,'An acute, sometimes fatal, pneumonia-like bacterial infection characterized by high fever, malaise, muscle aches, respiratory disorders and headache. It is named for an outbreak at the 1976 Philadelphia convention of the American Legion.','en',1,'2007-10-18 04:28:24',1,NULL,'11010FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11011,135913,'An acute, sometimes fatal, pneumonia-like bacterial infection characterized by high fever, malaise, muscle aches, respiratory disorders and headache. It is named for an outbreak at the 1976 Philadelphia convention of the American Legion.','en',1,'2007-10-18 04:28:24',1,NULL,'11011FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11012,135914,'The application of the principles of law and justice to health and medicine.','en',1,'2007-10-18 04:28:24',1,NULL,'11012FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11013,135915,'The use of the death penalty for certain crimes.','en',1,'2007-10-18 04:28:24',1,NULL,'11013FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11014,135917,'The inability to see or the loss or absence of perception of visual stimuli. This condition may be the result of EYE DISEASES; OPTIC NERVE DISEASES; OPTIC CHIASM diseases; or BRAIN DISEASES affecting the VISUAL PATHWAYS or OCCIPITAL LOBE.','en',1,'2007-10-18 04:28:24',1,NULL,'11014FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11015,135968,'A condition in which one of a pair of legs fails to grow as long as the other, which could result from injury or surgery.','en',1,'2007-10-18 04:28:24',1,'2014-06-04 17:38:15','11015FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11016,135970,'Congenital defects in the septum between the cardiac ventricles, most often due to failure of the bulbar septum to completely close the interventricular foramen.','en',1,'2007-10-18 04:28:24',1,NULL,'11016FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11017,135972,'Hypertrophy or enlargement of the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'11017FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11018,135974,'The formation of an area of necrosis in the cerebrum caused by an insufficiency of arterial or venous blood flow. Infarcts of the cerebrum are generally classified by hemisphere (i.e., left vs. right), lobe (e.g., frontal lobe infarction), arterial distribution (e.g., INFARCTION, ANTERIOR CEREBRAL ARTERY), and etiology (e.g., embolic infarction).','en',1,'2007-10-18 04:28:24',1,NULL,'11018FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11020,135987,'Annelids of the class Hirudinea, especially Hirudo medicinalis. Some species, the bloodsuckers, may become temporarily parasitic upon animals, including man. Leeches were formerly used extensively for drawing blood. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11020FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11022,135991,'Hereditary conditions that feature progressive visual loss in association with optic atrophy. Relatively common forms include autosomal dominant optic atrophy and Leber hereditary optic neuropathy. The latter is a rare, maternal linked, genetic disorder that is characterized by progressive bilateral optic nerve degeneration. Male offspring are predominantly affected and develop a loss of central vision in the second or third decade of life. Retinal ganglion cells and optic nerve axons that subserve central vision degenerate. The disease is associated with missense mutations of mitochondrial DNA. In some pedigrees this condition is associated with DYSTONIA, sensory neuropathies, PRE-EXCITATION SYNDROMES, and other disorders. (From Biochim Biophys Acta 1999 Feb 9;1410(2):147-58)','en',1,'2007-10-18 04:28:24',1,NULL,'11022FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11023,135993,'Continuous involuntary sustained muscle contraction which is often a manifestation of BASAL GANGLIA DISEASES. When an affected muscle is passively stretched, the degree of resistance remains constant regardless of the rate at which the muscle is stretched. This feature helps to distinguish rigidity from MUSCLE SPASTICITY. (From Adams et al., Principles of Neurology, 6th ed, p73)','en',1,'2007-10-18 04:28:24',1,NULL,'11023FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11024,135997,'A decrease in the number of GRANULOCYTES (BASOPHILS, EOSINOPHILS, and NEUTROPHILS).','en',1,'2007-10-18 04:28:24',1,NULL,'11024FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11025,135998,'A nonspecific term referring to impaired vision. Major subcategories include stimulus deprivation-induced amblyopia and toxic amblyopia. Stimulus deprivation-induced amblopia is a developmental disorder of the visual cortex. A discrepancy between visual information received by the visual cortex from each eye results in abnormal cortical development. STRABISMUS and REFRACTIVE ERRORS may cause this condition. Toxic amblyopia is a disorder of the OPTIC NERVE which is associated with ALCOHOLISM, tobacco SMOKING, and other toxins and as an adverse effect of the use of some medications.','en',1,'2007-10-18 04:28:24',1,NULL,'11025FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11026,136002,'An autosomal recessive condition characterized by hypogonadism; spinocerebellar degeneration; MENTAL RETARDATION; RETINITIS PIGMENTOSA; and OBESITY. This syndrome was previously referred to as Laurence-Moon-Biedl syndrome until BARDET-BIEDL SYNDROME was identified as a distinct entity. (From N Engl J Med. 1989 Oct 12;321(15):1002-9)','en',1,'2007-10-18 04:28:24',1,NULL,'11026FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11027,136003,'A paralytic condition of the legs caused by ingestion of lathyrogens, especially beta-aminopropionitrile, found in the seeds of plants of the genus Lathyrus (see LEGUMES).','en',1,'2007-10-18 04:28:24',1,NULL,'11027FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11028,136005,'A localization-related (focal) form of epilepsy characterized by recurrent seizures that arise from foci within the temporal lobe, most commonly from its mesial aspect. A wide variety of psychic phenomena may be associated, including illusions, hallucinations, dyscognitive states, and affective experiences. The majority of complex partial seizures (see EPILEPSY, COMPLEX PARTIAL) originate from the temporal lobes. Temporal lobe seizures may be classified by etiolgy as cryptogenic, familial, or symptomatic (i.e., related to an identified disease process or lesion). (From Adams et al., Principles of Neurology, 6th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'11028FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11029,136006,'An epithelium-lined sac containing fluid; usually found at the apex of a pulp-involved tooth. The lateral type occurs less frequently along the side of the root.','en',1,'2007-10-18 04:28:24',1,NULL,'11029FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11030,136008,'A condition characterized by pain in or near the lateral humeral epicondyle or in the forearm extensor muscle mass as a result of unusual strain. It occurs in tennis players as well as housewives, artisans, and violinists.','en',1,'2007-10-18 04:28:24',1,NULL,'11030FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11032,136012,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'11032FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11033,136017,'A personality disorder in which there are oddities of thought (magical thinking, paranoid ideation, suspiciousness), perception (illusions, depersonalization), speech (digressive, vague, overelaborate), and behavior (inappropriate affect in social interactions, frequently social isolation) that are not severe enough to characterize schizophrenia.','en',1,'2007-10-18 04:28:24',1,NULL,'11033FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11034,136019,'Disorders in the processing of iron in the body: its absorption, transport, storage, and utilization. (From Mosby''s Medical, Nursing, & Allied Health Dictionary, 4th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11034FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11035,136020,'A contagious venereal disease caused by the spirochete TREPONEMA PALLIDUM.','en',1,'2007-10-18 04:28:24',1,NULL,'11035FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11036,136022,'A inherited degenerative disease characterized by neuronal cytoplasmic inclusions which stain positively for ceroid and lipofuscin. Affected individuals develop retinal degeneration, seizures, myoclonus, ataxia, rigidity, and progressive dementia. Clinically there are four subtypes, divided by age of onset of symptoms: infantile (Santavuori-Haltia type), late infantile (Jansky-Bielschowsky type), juvenile (Spielmeyer-Vogt type), and adult (Kuf''s disease). The late infantile and juvenile forms may both also be referred to as Batten Disease and Batten-Mayou Disease. (Adams et al., Principles of Neurology, 6th ed, p957)','en',1,'2007-10-18 04:28:24',1,NULL,'11036FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11037,136026,'A cutaneous inflammatory reaction occurring as a result of exposure to ionizing radiation.','en',1,'2007-10-18 04:28:24',1,NULL,'11037FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11040,136030,'An affective disorder manifested by either a dysphoric mood or loss of interest or pleasure in usual activities. The mood disturbance is prominent and relatively persistent.','en',1,'2007-10-18 04:28:24',1,NULL,'11040FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11041,136031,'A heterogenous group of degenerative syndromes marked by progressive cerebellar dysfunction either in isolation or combined with other neurologic manifestations. Sporadic and inherited subtypes occur. Inheritance patterns include autosomal dominant, autosomal recessive, and X-linked.','en',1,'2007-10-18 04:28:24',1,NULL,'11041FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11042,136032,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'11042FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11043,136034,'Unusually late sexual maturity.','en',1,'2007-10-18 04:28:24',1,NULL,'11043FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11044,136036,'A nonspecific term referring both to the pathologic finding of swelling of distal portions of axons in the brain and to disorders which feature this finding. Neuroaxonal dystrophy is seen in various genetic diseases, vitamin deficiencies, and aging. Infantile neuroaxonal dystrophy is an autosomal recessive disease characterized by arrested psychomotor development at 6 months to 2 years of age, ataxia, brain stem dysfunction, and quadriparesis. Juvenile and adult forms also occur. Pathologic findings include brain atrophy and widespread accumulation of axonal spheroids throughout the neuroaxis, peripheral nerves, and dental pulp. (From Davis & Robertson, Textbook of Neuropathology, 2nd ed, p927)','en',1,'2007-10-18 04:28:24',1,NULL,'11044FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11045,136040,'Any of the infectious diseases of man and other animals caused by species of MYCOBACTERIUM.','en',1,'2007-10-18 04:28:24',1,NULL,'11045FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11046,136043,'A condition caused by deficiency of VITAMIN D, especially in infancy and childhood, with disturbance of normal ossification. The disease is marked by bending and distortion of the bones under muscular action, by the formation of nodular enlargements on the ends and sides of the bones, by delayed closure of the fontanels, pain in the muscles, and sweating of the head. Vitamin D and sunlight together with an adequate diet are curative, provided that the parathyroid glands are functioning properly. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11046FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11047,136044,'Any of the infectious diseases of man and other animals caused by species of MYCOBACTERIUM.','en',1,'2007-10-18 04:28:24',1,NULL,'11047FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11048,136046,'A syndrome characterized by new neuromuscular symptoms that occur at least 15 years after clinical stability has been attained in patients with a prior history of symptomatic poliomyelitis. Clinical features include new muscular weakness and atrophy of the limbs, bulbar innervated musculature, and muscles of respiration, combined with excessive fatigue, joint pain, and reduced stamina. The process is marked by slow progression and periods of stabilization. (From Ann NY Acad Sci 1995 May 25;753:68-80)','en',1,'2007-10-18 04:28:24',1,NULL,'11048FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11049,136054,'Any of the infectious diseases of man and other animals caused by species of MYCOBACTERIUM.','en',1,'2007-10-18 04:28:24',1,NULL,'11049FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11050,136055,'Any of the infectious diseases of man and other animals caused by species of MYCOBACTERIUM.','en',1,'2007-10-18 04:28:24',1,NULL,'11050FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11051,136068,'A condition caused by deficiency of VITAMIN D, especially in infancy and childhood, with disturbance of normal ossification. The disease is marked by bending and distortion of the bones under muscular action, by the formation of nodular enlargements on the ends and sides of the bones, by delayed closure of the fontanels, pain in the muscles, and sweating of the head. Vitamin D and sunlight together with an adequate diet are curative, provided that the parathyroid glands are functioning properly. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11051FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11053,136112,'Syphilis acquired in utero and manifested by any of several characteristic tooth (Hutchinson''s teeth) or bone malformations and by active mucocutaneous syphilis at birth or shortly thereafter. Ocular and neurologic changes may also occur.','en',1,'2007-10-18 04:28:24',1,NULL,'11053FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11054,136115,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'11054FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11055,136116,'An acute febrile human disease caused by the Lassa virus.','en',1,'2007-10-18 04:28:24',1,NULL,'11055FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11056,136119,'Spasm of the larynx.','en',1,'2007-10-18 04:28:24',1,'2016-06-22 02:32:25','11056FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11057,136120,'Spasm of the larynx.','en',1,'2007-10-18 04:28:24',1,NULL,'11057FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11058,136121,'Spasm of the larynx.','en',1,'2007-10-18 04:28:24',1,NULL,'11058FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11059,136124,'Paralysis of one or both vocal cords, which produces hoarseness or aphonia. This condition may be caused by diseases of the medulla (e.g., LATERAL MEDULLARY SYNDROME), VAGUS NERVE, or recurrent laryngeal nerve. Neuromuscular junction diseases and local myopathic processes may also affect vocal cord function. (Adams et al., Principles of Neurology, 6th ed, p1380)','en',1,'2007-10-18 04:28:24',1,NULL,'11059FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11060,136125,'A polypoid granulomatous projection into the lumen of the larynx.','en',1,'2007-10-18 04:28:24',1,NULL,'11060FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11061,136126,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'11061FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11062,136128,'A form of dwarfism due to deficient release of SOMATOTROPIN which may result from dysfunction of the hypothalamus or anterior pituitary gland.','en',1,'2007-10-18 04:28:24',1,NULL,'11062FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11063,136130,'Visual impairments limiting one or more of the basic functions of the eye: visual acuity, dark adaptation, color vision, or peripheral vision. These may result from EYE DISEASES; OPTIC NERVE DISEASES; VISUAL PATHWAY diseases; OCCIPITAL LOBE diseases; OCULAR MOTILITY DISORDERS; and other conditions. Visual disability refers to inability of the individual to perform specific visual tasks, such as reading, writing, orientation, or traveling unaided. (From Newell, Ophthalmology: Principles and Concepts, 7th ed, p132)','en',1,'2007-10-18 04:28:24',1,NULL,'11063FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11064,136134,'Enlargement or overgrowth of the prostate gland as a result of an increase in the number of its constituent cells.','en',1,'2007-10-18 04:28:24',1,NULL,'11064FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11065,136135,'The term applied to a group of relatively uncommon inflammatory, maculopapular, scaly eruptions of unknown etiology and resistant to conventional treatment. Eruptions are both psoriatic and lichenoid in appearance, but the diseases are distinct from psoriasis, lichen planus, or other recognized dermatoses. Proposed nomenclature divides parapsoriasis into two distinct subgroups, PITYRIASIS LICHENOIDES and parapsoriasis en plaques (small- and large-plaque parapsoriasis).','en',1,'2007-10-18 04:28:24',1,'2015-04-06 15:19:27','11065FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11066,136136,'Deformities of the nose acquired after birth from injury or disease.','en',1,'2007-10-18 04:28:24',1,NULL,'11066FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11067,136137,'Enlargement of the liver.','en',1,'2007-10-18 04:28:24',1,NULL,'11067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11068,136139,'Leukemia associated with hyperplasia and overactivity of the lymphoid tissue. There are increased numbers of circulating malignant lymphocytes and lymphoblasts. (Dorland, 28th ed, p919)','en',1,'2007-10-18 04:28:24',1,NULL,'11068FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11069,136144,'The most common aggressive form of non-Hodgkin lymphoma. It occurs in both diffuse and nodular form. The large cells may have cleaved and non-cleaved nuclei.','en',1,'2007-10-18 04:28:24',1,NULL,'11069FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11070,136145,'Lymph glad located in the pharynx or throat.','en',1,'2007-10-18 04:28:24',1,NULL,'11070FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11071,136146,'A modification of the epidermis found on almost every surface of the body except the palms of the hands, soles of the feet, and the glans penis. It is a filament of KERATIN consisting of a shaft, a root, and a point.','en',1,'2007-10-18 04:28:24',1,NULL,'11071FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11072,136147,'Conditions characterized by language abilities (comprehension and expression of speech and writing) that are below the expected level for a given age, generally in the absence of an intellectual impairment. These conditions may be associated with DEAFNESS; BRAIN DISEASES; MENTAL DISORDERS; or environmental factors.','en',1,'2007-10-18 04:28:24',1,NULL,'11072FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11073,136148,'The most benign clinical form of Langerhans-cell histiocytosis (HISTIOCYTOSIS, LANGERHANS-CELL), which involves localized nodular lesions of the gastric mucosa, small intestine, bones, lungs, or skin, with infiltration by eosinophils. The proliferating cell that appears to be responsible for the clinical manifestations is the Langerhans cell.','en',1,'2007-10-18 04:28:24',1,NULL,'11073FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11074,136149,'Autosomal dominant disorder characterized by cone-shaped epiphyses in the hands and multiple cartilaginous exostoses. Mental retardation and abnormalities of chromosome 8 are often present. The exostoses in this syndrome appear identical to those of hereditary multiple exostoses (EXOSTOSES, HEREDITARY MULTIPLE).','en',1,'2007-10-18 04:28:24',1,NULL,'11074FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11075,136154,'A chronic, congenital ichthyosis inherited as an autosomal recessive trait. Infants are usually born encased in a collodion membrane which sheds within a few weeks. Scaling is generalized and marked with grayish-brown quadrilateral scales, adherent at their centers and free at the edges. In some cases, scales are so thick that they resemble armored plate.','en',1,'2007-10-18 04:28:24',1,NULL,'11075FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11076,136158,'The formation of an area of necrosis in the cerebrum caused by an insufficiency of arterial or venous blood flow. Infarcts of the cerebrum are generally classified by hemisphere (i.e., left vs. right), lobe (e.g., frontal lobe infarction), arterial distribution (e.g., INFARCTION, ANTERIOR CEREBRAL ARTERY), and etiology (e.g., embolic infarction).','en',1,'2007-10-18 04:28:24',1,NULL,'11076FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11077,136160,'The disease state resulting from the absence of lactase enzyme in the musocal cells of the gastrointestinal tract, and therefore an inability to break down the disaccharide lactose in milk for absorption from the gastrointestinal tract. It is manifested by indigestion of a mild nature to severe diarrhea. It may be due to inborn defect genetically conditioned or may be acquired.','en',1,'2007-10-18 04:28:24',1,NULL,'11077FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11078,136162,'Acidosis caused by accumulation of lactic acid more rapidly than it can be metabolized. It may occur spontaneously or in association with diseases such as diabetes mellitus, leukemia, or liver failure.','en',1,'2007-10-18 04:28:24',1,'2013-02-02 16:50:08','11078FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11079,136174,'A syndrome characterized by persistent or recurrent fatigue, diffuse musculoskeletal pain, sleep disturbances, and subjective cognitive impairment of 6 months duration or longer. Symptoms are not caused by ongoing exertion; are not relieved by rest; and result in a substantial reduction of previous levels of occupational, educational, social, or personal activities. Minor alterations of immune, neuroendocrine, and autonomic function may be associated with this syndrome. There is also considerable overlap between this condition and FIBROMYALGIA. (From Semin Neurol 1998;18(2):237-42; Ann Intern Med 1994 Dec 15;121(12): 953-9)','en',1,'2007-10-18 04:28:24',1,NULL,'11079FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11080,136179,'Penetrating and non-penetrating injuries to the spinal cord resulting from traumatic external forces (e.g., WOUNDS, GUNSHOT; WHIPLASH INJURIES; etc.).','en',1,'2007-10-18 04:28:24',1,NULL,'11080FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11081,136185,'General or unspecified injuries to the hand.','en',1,'2007-10-18 04:28:24',1,NULL,'11081FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11082,136194,'Inflammation of the inner ear.','en',1,'2007-10-18 04:28:24',1,NULL,'11082FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11085,136205,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'11085FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11086,136209,'A viral infection of the brain caused by a member of the CALIFORNIA GROUP VIRUSES, transmitted to humans by the mosquito AEDES triseriatus. The majority of cases are caused by the LA CROSSE VIRUS. This condition is endemic to the midwestern United States and primarily affects children between 5-10 years of age. Clinical manifestations include FEVER, VOMITING, HEADACHE, and abdominal pain followed by SEIZURES, altered mentation, and focal neurologic deficits. (From Joynt, Clinical Neurology, 1996, Ch26, p13)','en',1,'2007-10-18 04:28:24',1,NULL,'11086FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11087,136218,'Tick-borne flavivirus infection occurring in the Kyasanur Forest in India.','en',1,'2007-10-18 04:28:24',1,NULL,'11087FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11088,136219,'The inability to generate oral-verbal expression, despite normal comprehension of speech. This may be associated with BRAIN DISEASES or MENTAL DISORDERS. Organic mutism may be associated with damage to the FRONTAL LOBE; BRAIN STEM; THALAMUS; and CEREBELLUM. Selective mutism is a psychological condition that usually affects children characterized by continuous refusal to speak in social situations by a child who is able and willing to speak to selected persons. Kussmal aphasia refers to mutism in psychosis. (From Fortschr Neurol Psychiatr 1994; 62(9):337-44)','en',1,'2007-10-18 04:28:24',1,NULL,'11088FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11089,136220,'A prion disease found exclusively among the Fore liguistic group natives of the highlands of NEW GUINEA. The illness is primarily restricted to adult females and children of both sexes. It is marked by the subacute onset of tremor and ataxia followed by motor weakness and incontinence. Death occurs within 3-6 months of disease onset. The condition is associated with ritual cannibalism, and has become rare since this practice has been discontinued. Pathologic features include a noninflammatory loss of neurons that is most prominent in the cerebellum, glial proliferation, and amyloid plaques. (From Adams et al., Principles of Neurology, 6th ed, p773)','en',1,'2007-10-18 04:28:24',1,NULL,'11089FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11090,136224,'Mucocellular carcinoma of the ovary, usually metastatic from the gastrointestinal tract, characterized by areas of mucoid degeneration and the presence of signet-ring-like cells. It accounts for 30%-40% of metastatic cancers to the ovaries and possibly 1%-2% of all malignant ovarian tumors. The lesions may not be discovered until the primary disease is advanced, and most patients die of their disease within a year. In some cases, a primary tumor is not found. (From Dorland, 27th ed; Holland et al., Cancer Medicine, 3d ed, p1685','en',1,'2007-10-18 04:28:24',1,NULL,'11090FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11091,136225,'Disorder occurring in the central or peripheral area of the cornea. The usual degree of transparency becomes relatively opaque.','en',1,'2007-10-18 04:28:24',1,NULL,'11091FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11092,136228,'A culture-specific acute delusional syndrome occurring mostly in the Malay people and Southern Chinese. The syndrome is characterized by the individual''s sudden experience of depersonalization depicted by the belief that his penis is shrinking into his abdomen and that he will die when this occurs. Although generally classified as a culture-specific syndrome, koro may be no more than a variant of castration anxiety (ANXIETY, CASTRATION) as it has been described in non-Asian patients.','en',1,'2007-10-18 04:28:24',1,NULL,'11092FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11094,136243,'An abnormal response to a stimulus applied to the sensory components of the nervous system. This may take the form of increased, decreased, or absent reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'11094FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11096,136246,'Gait abnormalities that are a manifestation of nervous system dysfunction. These conditions may be caused by a wide variety of disorders which affect motor control, sensory feedback, and muscle strength including: CENTRAL NERVOUS SYSTEM DISEASES; PERIPHER','en',1,'2007-10-18 04:28:24',1,NULL,'11096FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11097,136250,'Diseases of the cervical (and first thoracic) roots, nerve trunks, cords, and peripheral nerve components of the BRACHIAL PLEXUS. Clinical manifestations include regional pain, PARESTHESIA; MUSCLE WEAKNESS, and decreased sensation (HYPESTHESIA) in the upper extremity. These disorders may be associated with trauma (including BIRTH INJURIES); THORACIC OUTLET SYNDROME; NEOPLASMS; NEURITIS; RADIOTHERAPY; and other conditions. (From Adams et al., Principles of Neurology, 6th ed, pp1351-2)','en',1,'2007-10-18 04:28:24',1,NULL,'11097FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11098,136253,'A condition characterized by shortness of the neck resulting from reduction in the number of vertebrae or the fusion of multiple hemivertebrae into one osseous mass. The hairline is low and the motion of the neck is limited. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11098FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11099,136254,'Disorders whose essential features are the failure to resist an impulse, drive, or temptation to perform an act that is harmful to the individual or to others. Individuals experience an increased sense of tension prior to the act and pleasure, gratification or release of tension at the time of committing the act.','en',1,'2007-10-18 04:28:24',1,NULL,'11099FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11100,136255,'A group of disorders which have in common elevations of tyrosine in the blood and urine secondary to an enzyme deficiency. Type I tyrosinemia features episodic weakness, self-mutilation, hepatic necrosis, renal tubular injury, and seizures and is caused by a deficiency of the enzyme fumarylacetoacetase. Type II tyrosinemia features mental retardation, painful corneal ulcers, and keratoses of the palms and plantar surfaces and is caused by a deficiency of the enzyme TYROSINE TRANSAMINASE. Type III tyrosinemia features mental retardation and is caused by a deficiency of the enzyme 4-HYDROXYPHENYLPYRUVATE DIOXYGENASE. (Menkes, Textbook of Child Neurology, 5th ed, pp42-3)','en',1,'2007-10-18 04:28:24',1,NULL,'11100FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11101,136256,'A rare condition characterized by recurrent hypersomnias associated with hyperphagia, occurring primarily in males in the second to third decade of life. Clinical features include mental confusion, excessive sleep requirements (approximately 18 hours per day), restlessness, and in some cases hallucinations. Episodes have a duration of days to weeks, and may recur several times per year. This condition may resolve spontaneously over several years. (From Adams, et al., Principles of Neurology, 6th ed, p569)','en',1,'2007-10-18 04:28:24',1,NULL,'11101FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11102,136257,'Adenocarcinoma of the common hepatic duct bifurcation. These tumors are generally small, sharply localized, and seldom metastasizing. G. Klatskin''s original review of 13 cases was published in 1965. Once thought to be relatively uncommon, tumors of the bifurcation of the bile duct now appear to comprise more than one-half of all bile duct cancers. (From Holland et al., Cancer Medicine, 3d ed, p1457)','en',1,'2007-10-18 04:28:24',1,NULL,'11102FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11103,136259,'Solitary or multiple benign cutaneous nodules comprised of immature and mature vascular structures intermingled with endothelial cells and a varied infiltrate of eosinophils, histiocytes, lymphocytes, and mast cells.','en',1,'2007-10-18 04:28:24',1,NULL,'11103FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11104,136261,'The killing of one person by another.','en',1,'2007-10-18 04:28:24',1,NULL,'11104FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11106,136272,'Conditions which affect the structure or function of the pupil of the eye, including disorders of innervation to the pupillary constrictor or dilator muscles, and disorders of pupillary reflexes.','en',1,'2007-10-18 04:28:24',1,NULL,'11106FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11107,136274,'A condition characterized by an abnormally elevated concentration of ketone bodies in the body tissues and fluids. It is a complication of diabetes mellitus and starvation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11107FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11108,136278,'A pathologic condition resulting from accumulation of acid or depletion of the alkaline reserve (bicarbonate) content of the blood and body tissues, and characterized by an increase in hydrogen ion concentration (decrease in pH). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11108FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11109,136281,'A term used pathologically to describe BILIRUBIN staining of the BASAL GANGLIA; BRAIN STEM; and CEREBELLUM and clinically to describe a syndrome associated with HYPERBILIRUBINEMIA. Clinical features include athetosis, MUSCLE SPASTICITY or hypotonia, impaired vertical gaze, and DEAFNESS. Nonconjugated bilirubin enters the brain and acts as a neurotoxin, often in association with conditions that impair the BLOOD-BRAIN BARRIER (e.g., SEPSIS). This condition occurs primarily in neonates (INFANT, NEWBORN),  but may rarely occur in adults. (Menkes, Textbook of Child Neurology, 5th ed, p613)','en',1,'2007-10-18 04:28:24',1,'2013-11-30 20:03:54','11109FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11110,136282,'A term used pathologically to describe BILIRUBIN staining of the BASAL GANGLIA; BRAIN STEM; and CEREBELLUM and clinically to describe a syndrome associated with HYPERBILIRUBINEMIA. Clinical features include athetosis, MUSCLE SPASTICITY or hypotonia, impaired vertical gaze, and DEAFNESS. Nonconjugated bilirubin enters the brain and acts as a neurotoxin, often in association with conditions that impair the BLOOD-BRAIN BARRIER (e.g., SEPSIS). This condition occurs primarily in neonates (INFANT, NEWBORN),  but may rarely occur in adults. (Menkes, Textbook of Child Neurology, 5th ed, p613)','en',1,'2007-10-18 04:28:24',1,NULL,'11110FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11111,136290,'Any horny growth such as a wart or callus.','en',1,'2007-10-18 04:28:24',1,NULL,'11111FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11112,136292,'Diseases of the cornea.','en',1,'2007-10-18 04:28:24',1,NULL,'11112FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11113,136293,'Any horny growth such as a wart or callus.','en',1,'2007-10-18 04:28:24',1,NULL,'11113FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11114,136295,'A noninflammatory, usually bilateral protrusion of the cornea, the apex being displaced downward and nasally. It occurs most commonly in females at about puberty. The cause is unknown but hereditary factors may play a role. The -conus refers to the cone shape of the corneal protrusion. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11114FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11115,136296,'A noninflammatory, usually bilateral protrusion of the cornea, the apex being displaced downward and nasally. It occurs most commonly in females at about puberty. The cause is unknown but hereditary factors may play a role. The -conus refers to the cone shape of the corneal protrusion. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11115FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11116,136298,'Drying and inflammation of the conjunctiva as a result of insufficient lacrimal secretion. When found in association with XEROSTOMIA and polyarthritis, it is called SJOGREN''S SYNDROME.','en',1,'2007-10-18 04:28:24',1,NULL,'11116FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11117,136300,'A benign, non-neoplastic, usually self-limiting epithelial lesion closely resembling squamous cell carcinoma clinically and histopathologically. It occurs in solitary, multiple, and eruptive forms. The solitary and multiple forms occur on sunlight exposed areas and are identical histologically; they affect primarily white males. The eruptive form usually involves both sexes and appears as a generalized papular eruption.','en',1,'2007-10-18 04:28:24',1,NULL,'11117FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11119,136302,'Simultaneous inflammation of the cornea and conjunctiva.','en',1,'2007-10-18 04:28:24',1,NULL,'11119FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11120,136304,'Intradermal or subcutaneous saclike structure, the wall of which is stratified epithelium containing keratohyalin granules.','en',1,'2007-10-18 04:28:24',1,NULL,'11120FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11121,136305,'An autosomal recessive disorder caused by deficiency of the enzyme glucocerebrosidase (see GLUCOSYLCERAMIDASE) featuring the pathological storage of glycosylceramide in mononuclear PHAGOCYTES (Gaucher Cells). The most common subtype is the non-neuronopathic form, a slowly progressive condition characterized by hepatosplenomegaly and skeletal deformities. The neuronopathic forms are divided into infantile and juvenile forms. The infantile form presents at 4-5 months of age with anemia, loss of cognitive gains, neck retraction, dysphagia, and hepatosplenomegaly. The juvenile form features a slowly progressive loss of intellect, hepatosplenomegaly, ATAXIA, myoclonic SEIZURES, and spasticity. The neuronopathic forms are characterized by neuronal loss with neuronophagia, and accumulation of glucocerebroside in neurons. (From Baillieres Clin Haematol 1997 Dec;10(4):711-23; Menkes, Textbook of Child Neurology, 5th ed, p97)','en',1,'2007-10-18 04:28:24',1,NULL,'11121FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11122,136308,'A sharply elevated, irregularly shaped, progressively enlarging scar resulting from formation of excessive amounts of collagen in the dermis during connective tissue repair. It is differentiated from a hypertrophic scar (CICATRIX, HYPERTROPHIC) in that the former does not spread to surrounding tissues.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 16:27:07','11122FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11124,136320,'Lateral transposition of the viscera of the thorax and abdomen. It has a familial pattern and consanguineous parents have been reported. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11124FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11125,136322,'A disseminated vesicular-pustular eruption caused by the herpes simplex virus (HERPESVIRUS HOMINUS), the VACCINIA VIRUS, or Varicella zoster (HERPESVIRUS 3, HUMAN). It is usually superimposed on a preexisting, inactive or active, atopic dermatitis (DERMATITIS, ATOPIC).','en',1,'2007-10-18 04:28:24',1,NULL,'11125FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11126,136323,'A disseminated vesicular-pustular eruption caused by the herpes simplex virus (HERPESVIRUS HOMINUS), the VACCINIA VIRUS, or Varicella zoster (HERPESVIRUS 3, HUMAN). It is usually superimposed on a preexisting, inactive or active, atopic dermatitis (DERMATITIS, ATOPIC).','en',1,'2007-10-18 04:28:24',1,NULL,'11126FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11127,136324,'A multicentric, malignant neoplastic vascular proliferation characterized by the development of bluish-red cutaneous nodules, usually on the lower extremities, most often on the toes or feet, and slowly increasing in size and number and spreading to more proximal areas. The tumors have endothelium-lined channels and vascular spaces admixed with variably sized aggregates of spindle-shaped cells, and often remain confined to the skin and subcutaneous tissue, but widespread visceral involvement may occur. Kaposi''s sarcoma occurs spontaneously in Jewish and Italian males in Europe and the United States. An aggressive variant in young children is endemic in some areas of Africa. A third form occurs in about 0.04% of kidney transplant patients. There is also a high incidence in AIDS patients. (From Dorland, 27th ed & Holland et al., Cancer Medicine, 3d ed, pp2105-7) HHV-8 is the suspected cause.','en',1,'2007-10-18 04:28:24',1,NULL,'11127FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11128,136325,'Mapped to 507','en',1,'2007-10-18 04:28:24',1,NULL,'11128FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
