(11133,136330,'Pneumoconiosis due to the inhalation of dust of stone, sand, or flint containing silicon dioxide, with formation of generalized, nodular fibrotic changes in both lungs. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11133FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
