(11136,136343,'Rheumatoid arthritis of children occurring in three major subtypes defined by the symptoms present during the first six months following onset: systemic-onset (Still''s Disease, Juvenile-Onset) polyarticular-onset, and pauciarticular-onset. Adult-onset cases of Still''s disease (STILL''S DISEASE, ADULT-ONSET) are also known. Only one subtype of juvenile rheumatoid arthritis (polyarticular-onset, rheumatoid factor-positive) clinically resembles adult rheumatoid arthritis and is considered its childhood equivalent.','en',1,'2007-10-18 04:28:24',1,NULL,'11136FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11137,136344,'Hereditary, progressive degeneration of the neuroepithelium of the retina characterized by night blindness and progressive contraction of the visual field.','en',1,'2007-10-18 04:28:24',1,NULL,'11137FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11138,136346,'Localized periodontitis in teenagers and young adults. The onset is during the circumpubertal period but the diagnosis can be made beyond puberty. Lesions are confined predominantly to the first permanent molars or incisors and the distribution of lesions is usually symmetrical. The gingiva may appear normal. The lesions are highly active immediately following puberty but later destruction may slow or cease spontaneously. The disease is four times more prevalent in females than males and more prevalent in African Americans than in other races or ethnic groups. (From Schluger et al., Periodontal Diseases, 2d ed, p61)','en',1,'2007-10-18 04:28:24',1,NULL,'11138FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11139,136348,'A progressive, degenerative neurologic disease characterized by a TREMOR that is maximal at rest, retropulsion (i.e. a tendency to fall backwards), rigidity, stooped posture, slowness of voluntary movements, and a masklike facial expression. Pathologic features include loss of melanin containing neurons in the substantia nigra and other pigmented nuclei of the brainstem. LEWY BODIES are present in the substantia nigra and locus coeruleus but may also be found in a related condition (LEWY BODY DISEASE, DIFFUSE) characterized by dementia in combination with varying degrees of parkinsonism. (Adams et al., Principles of Neurology, 6th ed, p1059, pp1067-75)','en',1,'2007-10-18 04:28:24',1,NULL,'11139FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11140,136349,'A progressive, degenerative neurologic disease characterized by a TREMOR that is maximal at rest, retropulsion (i.e. a tendency to fall backwards), rigidity, stooped posture, slowness of voluntary movements, and a masklike facial expression. Pathologic features include loss of melanin containing neurons in the substantia nigra and other pigmented nuclei of the brainstem. LEWY BODIES are present in the substantia nigra and locus coeruleus but may also be found in a related condition (LEWY BODY DISEASE, DIFFUSE) characterized by dementia in combination with varying degrees of parkinsonism. (Adams et al., Principles of Neurology, 6th ed, p1059, pp1067-75)','en',1,'2007-10-18 04:28:24',1,NULL,'11140FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11141,136351,'Inflammation of bone and cartilage.','en',1,'2007-10-18 04:28:24',1,NULL,'11141FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11142,136359,'Inflammation of bone and cartilage.','en',1,'2007-10-18 04:28:24',1,NULL,'11142FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11143,136363,'Inflammation of bone and cartilage.','en',1,'2007-10-18 04:28:24',1,NULL,'11143FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11144,136367,'A familial disorder inherited as an autosomal dominant trait and characterized by the onset of progressive CHOREA and DEMENTIA in the fourth or fifth decade of life. Common initial manifestations include paranoia; poor impulse control; DEPRESSION; HALLUCINATIONS; and DELUSIONS. Eventually intellectual impairment; loss of fine motor control; ATHETOSIS; and diffuse CHOREA involving axial and limb musculature develops, leading to a vegetative state within 10-15 years of disease onset. The juvenile variant has a more fulminant course including SEIZURES; ATAXIA; dementia; and chorea. (From Adams et al., Principles of Neurology, 6th ed, pp1060-4)','en',1,'2007-10-18 04:28:24',1,NULL,'11144FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11145,136369,'A inherited degenerative disease characterized by neuronal cytoplasmic inclusions which stain positively for ceroid and lipofuscin. Affected individuals develop retinal degeneration, seizures, myoclonus, ataxia, rigidity, and progressive dementia. Clinically there are four subtypes, divided by age of onset of symptoms: infantile (Santavuori-Haltia type), late infantile (Jansky-Bielschowsky type), juvenile (Spielmeyer-Vogt type), and adult (Kuf''s disease). The late infantile and juvenile forms may both also be referred to as Batten Disease and Batten-Mayou Disease. (Adams et al., Principles of Neurology, 6th ed, p957)','en',1,'2007-10-18 04:28:24',1,NULL,'11145FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11146,136374,'Disorders in the processing of iron in the body: its absorption, transport, storage, and utilization. (From Mosby''s Medical, Nursing, & Allied Health Dictionary, 4th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11146FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11147,136376,'A form of gangliosidosis characterized by accumulation of G(M1) GANGLIOSIDE and oligosaccharides in lysosomes caused by an absence or severe deficiency of the enzyme BETA-GALACTOSIDASE (type A1). The three phenotypes of this disorder are infantile (generalized), juvenile, and adult. The infantile form is characterized by skeletal abnormalities, hypotonia, poor psychomotor development, hirsutism, hepatosplenomegaly, and facial abnormalities. The juvenile form features hyperacusis, seizures, and psychomotor retardation. The adult form features progressive intellectual deterioration, involuntary movements, ataxia, and spasticity. (From Menkes, Textbook of Child Neurology, 5th ed, pp96-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11147FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11148,136377,'An autosomal recessive lysosomal storage disease caused by a deficiency of ALPHA-L-FUCOSIDASE activity resulting in an accumulation of fucose containing SPHINGOLIPIDS, GLYCOPROTEINS, and mucopolysaccharides (GLYCOSAMINOGLYCANS) in lysosomes. The infantile form (type I) features psychomotor deterioration, MUSCLE SPASTICITY, coarse facial features, growth retardation, skeletal abnormalities, visceromegaly, SEIZURES, recurrent infections, and MACROGLOSSIA, with death occurring in the first decade of life. Juvenile fucosidosis (type II) is the more common variant and features a slowly progressive decline in neurologic function and angiokeratoma corporis diffusum. Type II survival may be through the fourth decade of life. (From Menkes, Textbook of Child Neurology, 5th ed, p87; Am J Med Genet 1991 Jan;38(1):111-31)','en',1,'2007-10-18 04:28:24',1,NULL,'11148FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11150,136384,'Rheumatoid arthritis of children occurring in three major subtypes defined by the symptoms present during the first six months following onset: systemic-onset (Still''s Disease, Juvenile-Onset) polyarticular-onset, and pauciarticular-onset. Adult-onset cases of Still''s disease (STILL''S DISEASE, ADULT-ONSET) are also known. Only one subtype of juvenile rheumatoid arthritis (polyarticular-onset, rheumatoid factor-positive) clinically resembles adult rheumatoid arthritis and is considered its childhood equivalent.','en',1,'2007-10-18 04:28:24',1,NULL,'11150FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11151,136385,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'11151FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11152,136389,'A childhood seizure disorder characterized by rhythmic electrical brain discharges of geneneralized onset. Clinical features include a sudden cessation of ongoing activity usually without loss of postural tone. Rhythmic blinking of the eyelids or lip smacking frequently accompanies the seizure. The usual duration is 5-10 seconds, and multiple episodes may occur daily. Juvenile absence epilepsy is characterized by the juvenile onset of absence seizures and an increased incidence of myoclonus and tonic-clonic seizures. (Menkes, Textbook of Child Neurology, 5th ed, p736)','en',1,'2007-10-18 04:28:24',1,NULL,'11152FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11153,136391,'An acute infectious disease primarily of the tropics, caused by a virus and transmitted to man by mosquitoes of the genera Aedes and Haemagogus.','en',1,'2007-10-18 04:28:24',1,NULL,'11153FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11154,136392,'Form of epidermolysis bullosa having onset at birth or during the neonatal period and transmitted through autosomal recessive inheritance. It is characterized by generalized blister formation, extensive denudation, and separation and cleavage of the basal cell plasma membranes from the basement membrane.','en',1,'2007-10-18 04:28:24',1,NULL,'11154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11155,136393,'Form of epidermolysis bullosa having onset at birth or during the neonatal period and transmitted through autosomal recessive inheritance. It is characterized by generalized blister formation, extensive denudation, and separation and cleavage of the basal cell plasma membranes from the basement membrane.','en',1,'2007-10-18 04:28:24',1,NULL,'11155FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
