(11163,136405,'Arthritis, especially of the great toe, as a result of gout. Acute gouty arthritis often is precipitated by trauma, infection, surgery, etc. The initial attacks are usually monoarticular but later attacks are often polyarticular.','en',1,'2007-10-18 04:28:24',1,NULL,'11163FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11164,136411,'Lack of stability of a joint or joint prosthesis. Factors involved are intra-articular disease and integrity of extra-articular structures such as joint capsule, ligaments, and muscles.','en',1,'2007-10-18 04:28:24',1,NULL,'11164FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11165,136416,'Accumulation of watery fluid in the cavity of a joint. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11165FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11166,136433,'Syndrome characterized by history of syncopal episodes and a long QT interval, sometimes leading to sudden death due to paroxysmal ventricular arrhythmia. When associated with autosomal recessive inheritance and congenital deafness, it is called the Jervell-Lange Nielsen syndrome. When associated with autosomal dominant inheritance and no deafness is present, it is called the Romano-Ward syndrome.','en',1,'2007-10-18 04:28:24',1,NULL,'11166FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11167,136434,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'11167FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11168,136438,'Chronic mental disorders in which there has been an insidious development of a permanent and unshakeable delusional system (persecutory delusions or delusions of jealousy), accompanied by preservation of clear and orderly thinking. Emotional responses and behavior are consistent with the delusional state.','en',1,'2007-10-18 04:28:24',1,NULL,'11168FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11169,136439,'An autosomal disorder of the peripheral and autonomic nervous systems limited to individuals of Ashkenazic Jewish descent. Clinical manifestations are present at birth and include diminished lacrimation, defective thermoregulation, orthostatic hypotension (HYPOTENSION, ORTHOSTATIC), fixed pupils, excessive SWEATING, loss of pain and temperature sensation, and absent reflexes. Pathologic features include reduced numbers of small diameter peripheral nerve fibers and autonomic ganglion neurons. (From Adams et al., Principles of Neurology, 6th ed, p1348; Nat Genet 1993;4(2):160-4)','en',1,'2007-10-18 04:28:24',1,NULL,'11169FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11171,136443,'DEF:Yellow pigmentation of the skin and sclerae due to a raised level of plasma bilirubin. DESC: classified by the type of circulating bilirubin (conjugated or uncongugated). REF OXFORD CLINICAL MEDICINE','en',1,'2007-11-02 20:02:04',1,'2015-12-31 16:44:51','11171FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11172,136447,'A mosquito-borne encephalitis caused by the Japanese B encephalitis virus (ENCEPHALITIS VIRUS, JAPANESE) occurring throughout Eastern Asia and Australia. The majority of infections occur in children and are subclinical or have features limited to transient fever and gastrointestinal symptoms. Inflammation of the brain, spinal cord, and meninges may occur and lead to transient or permanent neurologic deficits (including a POLIOMYELITIS-like presentation); SEIZURES; COMA; and death. (From Adams et al., Principles of Neurology, 6th ed, p751; Lancet 1998 Apr 11;351(9109):1094-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11172FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11173,136452,'Contraceptive devices placed high in the uterine fundus with a string extending from the device through the cervical as into the vagina. (UMDNS, 1999)','en',1,'2007-10-18 04:28:24',1,'2016-02-20 05:09:53','11173FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11174,136454,'An intense itching sensation that produces the urge to rub or scratch the skin to obtain relief.','en',1,'2007-10-18 04:28:24',1,NULL,'11174FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11175,136457,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'11175FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
