(11184,136501,'Inflammation of a bursa, occasionally accompanied by a calcific deposit in the underlying supraspinatus tendon. The most common site is the subdeltoid bursa. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11184FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11185,136503,'Ischemic injury to the optic nerve which usually affects the optic disk (optic neuropathy, anterior ischemic) and less frequently the retrobulbar portion of the nerve (optic neuropathy, posterior ischemic). The injury results from occlusion of arterial blood supply which may result from TEMPORAL ARTERITIS; ATHEROSCLEROSIS; COLLAGEN DISEASES; EMBOLI; DIABETES MELLITUS; and other conditions. The disease primarily occurs in the sixth decade or later and presents with the sudden onset of painless and usually severe monocular visual loss. Anterior ischemic optic neuropathy also features optic disk edema with microhemorrhages. The optic disk appears normal in posterior ischemic optic neuropathy. (Glaser, Neuro-Ophthalmology, 2nd ed, p135)','en',1,'2007-10-18 04:28:24',1,NULL,'11185FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11187,136505,'Lesion on the surface of the skin of the foot, usually accompanied by inflammation. The lesion may become infected or necrotic and is frequently associated with diabetes or leprosy.','en',1,'2007-10-18 04:28:24',1,NULL,'11187FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
