(11232,136622,'Neoplasms of the intracranial components of the central nervous system, including the cerebral hemispheres, basal ganglia, hypothalamus, thalamus, brain stem, and cerebellum. Brain neoplasms are subdivided into primary (originating from brain tissue) and secondary (i.e., metastatic) forms. Primary neoplasms are subdivided into benign and malignant forms. In general, brain tumors may also be classified by age of onset, histologic type, or presenting location in the brain.','en',1,'2007-10-18 04:28:24',1,NULL,'11232FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11233,136623,'Neoplasms of the intracranial components of the central nervous system, including the cerebral hemispheres, basal ganglia, hypothalamus, thalamus, brain stem, and cerebellum. Brain neoplasms are subdivided into primary (originating from brain tissue) and secondary (i.e., metastatic) forms. Primary neoplasms are subdivided into benign and malignant forms. In general, brain tumors may also be classified by age of onset, histologic type, or presenting location in the brain.','en',1,'2007-10-18 04:28:24',1,NULL,'11233FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11234,136625,'A relatively common neoplasm of the central nervous system that arises from arachnoidal cells. The majority are well differentiated vascular tumors which grow slowly and have a low potential to be invasive, although malignant subtypes occur. Meningiomas have a predilection to arise from the parasagittal region, cerebral convexity, sphenoidal ridge, olfactory groove, and spinal canal. They tend to present in the fourth to sixth decades of life with signs indicative of a slowly progressive mass lesion. Specific clinical manifestations depend on the location of the tumor, but may include INTRACRANIAL HYPERTENSION, cranial neuropathies, ataxia, and other focal neurologic signs. (From DeVita et al., Cancer: Principles and Practice of Oncology, 5th ed, pp2056-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11234FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11235,136626,'Neoplasms of the intracranial components of the central nervous system, including the cerebral hemispheres, basal ganglia, hypothalamus, thalamus, brain stem, and cerebellum. Brain neoplasms are subdivided into primary (originating from brain tissue) and secondary (i.e., metastatic) forms. Primary neoplasms are subdivided into benign and malignant forms. In general, brain tumors may also be classified by age of onset, histologic type, or presenting location in the brain.','en',1,'2007-10-18 04:28:24',1,NULL,'11235FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11236,136643,'Acute and chronic (see also BRAIN INJURIES, CHRONIC) injuries to the brain, including the cerebral hemispheres, CEREBELLUM, and BRAIN STEM. Clinical manifestations depend on the nature of injury. Diffuse trauma to the brain is frequently associated with DIFFUSE AXONAL INJURY or COMA, POST-TRAUMATIC. Localized injuries may be associated with NEUROBEHAVIORAL MANIFESTATIONS; HEMIPARESIS, or other focal neurologic deficits.','en',1,'2007-10-18 04:28:24',1,NULL,'11236FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11237,136658,'Bleeding within the cranial vault induced by penetrating and nonpenetrating traumatic injuries, including hemorrhages into the epidural, subdural and subarachnoid spaces, cerebral hemispheres, DIENCEPHALON; BRAIN STEM; and CEREBELLUM.','en',1,'2007-10-18 04:28:24',1,NULL,'11237FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11239,136660,'Congenital or acquired abnormal outpouching of an intracranial blood vessel wall. Saccular (berry) aneurysms are the most common variant, and tend to form at arterial branch points near the base of the brain. Rupture results in SUBARACHNOID HEMORRHAGE or INTRACRANIAL HEMORRHAGES. Giant aneurysms (>2.5 cm in diameter) may compress adjacent structures, including the OCULOMOTOR NERVE (see also OCULOMOTOR NERVE DISEASES). (From Adams et al., Principles of Neurology, 6th ed, p841)','en',1,'2007-10-18 04:28:24',1,NULL,'11239FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11240,136661,'A circumscribed collection of purulent exudate in the brain, due to bacterial and other infections. The majority are caused by spread of infected material from a focus of suppuration elsewhere in the body, notably the PARANASAL SINUSES, middle ear (see EAR, MIDDLE), HEART (see also ENDOCARDITIS, BACTERIAL), and LUNG. Penetrating CRANIOCEREBRAL TRAUMA and NEUROSURGICAL PROCEDURES may also be associated with this condition. Clinical manifestations include HEADACHE, SEIZURES, focal neurologic deficits, and alterations of consciousness. (Adams et al., Principles of Neurology, 6th ed, pp712-6)','en',1,'2007-10-18 04:28:24',1,NULL,'11240FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11241,136662,'A circumscribed collection of purulent exudate in the brain, due to bacterial and other infections. The majority are caused by spread of infected material from a focus of suppuration elsewhere in the body, notably the PARANASAL SINUSES, middle ear (see EAR, MIDDLE), HEART (see also ENDOCARDITIS, BACTERIAL), and LUNG. Penetrating CRANIOCEREBRAL TRAUMA and NEUROSURGICAL PROCEDURES may also be associated with this condition. Clinical manifestations include HEADACHE, SEIZURES, focal neurologic deficits, and alterations of consciousness. (Adams et al., Principles of Neurology, 6th ed, pp712-6)','en',1,'2007-10-18 04:28:24',1,NULL,'11241FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
