(11243,136669,'A group of conditions due to overexposure to or overexertion in excess environmental temperature. It includes heat cramps, which are non-emergent and treated by salt replacement; HEAT EXHAUSTION, which is more serious, treated with fluid and salt replacement; and HEAT STROKE, a condition most commonly affecting extremes of age, especially the elderly, accompanied by convulsions, delusions, or coma and treated with cooling the body and replacement of fluids and salts. (From Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'11243FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
