(11258,136713,'A superficial dermatitis occurring on skin surfaces in contact with each other, such as the axillae, neck creases, intergluteal fold, between the toes, etc. Obesity is a predisposing factor. The condition is caused by moisture and friction and is characterized by erythema, maceration, burning, and exudation.','en',1,'2007-10-18 04:28:24',1,NULL,'11258FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
