(11262,136722,'Originally, a state characterized by the presence of both male and female sex organs. In humans, true hermaphroditism is caused by anomalous differentiation of the gonads, with the presence of both ovarian and testicular tissue and of ambiguous morphologic criteria of sex. If only testicular tissue is present, but there are some female morphological criteria of sex, it is known as male PSEUDOHERMAPHRODITISM. If only ovarian tissue is present, but there are some male morphological criteria of sex, it is known as female PSEUDOHERMAPHRODITISM. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11262FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11263,136727,'Resorption of calcified dental tissue, involving demineralization due to reversal of the cation exchange and lacunar resorption by osteoclasts. There are two types: external (as a result of tooth pathology) and internal (apparently initiated by a peculiar inflammatory hyperplasia of the pulp). (From Jablonski, Dictionary of Dentistry, 1992, p676)','en',1,'2007-10-18 04:28:24',1,NULL,'11263FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11264,136733,'Protrusion of the rectal mucous membrane through the anus. There are various degrees: incomplete with no displacement of the anal sphincter muscle; complete with displacement of the anal sphincter muscle; complete with no displacement of the anal sphincter muscle but with herniation of the bowel; and internal complete with rectosigmoid or upper rectum intussusception into the lower rectum.','en',1,'2007-10-18 04:28:24',1,NULL,'11264FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11265,136734,'Narrowing or stricture of the internal, common, or external carotid artery, most often as a result of atherosclerotic plaque formation. Ulcerations may form in atherosclerotic plaques and induce thrombus formation. Platelet or cholesterol emboli may arise from stenotic carotid lesions and induce a transient ischemic attack (ISCHEMIC ATTACK, TRANSIENT) or CEREBROVASCULAR ACCIDENT. Emboli which travel to the eye may manifest as AMAUROSIS FUGAX (temporary blindness). (From Adams et al., Principles of Neurology, 6th ed, pp822-3)','en',1,'2007-10-18 04:28:24',1,NULL,'11265FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11266,136735,'Bleeding into a cerebral hemisphere of the brain, including lobar, subcortical white matter, and basal ganglia hemorrhages. Commonly associated conditions include HYPERTENSION; INTRACRANIAL ARTERIOSCLEROSIS; INTRACRANIAL ANEURYSM; CRANIOCEREBRAL TRAUMA; INTRACRANIAL ARTERIOVENOUS MALFORMATIONS; CEREBRAL AMYLOID ANGIOPATHY; and CEREBRAL INFARCTION.','en',1,'2007-10-18 04:28:24',1,NULL,'11266FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11267,136737,'An illusion of movement, either of the external world revolving around the individual or of the individual revolving in space. Vertigo may be associated with disorders of the inner ear, vestibular nerve, brainstem, and cerebral cortex. Lesions in the temporal and parietal lobes may be associated with FOCAL SEIZURES that may feature vertigo as an ictal manifestation. (From Adams et al., Principles of Neurology, 6th ed, pp300-1)','en',1,'2007-10-18 04:28:24',1,NULL,'11267FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11268,136738,'Misalignment of the visual axes of the eyes. In comitant strabismus the degree of ocular misalignment does not vary with the direction of gaze. In noncomitant strabismus the degree of misalignment varies depending on direction of gaze or which eye is fixating on the target. (Miller, Walsh & Hoyt''s Clinical Neuro-Ophthalmology, 4th ed, p641)','en',1,'2007-10-18 04:28:24',1,NULL,'11268FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11269,136740,'A focal dystonia characterized by a sustained spasmodic contraction of neck muscles. The trapezius and sternocleidomastoid muscles are primarily involved, resulting in twisting of the neck and an unnatural position of the head. Torticollis may occur as a primary disease process or in association with another condition (e.g., NECK INJURIES, the use of ANTIPSYCHOTIC AGENTS, etc.). (From Adams et al., Principles of Neurology, 6th ed, p107)','en',1,'2007-10-18 04:28:24',1,NULL,'11269FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11270,136742,'General or unspecified diseases of the blood vessels outside the heart. It is for diseases of the peripheral as opposed to the cardiac circulation.','en',1,'2007-10-18 04:28:24',1,NULL,'11270FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11271,136745,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'11271FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11272,136746,'Disorders whose essential features are the failure to resist an impulse, drive, or temptation to perform an act that is harmful to the individual or to others. Individuals experience an increased sense of tension prior to the act and pleasure, gratification or release of tension at the time of committing the act.','en',1,'2007-10-18 04:28:24',1,NULL,'11272FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11273,136750,'Brief reversible episodes of focal, nonconvulsive ischemic dysfunction of the brain having a duration of less than 24 hours, and usually less than one hour, caused by transient thrombotic or embolic blood vessel occlusion or stenosis. Events may be classified by arterial distribution, temporal pattern, or etiology (e.g., embolic vs. thrombotic). (From Adams et al., Principles of Neurology, 6th ed, pp814-6)','en',1,'2007-10-18 04:28:24',1,NULL,'11273FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
