(11281,136769,'Defects in the septum between the atria of the heart, due to failure of fusion between either the septum secundum or the septum primum and the endocardial cushions.','en',1,'2007-10-18 04:28:24',1,NULL,'11281FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11282,136771,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'11282FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11283,136772,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'11283FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
