(11288,136779,'Diabetes mellitus characterized by insulin deficiency, sudden onset, severe hyperglycemia, rapid progression to ketoacidosis, and death unless treated with insulin. The disease may occur at any age, but is most common in childhood or adolescence.','en',1,'2007-10-18 04:28:24',1,NULL,'11288FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
