(11292,136789,'Lack of stability of a joint or joint prosthesis. Factors involved are intra-articular disease and integrity of extra-articular structures such as joint capsule, ligaments, and muscles.','en',1,'2007-10-18 04:28:24',1,NULL,'11292FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11293,136790,'Noises, normal and abnormal, heard on auscultation over any part of the respiratory tract.','en',1,'2007-10-18 04:28:24',1,NULL,'11293FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11294,136791,'A condition associated with multiple episodes of sleep apnea which are distinguished from obstructive sleep apnea (SLEEP APNEA, OBSTRUCTIVE) by the complete cessation of efforts to breathe. This disorder is associated with dysfunction of central nervous system centers that regulate respiration. This condition may be idiopathic (primary) or associated with lower brain stem lesions; chronic obstructive pulmonary disease (LUNG DISEASES, OBSTRUCTIVE); HEART FAILURE, CONGESTIVE; medication effect; and other conditions. Sleep maintenance is impaired, resulting in daytime hypersomnolence. Primary central sleep apnea is frequently associated with obstructive sleep apnea. When both forms are present the condition is referred to as mixed sleep apnea (see SLEEP APNEA SYNDROMES). (Adams et al., Principles of Neurology, 6th ed, p395; Neurol Clin 1996;14(3):611-28)','en',1,'2007-10-18 04:28:24',1,NULL,'11294FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11295,136816,'Neurologic disorders associated with exposure to inorganic and organic forms of MERCURY. Acute intoxication may be associated with gastrointestinal disturbances, mental status changes, and PARAPARESIS. Chronic exposure to inorganic mercury usually occurs in industrial workers, and manifests as mental confusion, prominent behavioral changes (including psychosis), DYSKINESIAS, and NEURITIS. Alkyl mercury poisoning may occur through ingestion of contaminated seafood or grain, and its characteristic features include POLYNEUROPATHY; ATAXIA; vision loss; NYSTAGMUS; and DEAFNESS. (From Joynt, Clinical Neurology, 1997, Ch20, pp10-15)','en',1,'2007-10-18 04:28:24',1,NULL,'11295FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11296,136817,'Disorders associated with acute or chronic exposure to compounds containing ARSENIC (ARSENICALS) which may be fatal. Acute oral ingestion is associated with gastrointestinal symptoms and an encephalopathy which may manifest as SEIZURES, mental status changes, and COMA. Chronic exposure is associated with mucosal irritation, desquamating rash, myalgias, peripheral neuropathy, and white transverse (Mees) lines in the fingernails. (Adams et al., Principles of Neurology, 6th ed, p1212)','en',1,'2007-10-18 04:28:24',1,NULL,'11296FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11297,136839,'Diseases of the cervical (and first thoracic) roots, nerve trunks, cords, and peripheral nerve components of the BRACHIAL PLEXUS. Clinical manifestations include regional pain, PARESTHESIA; MUSCLE WEAKNESS, and decreased sensation (HYPESTHESIA) in the upper extremity. These disorders may be associated with trauma (including BIRTH INJURIES); THORACIC OUTLET SYNDROME; NEOPLASMS; NEURITIS; RADIOTHERAPY; and other conditions. (From Adams et al., Principles of Neurology, 6th ed, pp1351-2)','en',1,'2007-10-18 04:28:24',1,NULL,'11297FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
