(11303,137026,'Traumatic injuries to the facial nerve. This may result in FACIAL PARALYSIS, decreased lacrimation and salivation, and loss of taste sensation in the anterior tongue. The nerve may regenerate and reform its original pattern of innervation, or regenerate aberrantly, resulting in inappropriate lacrimation in response to gustatory stimuli (e.g., \"crocodile tears\") and other syndromes.','en',1,'2007-10-18 04:28:24',1,NULL,'11303FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11304,137052,'Blunt and penetrating traumatic injuries of the common, internal, or external carotid arteries which may result from CRANIOCEREBRAL TRAUMA; THORACIC INJURIES; and NECK INJURIES. Damage to the artery may lead to CAROTID ARTERY THROMBOSIS; CAROTID-CAVERNOUS SINUS FISTULA; pseudoaneurysm formation; and internal carotid artery dissection (CAROTID ARTERY, INTERNAL, DISSECTION). Clinical manifestations (e.g., stroke, HORNER SYNDROME) may be immediate or delayed. (From Am J Forensic Med Pathol 1997 Sep;18(3):251-7; J Trauma 1994 Sep;37(3):473-9)','en',1,'2007-10-18 04:28:24',1,NULL,'11304FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
