(11362,137273,'An acute inflammatory autoimmune neuritis caused by T cell- mediated cellular immune response directed towards peripheral myelin. Demyelination occurs in peripheral nerves and nerve roots. The process is often preceded by a viral or bacterial infection, surgery, immunization, lymphoma, or exposure to toxins. Common clinical manifestations include progressive weakness, loss of sensation, and loss of deep tendon reflexes. Weakness of respiratory muscles and autonomic dysfunction may occur. (From Adams et al., Principles of Neurology, 6th ed, pp1312-1314)','en',1,'2007-10-18 04:28:24',1,'2013-05-12 16:40:36','11362FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
