(11379,137312,'A complex that includes several strains of M. avium. M. intracellulare is not easily distinguished from M. avium and therefore is included in the complex. These organisms are most frequently found in pulmonary secretions from persons with a tuberculous-like mycobacteriosis. Strains of this complex have also been associated with childhood lymphadenitis and AIDS. M. avium alone causes tuberculosis in a variety of birds and other animals, including pigs.','en',1,'2007-10-18 04:28:24',1,NULL,'11379FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
