(11389,137333,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'11389FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11390,137334,'A severe condition resulting from bacteria invading healthy muscle from adjacent traumatized muscle or soft tissue. The infection originates in a wound contaminated with bacteria of the genus CLOSTRIDIUM. C. perfringens accounts for the majority of cases (over eighty percent), while C. noyvi, C. septicum, and C. histolyticum cause most of the other cases.','en',1,'2007-10-18 04:28:24',1,NULL,'11390FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
