(11393,137339,'Infections with nematodes of the superfamily FILARIOIDEA. The presence of living worms in the body is mainly asymptomatic but the death of adult worms leads to granulomatous inflammation and permanent fibrosis. Organisms of the genus Elaeophora infect wild elk and domestic sheep causing ischaemic necrosis of the brain, blindness, and dermatosis of the face.','en',1,'2007-10-18 04:28:24',1,NULL,'11393FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11394,137342,'A disease endemic among people and animals in Central Africa. It is caused by various species of trypanosomes, particularly T. gambiense and T. rhodesiense. Its second host is the tsetse fly. Involvement of the central nervous system produces \"African sleeping sickness.\" Nagana is a rapidly fatal trypanosomiasis of horses and other animals.','en',1,'2007-10-18 04:28:24',1,NULL,'11394FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
