(11407,137357,'Infection of animals, including fish and man, with a developmental stage of Diphyllobothrium. This stage has recently been referred to as a plerocercoid but the name sparganum has persisted. Therefore, infection of fish or other animals with the plerocercoid larvae is sparganosis. Fish-eating mammals, including man, are the final hosts.','en',1,'2007-10-18 04:28:24',1,NULL,'11407FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11408,137358,'Infection of animals, including fish and man, with a developmental stage of Diphyllobothrium. This stage has recently been referred to as a plerocercoid but the name sparganum has persisted. Therefore, infection of fish or other animals with the plerocercoid larvae is sparganosis. Fish-eating mammals, including man, are the final hosts.','en',1,'2007-10-18 04:28:24',1,NULL,'11408FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11409,137364,'Infection of the striated muscle of mammals by parasites of the genus SARCOCYSTIS. Disease symptoms such as vomiting, diarrhea, muscle weakness, and paralysis are produced by sarcocystin, a toxin produced by the organism.','en',1,'2007-10-18 04:28:24',1,NULL,'11409FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11410,137365,'Infection in humans and animals caused by fungi in the phylum Zygomycota. It includes MUCORMYCOSIS and entomophthoramycosis. The latter is a tropical infection of subcutaneous tissue or paranasal sinuses caused by fungi in the order Entomophthorales. Phycomycosis, closely related to zygomycosis, describes infection with members of Phycomycetes, an obsolete classification.','en',1,'2007-10-18 04:28:24',1,NULL,'11410FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
