(11427,137411,'A genus of parasitic nematodes found throughout the rain-forest areas of the Sudan and the basin of the Congo. L. loa inhabits the subcutaneous tissues, which it traverses freely.','en',1,'2007-10-18 04:28:24',1,NULL,'11427FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
