(11429,137415,'An endemic disease that is characterized by the development of single or multiple localized lesions on exposed areas of skin that typically ulcerate. The disease has been divided into Old and New World forms. Old World leishmaniasis is separated into three distinct types according to epidemiology and clinical manifestations and is caused by species of the L. tropica and L. aethiopica complexes as well as by species of the L. major genus. New World leishmaniasis, also called American leishmaniasis, occurs in South and Central America and is caused by species of the L. mexicana or L. braziliensis complexes.','en',1,'2007-10-18 04:28:24',1,NULL,'11429FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11430,137416,'A disease characterized by the chronic, progressive spread of lesions from New World cutaneous leishmaniasis caused by species of the L. braziliensis complex to the nasal, pharyngeal, and buccal mucosa some time after the appearance of the initial cutaneous lesion. Nasal obstruction and epistaxis are frequent presenting symptoms.','en',1,'2007-10-18 04:28:24',1,NULL,'11430FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11431,137417,'A chronic disease caused by LEISHMANIA DONOVANI and transmitted by the bite of several sandflies of the genera Phlebotomus and Lutzomyia. It is commonly characterized by fever, chills, vomiting, anemia, hepatosplenomegaly, leukopenia, hypergammaglobulinemia, emaciation, and an earth-gray color of the skin. The disease is classified into three main types according to geographic distribution: Indian, Mediterranean (or infantile), and African.','en',1,'2007-10-18 04:28:24',1,NULL,'11431FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11432,137418,'A disease characterized by the chronic, progressive spread of lesions from New World cutaneous leishmaniasis caused by species of the L. braziliensis complex to the nasal, pharyngeal, and buccal mucosa some time after the appearance of the initial cutaneous lesion. Nasal obstruction and epistaxis are frequent presenting symptoms.','en',1,'2007-10-18 04:28:24',1,NULL,'11432FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11433,137419,'An acute, sometimes fatal, pneumonia-like bacterial infection characterized by high fever, malaise, muscle aches, respiratory disorders and headache. It is named for an outbreak at the 1976 Philadelphia convention of the American Legion.','en',1,'2007-10-18 04:28:24',1,NULL,'11433FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11434,137420,'A disease due to infection with TRICHINELLA SPIRALIS. It is caused by eating undercooked meat, usually pork.','en',1,'2007-10-18 04:28:24',1,NULL,'11434FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11435,137422,'Protozoan infection found in animals and man. It is caused by several different genera of COCCIDIA.','en',1,'2007-10-18 04:28:24',1,NULL,'11435FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11436,137423,'Protozoan infection found in animals and man. It is caused by several different genera of COCCIDIA.','en',1,'2007-10-18 04:28:24',1,NULL,'11436FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11437,137432,'A genus of parasitic nematodes that occurs in mammals including man. Infection in humans is either by larvae penetrating the skin or by ingestion of uncooked fish.','en',1,'2007-10-18 04:28:24',1,NULL,'11437FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11439,137436,'A progressive, degenerative joint disease, the most common form of arthritis, especially in older persons. The disease is thought to result not from the aging process but from biochemical changes and biomechanical stresses affecting articular cartilage. In the foreign literature it is often called osteoarthrosis deformans.','en',1,'2007-10-18 04:28:24',1,NULL,'11439FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11440,137438,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'11440FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11441,137439,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'11441FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11443,137441,'A family of flukes of the class Trematoda occurring primarily in the liver of animals and man. There are six genera: Fasciola, Fasciolopsis, Fascioloides, Tenuifasciola, Parafasciolopsis, and Protofasciola. The adult form of Fasciolopsis occurs in the intestines of pigs and man.','en',1,'2007-10-18 04:28:24',1,NULL,'11443FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11444,137442,'A family of flukes of the class Trematoda occurring primarily in the liver of animals and man. There are six genera: Fasciola, Fasciolopsis, Fascioloides, Tenuifasciola, Parafasciolopsis, and Protofasciola. The adult form of Fasciolopsis occurs in the intestines of pigs and man.','en',1,'2007-10-18 04:28:24',1,NULL,'11444FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11446,137444,'Helminth infection of the liver caused by species of Fasciola.','en',1,'2007-10-18 04:28:24',1,NULL,'11446FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11447,137448,'Infection with nematodes of the genus ENTEROBIUS. E. vermicularis, the pinworm of man, causes a crawling sensation and pruritus. This condition results in scratching the area, occasionally causing scarification.','en',1,'2007-10-18 04:28:24',1,NULL,'11447FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11448,137453,'Infection with protozoa of the genus ENCEPHALITOZOON. Lesions commonly occur in the brain and kidney tubules. Other sites of infection in mammals are the liver, adrenal glands, optic nerves, retina, and myocardium.','en',1,'2007-10-18 04:28:24',1,NULL,'11448FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11449,137454,'Infections with nematodes of the superfamily FILARIOIDEA. The presence of living worms in the body is mainly asymptomatic but the death of adult worms leads to granulomatous inflammation and permanent fibrosis. Organisms of the genus Elaeophora infect wild elk and domestic sheep causing ischaemic necrosis of the brain, blindness, and dermatosis of the face.','en',1,'2007-10-18 04:28:24',1,NULL,'11449FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11450,137458,'A genus of nematode parasites which inhabit the body cavity, serous membranes, and connective tissues of vertebrates. The species parasitic in man is Dracunculus medinensis.','en',1,'2007-10-18 04:28:24',1,'2014-01-13 18:40:43','11450FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11451,137459,'Infection with nematodes of the genus DIROFILARIA, usually in animals, especially dogs, but occasionally in man.','en',1,'2007-10-18 04:28:24',1,NULL,'11451FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11452,137460,'Infection with nematodes of the genus DIROFILARIA, usually in animals, especially dogs, but occasionally in man.','en',1,'2007-10-18 04:28:24',1,NULL,'11452FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11453,137461,'Infections with true tapeworms of the helminth subclass CESTODA.','en',1,'2007-10-18 04:28:24',1,NULL,'11453FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11454,137464,'Infection with tapeworms of the genus Diphyllobothrium.','en',1,'2007-10-18 04:28:24',1,NULL,'11454FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11455,137465,'Infection with tapeworms of the genus Diphyllobothrium.','en',1,'2007-10-18 04:28:24',1,NULL,'11455FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11456,137466,'A genus of parasitic nematodes whose organisms are distributed in Central and South America. Characteristics include a smooth cuticle and an enlarged anterior end.','en',1,'2007-10-18 04:28:24',1,NULL,'11456FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11457,137470,'A disease caused by various fungi (Madurella mycetomi) or actinomycetes (Nocardia brasiliensis). It usually affects the foot, hand, and legs with tissues becoming necrosed and swollen after infection.','en',1,'2007-10-18 04:28:24',1,NULL,'11457FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11458,137471,'Infection in humans and animals caused by fungi in the phylum Zygomycota. It includes MUCORMYCOSIS and entomophthoramycosis. The latter is a tropical infection of subcutaneous tissue or paranasal sinuses caused by fungi in the order Entomophthorales. Phycomycosis, closely related to zygomycosis, describes infection with members of Phycomycetes, an obsolete classification.','en',1,'2007-10-18 04:28:24',1,NULL,'11458FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11459,137473,'Infection in humans and animals caused by fungi in the phylum Zygomycota. It includes MUCORMYCOSIS and entomophthoramycosis. The latter is a tropical infection of subcutaneous tissue or paranasal sinuses caused by fungi in the order Entomophthorales. Phycomycosis, closely related to zygomycosis, describes infection with members of Phycomycetes, an obsolete classification.','en',1,'2007-10-18 04:28:24',1,NULL,'11459FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11460,137474,'A general term describing various dermatophytoses. Specific types include TINEA CAPITIS (ringworm of the scalp), TINEA FAVOSA (of scalp and skin), TINEA PEDIS (athlete''s foot), and tinea unguium (see ONYCHOMYCOSIS, ringworm of the nails). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11460FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11461,137476,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'11461FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
