(11463,137480,'Infection with a fungus of the genus CANDIDA. It is usually a superficial infection of the moist areas of the body and is generally caused by CANDIDA ALBICANS. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11463FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11464,137483,'Infection of humans or animals with hookworms other than those caused by the genus Ancylostoma or Necator, for which the specific terms ANCYLOSTOMIASIS and NECATORIASIS are available.','en',1,'2007-10-18 04:28:24',1,NULL,'11464FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11465,137489,'A fungal infection that may appear in two forms: 1) a primary lesion characterized by the formation of a small cutaneous nodule and small nodules along the lymphatics that may heal within several months; and 2) chronic granulomatous lesions characterized by thick crusts, warty growths, and unusual vascularity and infection in the middle or upper lobes of the lung.','en',1,'2007-10-18 04:28:24',1,NULL,'11465FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11466,137490,'Protozoan infection found in animals and man. It is caused by several different genera of COCCIDIA.','en',1,'2007-10-18 04:28:24',1,NULL,'11466FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11467,137491,'Infections with true tapeworms of the helminth subclass CESTODA.','en',1,'2007-10-18 04:28:24',1,NULL,'11467FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11468,137492,'Infection in humans and animals caused by fungi in the phylum Zygomycota. It includes MUCORMYCOSIS and entomophthoramycosis. The latter is a tropical infection of subcutaneous tissue or paranasal sinuses caused by fungi in the order Entomophthorales. Phycomycosis, closely related to zygomycosis, describes infection with members of Phycomycetes, an obsolete classification.','en',1,'2007-10-18 04:28:24',1,NULL,'11468FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11469,137493,'Infections by the genus BARTONELLA. Bartonella bacilliformis can cause acute febrile anemia, designated Oroya fever, and a benign skin eruption, called verruga peruana. BARTONELLA QUINTANA causes TRENCH FEVER, while BARTONELLA HENSELAE is the etiologic agent of bacillary angiomatosis (ANGIOMATOSIS, BACILLARY) and is also one of the causes of CAT-SCRATCH DISEASE in immunocompetent patients.','en',1,'2007-10-18 04:28:24',1,NULL,'11469FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11470,137494,'Infection by protozoan parasites of the genus BALANTIDIUM. The presence of Balantidium in the large intestine leads to diarrhea, dysentery, and occasionally ulceration.','en',1,'2007-10-18 04:28:24',1,NULL,'11470FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11471,137498,'Infection with nematodes of the superfamily OXYUROIDEA.','en',1,'2007-10-18 04:28:24',1,NULL,'11471FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11472,137500,'A species of imperfect fungi from which the antibiotic fumigatin is obtained. Its spores may cause respiratory infection in birds and mammals.','en',1,'2007-10-18 04:28:24',1,NULL,'11472FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11473,137501,'A species of imperfect fungi which grows on peanuts and other plants and produces the carcinogenic substance aflatoxin. It is also used in the production of the antibiotic flavicin.','en',1,'2007-10-18 04:28:24',1,NULL,'11473FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11474,137503,'A disease caused by various fungi (Madurella mycetomi) or actinomycetes (Nocardia brasiliensis). It usually affects the foot, hand, and legs with tissues becoming necrosed and swollen after infection.','en',1,'2007-10-18 04:28:24',1,NULL,'11474FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11475,137504,'A species of parasitic nematode that is the largest found in the human intestine. Its distribution is worldwide, but it is more prevalent in areas of poor sanitation. Human infection with A. lumbricoides is acquired by swallowing fully embryonated eggs from contaminated soil.','en',1,'2007-10-18 04:28:24',1,NULL,'11475FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11476,137507,'Infection with roundworms of the genus ANISAKIS. Human infection results from the consumption of fish harboring roundworm larvae. The worms may cause acute nausea and vomiting or may penetrate into the wall of the digestive tract, where they give rise to eosinophilic granulomas in the stomach, intestine, or the omentum.','en',1,'2007-10-18 04:28:24',1,NULL,'11476FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11477,137510,'A genus of nematode intestinal parasites that consists of several species. A. duodenale is the common hookworm in humans. A. braziliense, A. ceylonicum, and A. caninum occur primarily in cats and dogs, but all have been known to occur in humans.','en',1,'2007-10-18 04:28:24',1,NULL,'11477FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11478,137513,'Scaly papule or warty growth, caused by five fungi, that spreads as a result of satellite lesions affecting the foot or leg. The extremity may become swollen and, at its distal portion, covered with various nodular, tumorous, verrucous lesions that resemble cauliflower. In rare instances, the disease may begin on the hand or wrist and involve the entire upper extremity. (Arnold, Odom, and James, Andrew''s Diseases of the Skin, 8th ed, p362)','en',1,'2007-10-18 04:28:24',1,NULL,'11478FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11479,137514,'A disease caused by various fungi (Madurella mycetomi) or actinomycetes (Nocardia brasiliensis). It usually affects the foot, hand, and legs with tissues becoming necrosed and swollen after infection.','en',1,'2007-10-18 04:28:24',1,NULL,'11479FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11480,137517,'Infection in humans and animals caused by fungi in the phylum Zygomycota. It includes MUCORMYCOSIS and entomophthoramycosis. The latter is a tropical infection of subcutaneous tissue or paranasal sinuses caused by fungi in the order Entomophthorales. Phycomycosis, closely related to zygomycosis, describes infection with members of Phycomycetes, an obsolete classification.','en',1,'2007-10-18 04:28:24',1,NULL,'11480FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11482,137522,'A circumscribed collection of fluid, especially a collection of fluid in the tunica vaginalis of the testicle or along the spermatic cord. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11482FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11483,137529,'The formation of an area of necrosis in the cerebrum caused by an insufficiency of arterial or venous blood flow. Infarcts of the cerebrum are generally classified by hemisphere (i.e., left vs. right), lobe (e.g., frontal lobe infarction), arterial distribution (e.g., INFARCTION, ANTERIOR CEREBRAL ARTERY), and etiology (e.g., embolic infarction).','en',1,'2007-10-18 04:28:24',1,NULL,'11483FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11484,137533,'A condition due to a dietary deficiency of ascorbic acid (vitamin C), characterized by malaise, lethargy, and weakness. As the disease progresses, joints, muscles, and subcutaneous tissues may become the sites of hemorrhage. Ascorbic acid deficiency frequently develops into SCURVY in young children fed unsupplemented cow''s milk exclusively during their first year. It develops also commonly in chronic alcoholism. (Cecil Textbook of Medicine, 19th ed, p1177)','en',1,'2007-10-18 04:28:24',1,NULL,'11484FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11485,137535,'An acute infectious disease of humans, particularly children, caused by any of three serotypes of human poliovirus (POLIOVIRUSES, HUMAN 1-3). Usually the infection is limited to the gastrointestinal tract and nasopharynx, and is often asymptomatic. The central nervous system, primarily the spinal cord, may be affected, leading to rapidly progressive paralysis, coarse FASCICULATION and hyporeflexia. Motor neurons are primarily affected. Encephalitis may also occur. The virus replicates in the nervous system, and may cause significant neuronal loss, most notably in the spinal cord. A rare related condition, nonpoliovirus poliomyelitis, may result from infections with nonpoliovirus enteroviruses. (From Adams et al., Principles of Neurology, 6th ed, pp764-5)','en',1,'2007-10-18 04:28:24',1,NULL,'11485FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11486,137536,'A inherited degenerative disease characterized by neuronal cytoplasmic inclusions which stain positively for ceroid and lipofuscin. Affected individuals develop retinal degeneration, seizures, myoclonus, ataxia, rigidity, and progressive dementia. Clinically there are four subtypes, divided by age of onset of symptoms: infantile (Santavuori-Haltia type), late infantile (Jansky-Bielschowsky type), juvenile (Spielmeyer-Vogt type), and adult (Kuf''s disease). The late infantile and juvenile forms may both also be referred to as Batten Disease and Batten-Mayou Disease. (Adams et al., Principles of Neurology, 6th ed, p957)','en',1,'2007-10-18 04:28:24',1,NULL,'11486FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11487,137537,'A nonspecific term referring both to the pathologic finding of swelling of distal portions of axons in the brain and to disorders which feature this finding. Neuroaxonal dystrophy is seen in various genetic diseases, vitamin deficiencies, and aging. Infantile neuroaxonal dystrophy is an autosomal recessive disease characterized by arrested psychomotor development at 6 months to 2 years of age, ataxia, brain stem dysfunction, and quadriparesis. Juvenile and adult forms also occur. Pathologic findings include brain atrophy and widespread accumulation of axonal spheroids throughout the neuroaxis, peripheral nerves, and dental pulp. (From Davis & Robertson, Textbook of Neuropathology, 2nd ed, p927)','en',1,'2007-10-18 04:28:24',1,NULL,'11487FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11488,137538,'Constellation of clinical and laboratory manifestations produced by generalized proximal tubular insufficiency in the presence of normal, or nearly normal, glomerular filtration.','en',1,'2007-10-18 04:28:24',1,NULL,'11488FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11489,137539,'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-10-18 04:28:24',1,NULL,'11489FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11490,137540,'Excessive formation of dense trabecular bone leading to pathological fractures, osteitis, splenomegaly with infarct, anemia, and extramedullary hemopoiesis.','en',1,'2007-10-18 04:28:24',1,NULL,'11490FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11491,137542,'Disorders in the processing of phosphorus in the body: its absorption, transport, storage, and utilization.','en',1,'2007-10-18 04:28:24',1,NULL,'11491FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11492,137544,'A form of gangliosidosis characterized by accumulation of G(M1) GANGLIOSIDE and oligosaccharides in lysosomes caused by an absence or severe deficiency of the enzyme BETA-GALACTOSIDASE (type A1). The three phenotypes of this disorder are infantile (generalized), juvenile, and adult. The infantile form is characterized by skeletal abnormalities, hypotonia, poor psychomotor development, hirsutism, hepatosplenomegaly, and facial abnormalities. The juvenile form features hyperacusis, seizures, and psychomotor retardation. The adult form features progressive intellectual deterioration, involuntary movements, ataxia, and spasticity. (From Menkes, Textbook of Child Neurology, 5th ed, pp96-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11492FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11493,137546,'An autosomal recessive lysosomal storage disease caused by a deficiency of ALPHA-L-FUCOSIDASE activity resulting in an accumulation of fucose containing SPHINGOLIPIDS, GLYCOPROTEINS, and mucopolysaccharides (GLYCOSAMINOGLYCANS) in lysosomes. The infantile form (type I) features psychomotor deterioration, MUSCLE SPASTICITY, coarse facial features, growth retardation, skeletal abnormalities, visceromegaly, SEIZURES, recurrent infections, and MACROGLOSSIA, with death occurring in the first decade of life. Juvenile fucosidosis (type II) is the more common variant and features a slowly progressive decline in neurologic function and angiokeratoma corporis diffusum. Type II survival may be through the fourth decade of life. (From Menkes, Textbook of Child Neurology, 5th ed, p87; Am J Med Genet 1991 Jan;38(1):111-31)','en',1,'2007-10-18 04:28:24',1,NULL,'11493FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11494,137548,'A chronic inflammatory genetically determined disease of the skin marked by increased ability to form reagin (IgE), with increased susceptibility to allergic rhinitis and asthma, and hereditary disposition to a lowered threshold for pruritus. It is manifested by lichenification, excoriation, and crusting, mainly on the flexural surfaces of the elbow and knee. In infants it is known as infantile eczema.','en',1,'2007-10-18 04:28:24',1,NULL,'11494FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11495,137552,'A disease of young infants characterized by soft tissue swellings over the affected bones, fever, and irritability, and marked by periods of remission and exacerbation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11495FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11496,137554,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11496FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11497,137556,'A disease caused by potent protein NEUROTOXINS produced by CLOSTRIDIUM BOTULINUM which interfere with the presynaptic release of ACETYLCHOLINE at the NEUROMUSCULAR JUNCTION. Clinical features include abdominal pain, vomiting, acute PARALYSIS (including respiratory paralysis), blurred vision, and DIPLOPIA. Botulism may be classified into several subtypes (e.g., food-borne, infant, wound, and others). (From Adams et al., Principles of Neurology, 6th ed, p1208)','en',1,'2007-10-18 04:28:24',1,NULL,'11497FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11498,137557,'A disorder beginning in childhood. It is marked by the presence of markedly abnormal or impaired development in social interaction and communication and a markedly restricted repertoire of activity and interest. Manifestations of the disorder vary greatly depending on the developmental level and chronological age of the individual. (DSM-IV)','en',1,'2007-10-18 04:28:24',1,'2016-03-08 02:58:38','11498FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11499,137558,'The killing of infants at birth or soon after.','en',1,'2007-10-18 04:28:24',1,NULL,'11499FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11501,137564,'A condition in which two closely related persons, usually in the same family, share the same delusions.','en',1,'2007-10-18 04:28:24',1,NULL,'11501FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11502,137566,'Congenital syndrome with the absence of the thymus and parathyroids causing impairment of cellular immunity. Immunoglobulin levels are normal.','en',1,'2007-10-18 04:28:24',1,NULL,'11502FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11504,137574,'A febrile disease of the Mediterranean area, the Crimea, Africa, and India, caused by infection with RICKETTSIA CONORII.','en',1,'2007-10-18 04:28:24',1,NULL,'11504FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11505,137576,'A condition in which the gonads are of one sex but one or more contradictions exist in the morphologic criteria of sex. Female pseudohermaphroditism is a form in which the affected individual is a genetic and gonadal female with partial masculinization. Male pseudohermaphroditism is a form in which the affected individual is a genetic and gonadal male with incomplete masculinization. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11505FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11506,137577,'A principal or polar form of LEPROSY in which the skin lesions are few and are sharply demarcated. Peripheral nerve involvement is pronounced and may be severe. Unlike lepromatous leprosy (LEPROSY, LEPROMATOUS), the lepromin test is positive. Tuberculoid leprosy is rarely a source of infection to others.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 13:57:29','11506FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11507,137581,'The inability of a kidney to excrete metabolites at normal plasma levels under conditions of normal loading, or the inability to retain electrolytes under conditions of normal intake. In the acute form (KIDNEY FAILURE, ACUTE), it is marked by uremia and usually by oliguria or anuria, with hyperkalemia and pulmonary edema. The chronic form (KIDNEY FAILURE, CHRONIC) is irreversible and requires hemodialysis.','en',1,'2007-10-18 04:28:24',1,NULL,'11507FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11510,137587,'A pathologic condition resulting from accumulation of acid or depletion of the alkaline reserve (bicarbonate) content of the blood and body tissues, and characterized by an increase in hydrogen ion concentration (decrease in pH). (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11510FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11511,137593,'Disorders in the frequency of urination, the volume of urine produced or eliminated, or the ability to retain or void urine in normal fashion.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 02:35:57','11511FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11512,137595,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'11512FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11513,137601,'Ingestion of a greater than optimal quantity of food.','en',1,'2007-10-18 04:28:24',1,NULL,'11513FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11514,137605,'Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharnyx, larnyx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'11514FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11515,137607,'Downward displacement of the uterus. It is classified in various degrees: in the first degree the cervix is within the vaginal orifice; in the second degree the cervix is outside the orifice; in the third degree the entire uterus is outside the orifice.','en',1,'2007-10-18 04:28:24',1,NULL,'11515FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11516,137623,'Protrusion of the rectal mucous membrane through the anus. There are various degrees: incomplete with no displacement of the anal sphincter muscle; complete with displacement of the anal sphincter muscle; complete with no displacement of the anal sphincter muscle but with herniation of the bowel; and internal complete with rectosigmoid or upper rectum intussusception into the lower rectum.','en',1,'2007-10-18 04:28:24',1,NULL,'11516FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11517,137634,'Inability to urinate. The etiology of this disorder includes obstructive, neurogenic, pharmacologic, and psychogenic causes.','en',1,'2007-10-18 04:28:24',1,NULL,'11517FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11518,137641,'A malformation of the nervous system caused by failure of the anterior neuropore to close. Infants are born with intact spinal cords, cerebellums, and brainstems, but lack formation of neural structures above this level. The skull is only partially formed but the eyes are usually normal. This condition may be associated with folate deficiency. Affected infants are only capable of primitive (brain stem) reflexes and usually do not survive for more than two weeks. (From Menkes, Textbook of Child Neurology, 5th ed, p247)','en',1,'2007-10-18 04:28:24',1,NULL,'11518FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11519,137647,'An infection of the eyes characterized by the presence in conjunctival epithelial cells of inclusion bodies indistinguishable from those of trachoma. It is acquired by infants during birth and by adults from swimming pools. The etiological agent is CHLAMYDIA TRACHOMATIS whose natural habitat appears to be the genito-urinary tract. Inclusion conjunctivitis is a less severe disease than trachoma and usually clears up spontaneously.','en',1,'2007-10-18 04:28:24',1,NULL,'11519FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11520,137648,'An infection of the eyes characterized by the presence in conjunctival epithelial cells of inclusion bodies indistinguishable from those of trachoma. It is acquired by infants during birth and by adults from swimming pools. The etiological agent is CHLAMYDIA TRACHOMATIS whose natural habitat appears to be the genito-urinary tract. Inclusion conjunctivitis is a less severe disease than trachoma and usually clears up spontaneously.','en',1,'2007-10-18 04:28:24',1,NULL,'11520FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11521,137649,'Progressive myopathies characterized by the presence of inclusion bodies on muscle biopsy. Sporadic and hereditary forms have been described. The sporadic form is an acquired, adult-onset inflammatory vacuolar myopathy affecting proximal and distal muscles. Familial forms usually begin in childhood and lack inflammatory changes. Both forms feature intracytoplasmic and intranuclear inclusions in muscle tissue. (Adams et al., Principles of Neurology, 6th ed, pp1409-10)','en',1,'2007-10-18 04:28:24',1,NULL,'11521FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11522,137651,'Pathologic processes that affect patients after a surgical procedure. They may or may not be related to the disease for which the surgery was done, and they may or may not be direct results of the surgery.','en',1,'2007-10-18 04:28:24',1,NULL,'11522FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
