(11541,137703,'Brief reversible episodes of focal, nonconvulsive ischemic dysfunction of the brain having a duration of less than 24 hours, and usually less than one hour, caused by transient thrombotic or embolic blood vessel occlusion or stenosis. Events may be classified by arterial distribution, temporal pattern, or etiology (e.g., embolic vs. thrombotic). (From Adams et al., Principles of Neurology, 6th ed, pp814-6)','en',1,'2007-10-18 04:28:24',1,NULL,'11541FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11543,137708,'Visual impairments limiting one or more of the basic functions of the eye: visual acuity, dark adaptation, color vision, or peripheral vision. These may result from EYE DISEASES; OPTIC NERVE DISEASES; VISUAL PATHWAY diseases; OCCIPITAL LOBE diseases; OCULAR MOTILITY DISORDERS; and other conditions. Visual disability refers to inability of the individual to perform specific visual tasks, such as reading, writing, orientation, or traveling unaided. (From Newell, Ophthalmology: Principles and Concepts, 7th ed, p132)','en',1,'2007-10-18 04:28:24',1,NULL,'11543FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
