(11577,137855,'Infections of the brain caused by arthopod-borne viruses (i.e., arboviruses) primarily from the families TOGAVIRIDAE; FLAVIVIRIDAE; BUNYAVIRIDAE; REOVIRIDAE; and RHABDOVIRIDAE. Life cycles of these viruses are characterized by ZOONOSES, with birds and lower mammals serving as intermediate hosts. The virus is transmitted to humans by the bite of mosquitoes (CULICIDAE) or TICKS. Clinical manifestations include fever, headache, alterations of mentation, focal neurologic deficits, and COMA. (From Clin Microbiol Rev 1994 Jan;7(1):89-116; Walton, Brain''s Diseases of the Nervous System, 10th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'11577FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11579,137864,'Chronic form of glomerulonephritis characterized by recurring hematuria with only slight proteinuria and by deposits of IGA immunoglobulin in the mesangial areas of the renal glomeruli. It usually occurs in young males.','en',1,'2007-10-18 04:28:24',1,NULL,'11579FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11580,137866,'A transient and intermittent type of arrhythmia with episodes lasting from a few seconds to a minute which usually occurs in patients with acute myocardial infarction or with digitalis toxicity. Suppressive therapy is rarely necessary because the ventricular rate is generally less than 100 beats per minute.','en',1,'2007-10-18 04:28:24',1,NULL,'11580FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11581,137867,'An acute brain syndrome which results from the excessive ingestion of ETHANOL or ALCOHOLIC BEVERAGES.','en',1,'2007-10-18 04:28:24',1,NULL,'11581FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11582,137870,'Altered reactivity to an antigen, which can result in pathologic reactions upon subsequent exposure to that particular antigen.','en',1,'2007-10-18 04:28:24',1,NULL,'11582FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11583,137871,'Pain in the pelvic region of genital and non-genital origin and of organic or psychogenic etiology. Frequent causes of pain are distension or contraction of hollow viscera, rapid stretching of the capsule of a solid organ, chemical irritation, tissue ischemia, and neuritis secondary to inflammatory, neoplastic, or fibrotic processes in adjacent organs. (Kase, Weingold & Gershenson: Principles and Practice of Clinical Gynecology, 2d ed, pp479-508)','en',1,'2007-10-18 04:28:24',1,NULL,'11583FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11584,137873,'Diseases of the trigeminal nerve or its nuclei, which are located in the pons and medulla. The nerve is composed of three divisions: ophthalmic, maxillary, and mandibular, which provide sensory innervation to structures of the face, sinuses, and portions of the cranial vault. The mandibular nerve also innervates muscles of mastication. Clinical features include loss of facial and intra-oral sensation and weakness of jaw closure. Common conditions affecting the nerve include brain stem ischemia, INFRATENTORIAL NEOPLASMS, and TRIGEMINAL NEURALGIA.','en',1,'2007-10-18 04:28:24',1,NULL,'11584FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11585,137874,'A syndrome characterized by recurrent episodes of excruciating pain lasting several seconds or longer in the sensory distribution of the trigeminal nerve. Pain may be initiated by stimulation of trigger points on the face, lips, or gums or by movement of facial muscles or chewing. Associated conditions include MULTIPLE SCLEROSIS, vascular anomalies, ANEURSYMS, and neoplasms. (Adams et al., Principles of Neurology, 6th ed, p187)','en',1,'2007-10-18 04:28:24',1,NULL,'11585FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11586,137875,'A condition characterized by focal DYSTONIA that progresses to involuntary spasmodic contractions of the muscles of the legs, trunk, arms, and face. The hands are often spared, however, sustained axial and limb contractions may lead to a state where the body is grossly contorted. Onset is usually in the first or second decade. Familial patterns of inheritance, primarily autosomal dominant with incomplete pentrance, have been identified. (Adams et al., Principles of Neurology, 6th ed, p1078)','en',1,'2007-10-18 04:28:24',1,NULL,'11586FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11587,137876,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-10-18 04:28:24',1,NULL,'11587FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11589,137883,'An abnormally diminished concentration of glucose in the blood, which may lead to tremulousness, cold sweat, piloerection, hypothermia, and headache, accompanied by irritability, confusion, hallucinations, bizarre behavior, and ultimately, convulsions and coma. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11589FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11590,137884,'Diseases characterized by inflammation involving multiple muscles. This may occur as an acute or chronic condition associated with medication toxicity (DRUG TOXICITY, NERVOUS SYSTEM); CONNECTIVE TISSUE DISEASES; infections; malignant NEOPLASMS; and other disorders. The term polymyositis is frequently used to refer to a specific clinical entity characterized by subacute or slowly progressing symmetrical weakness primarily affecting the proximal limb and trunk muscles. The illness may occur at any age, but is most frequent in the fourth to sixth decade of life. Weakness of pharyngeal and laryngeal muscles, interstitial lung disease, and inflammation of the myocardium may also occur. Muscle biopsy reveals widespread destruction of segments of muscle fibers and an inflammatory cellular response. (Adams et al., Principles of Neurology, 6th ed, pp1404-9)','en',1,'2007-10-18 04:28:24',1,NULL,'11590FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11591,137885,'Diseases of the parasympathetic or sympathetic divisions of the AUTONOMIC NERVOUS SYSTEM; which has components located in the CENTRAL NERVOUS SYSTEM and PERIPHERAL NERVOUS SYSTEM. Autonomic dysfunction may be associated with HYPOTHALAMIC DISEASES; BRAIN STEM disorders; SPINAL CORD DISEASES; and PERIPHERAL NERVOUS SYSTEM DISEASES. Manifestations include impairments of vegetative functions including the maintenance of BLOOD PRESSURE; HEART RATE; pupil function; SWEATING; REPRODUCTIVE AND URINARY PHYSIOLOGY; and DIGESTION.','en',1,'2007-10-18 04:28:24',1,NULL,'11591FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11592,137891,'A clinically diverse group of epilepsy syndromes characterized either by myoclonic seizures or by myoclonus in association with other seizure types. Myoclonic epilepsy syndromes are divided into three subtypes based on etiology: familial, cryptogenic, and symptomatic (i.e., occurring secondary to known disease processes such as infections, hypoxic-ischemic injuries, trauma, etc.).','en',1,'2007-10-18 04:28:24',1,NULL,'11592FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11593,137893,'Syndromes of bone destruction where the cause is not obvious such as neoplasia, infection, or trauma. The destruction follows various patterns: massive (Gorham disease), multicentric (Hajdu-Cheney syndrome, Winchester syndrome), or carpal/tarsal.','en',1,'2007-10-18 04:28:24',1,NULL,'11593FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11594,137898,'Abnormally high level of calcium in the blood.','en',1,'2007-10-18 04:28:24',1,NULL,'11594FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
