(11600,137910,'A heterogeneous group of disorders with the common feature of prolonged eosinophilia of unknown cause and associated organ system dysfunction, including the heart, central nervous system, kidneys, lungs, gastrointestinal tract, and skin. There is a massive increase in the number of eosinophils in the blood, mimicking leukemia, and extensive eosinophilic infiltration of the various organs. It is often referred to as idiopathic.','en',1,'2007-10-18 04:28:24',1,NULL,'11600FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11601,137911,'Excessive amount of watery fluid accumulated in the intercellular spaces, most commonly present in subcutaneous tissue.','en',1,'2007-10-18 04:28:24',1,NULL,'11601FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11602,137913,'A malabsorption syndrome occurring in the tropics and subtropics. Protein malnutrition is usually precipitated by the malabsorption, and anemia due to folic acid deficiency is particularly common. Administration of antibiotics (especially tetracycline) and folic acid usually results in remission. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11602FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11603,137914,'A metabolic disorder due to disorders in the production or release of vasopressin. It is characterized by the chronic excretion of large amounts of low specific gravity urine and great thirst.','en',1,'2007-10-18 04:28:24',1,NULL,'11603FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11604,137919,'A condition, more commonly seen in females, due to hyperadrenocorticism resulting from neoplasms of the adrenal cortex or the anterior lobe of the pituitary, or to prolonged excessive intake of glucocorticoids for therapeutic purposes. The symptoms and signs may include rapidly developing adiposity of the face, neck, and trunk, kyphosis caused by osteoporosis of the spine, hypertension, diabetes mellitus, amenorrhea, hypertrichosis in females, impotence in males, dusky complexion with purple markings, polycythemia, pain in the abdomen and back, and muscular wasting and weakness. When secondary to excessive pituitary secretion of adrenocorticotropin, it is known as Cushing''s disease. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11604FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11605,137928,'Acquired hemolytic anemia due to the presence of autoantibodies which agglutinate or lyse the patient''s own red cells.','en',1,'2007-10-18 04:28:24',1,NULL,'11605FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11606,137932,'A form of anemia in which the bone marrow fails to produce adequate numbers of peripheral blood elements.','en',1,'2007-10-18 04:28:24',1,'2013-07-29 13:38:13','11606FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11607,137933,'A thrombo-obliterative process of the great vessels stemming from the aortic arch, occurring generally in young women. Radial and carotid pulses are typically obliterated. Skin changes are due to the disturbed circulation. There may be loss of hair and atrophy of the skin and its appendages with underlying muscle atrophy. (Andrews'' Diseases of the Skin, 8th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11607FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11608,137934,'An abnormality of electrolyte function caused by excessive secretion of aldosterone by the adrenal cortex. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11608FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11609,137940,'Loss of the ability to comprehend the meaning or recognize the importance of various forms of stimulation that cannot be attributed to impairment of a primary sensory modality. Tactile agnosia is characterized by an inability to perceive the shape and nature of an object by touch alone, despite unimpaired sensation to light touch, position, and other primary sensory modalities.','en',1,'2007-10-18 04:28:24',1,NULL,'11609FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11610,137941,'Diabetes mellitus characterized by insulin deficiency, sudden onset, severe hyperglycemia, rapid progression to ketoacidosis, and death unless treated with insulin. The disease may occur at any age, but is most common in childhood or adolescence.','en',1,'2007-10-18 04:28:24',1,'2013-02-05 10:49:59','11610FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11611,137944,'Most common form of ichthyosis characterized by prominent scaling especially on the exterior surfaces of the extremities. It is inherited as an autosomal dominant trait.','en',1,'2007-10-18 04:28:24',1,NULL,'11611FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11612,137947,'A group of inherited metabolic diseases characterized by the accumulation of excessive amounts of acid mucopolysaccharides, sphingolipids, and/or glycolipids in visceral and mesenchymal cells. Abnormal amounts of sphingolipids or glycolipids are present in neural tissue. Mental retardation and skeletal changes, most notably dysostosis multiplex, occur frequently. (From Joynt, Clinical Neurology, 1992, Ch56, pp36-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11612FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
