(11621,137966,'The inability to see or the loss or absence of perception of visual stimuli. This condition may be the result of EYE DISEASES; OPTIC NERVE DISEASES; OPTIC CHIASM diseases; or BRAIN DISEASES affecting the VISUAL PATHWAYS or OCCIPITAL LOBE.','en',1,'2007-10-18 04:28:24',1,NULL,'11621FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11622,137967,'Pathologic partial or complete loss of the ability to recall past experiences (AMNESIA, RETROGRADE) or to form new memories (AMNESIA, ANTEROGRADE). This condition may be of organic or psychologic origin. Organic forms of amnesia are usually associated with dysfunction of the DIENCEPHALON or HIPPOCAMPUS. (From Adams et al., Principles of Neurology, 6th ed, pp426-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11622FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11623,137969,'A reduction in brain oxygen supply. Severe hypoxia is referred to as anoxia, and is a relatively common cause of injury to the central nervous system. Prolonged brain anoxia may lead to BRAIN DEATH or a PERSISTENT VEGETATIVE STATE. Histologically, this condition is characterized by neuronal loss which is most prominent in the HIPPOCAMPUS; GLOBUS PALLIDUS; CEREBELLUM; and inferior olives. (From Adams et al., Principles of Neurology, 6th ed, pp1109-11)','en',1,'2007-10-18 04:28:24',1,NULL,'11623FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
