(11626,137977,'Failure of the uterus to contract with normal strength and duration and at normal intervals during labor. It is also called uterine atony.','en',1,'2007-10-18 04:28:24',1,NULL,'11626FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11627,137978,'A heterogeneous group of nonprogressive motor disorders caused by chronic brain injuries that originate in the prenatal period, perinatal period, or first few years of life. The four major subtypes are spastic, athetoid, ataxic, and mixed cerebral palsy, with spastic forms being the most common. The motor disorder may range from difficulties with fine motor control to severe spasticity (see MUSCLE SPASTICITY) in all limbs. Spastic diplegia (Little disease) is the most common subtype, and is characterized by spasticity that is more prominent in the legs than in the arms. Pathologically, this condition may be associated with LEUKOMALACIA, PERIVENTRICULAR. (From Dev Med Child Neurol 1998 Aug;40(8):520-7)','en',1,'2007-10-18 04:28:24',1,NULL,'11627FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
