(11648,138048,'A heterogenous group of inherited disorders characterized by recurring attacks of rapidly progressive flaccid paralysis or myotonia. These conditions have in common a mutation of the gene encoding the alpha subunit of the sodium channel in skeletal muscle. They are frequently associated with fluctuations in serum potassium levels. Periodic paralysis may also occur as a non-familial process secondary to THYROTOXICOSIS and other conditions. (From Adams et al., Principles of Neurology, 6th ed, p1481)','en',1,'2007-10-18 04:28:24',1,NULL,'11648FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11649,138050,'A rare sometimes familial disorder of the renal tubule characterized by the inability to excrete urine of normal acidity. This leads to a hyperchloremic acidosis which is often associated with one or more secondary complications such as hypercalcinuria with nephrolithiasis and nephrocalcinosis, rickets, or osteomalacia and severe potassium depletion.','en',1,'2007-10-18 04:28:24',1,NULL,'11649FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
