(11651,138052,'Abnormally low potassium concentration in the blood. It may result from potassium loss by renal secretion or by the gastrointestinal route, as by vomiting or diarrhea. It may be manifested clinically by neuromuscular disorders ranging from weakness to paralysis, by electrocardiographic abnormalities (depression of the T wave and elevation of the U wave), by renal disease, and by gastrointestinal disorders. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11651FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
