(11654,138055,'Abnormally low potassium concentration in the blood. It may result from potassium loss by renal secretion or by the gastrointestinal route, as by vomiting or diarrhea. It may be manifested clinically by neuromuscular disorders ranging from weakness to paralysis, by electrocardiographic abnormalities (depression of the T wave and elevation of the U wave), by renal disease, and by gastrointestinal disorders. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11654FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11655,138056,'A condition due to decreased dietary intake of potassium, as in starvation or failure to administer in intravenous solutions, or to gastrointestinal loss in diarrhea, chronic laxative abuse, vomiting, gastric suction, or bowel diversion. Severe potassium deficiency may produce muscular weakness and lead to paralysis and respiratory failure. Muscular malfunction may result in hypoventilation, paralytic ileus, hypotension, muscle twitches, tetany, and rhabomyolysis. Nephropathy from potassium deficit impairs the concentrating mechanism, producing polyuria and decreased maximal urinary concentrating ability with secondary polydipsia. (Merck Manual, 16th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11655FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11656,138057,'A group of hereditary disorders involving tissues and structures derived from the embryonic ectoderm. They are characterized by the presence of abnormalities at birth and involvement of both the epidermis and skin appendages. They are generally nonprogressive and diffuse. Various forms exist, including anhidrotic and hidrotic dysplasias, FOCAL DERMAL HYPOPLASIA, and aplasia cutis congenita.','en',1,'2007-10-18 04:28:24',1,NULL,'11656FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11657,138058,'Abnormally diminished or absent perspiration. Both generalized and segmented (reduced or absent sweating in circumscribed locations) forms of the disease are usually associated with other underlying conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'11657FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11658,138059,'Congenital and familial disorder characterized by hypogonadotropic hypogonadism, eunuchoidal features, and anosmia or hyposmia. It is caused by a defect in the synthesis and/or release of LHRH (luteinizing hormone-releasing hormone; GONADORELIN) from the hypothalamus as a result of faulty embryonic neuronal migration. The gene responsible for this is found in the region Xp22.3 on the short arm of the X chromosome. There is a homolog on the Y chromosome. The syndrome is more prevalent in males by a ratio of three to one.','en',1,'2007-10-18 04:28:24',1,'2012-08-07 10:36:56','11658FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11659,138061,'An abnormally diminished concentration of glucose in the blood, which may lead to tremulousness, cold sweat, piloerection, hypothermia, and headache, accompanied by irritability, confusion, hallucinations, bizarre behavior, and ultimately, convulsions and coma. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11659FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11660,138063,'An abnormally diminished concentration of glucose in the blood, which may lead to tremulousness, cold sweat, piloerection, hypothermia, and headache, accompanied by irritability, confusion, hallucinations, bizarre behavior, and ultimately, convulsions and coma. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11660FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11661,138068,'Diseases of the twelfth cranial (hypoglossal) nerve or nuclei. The nuclei and fascicles of the nerve are located in the medulla, and the nerve exits the skull via the hypoglossal foramen and innervates the muscles of the tongue. Lower brain stem diseases, including ischemia and MOTOR NEURON DISEASES may affect the nuclei or nerve fascicles. The nerve may also be injured by diseases of the posterior fossa or skull base. Clinical manifestations include unilateral weakness of tongue musculature and lingual dysarthria, with deviation of the tongue towards the side of weakness upon attempted protrusion.','en',1,'2007-10-18 04:28:24',1,NULL,'11661FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11662,138069,'Diseases of the twelfth cranial (hypoglossal) nerve or nuclei. The nuclei and fascicles of the nerve are located in the medulla, and the nerve exits the skull via the hypoglossal foramen and innervates the muscles of the tongue. Lower brain stem diseases, including ischemia and MOTOR NEURON DISEASES may affect the nuclei or nerve fascicles. The nerve may also be injured by diseases of the posterior fossa or skull base. Clinical manifestations include unilateral weakness of tongue musculature and lingual dysarthria, with deviation of the tongue towards the side of weakness upon attempted protrusion.','en',1,'2007-10-18 04:28:24',1,NULL,'11662FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
