(11670,138083,'A disease in which the low density lipoprotein (beta-lipoprotein) concentrations are far below normal.','en',1,'2007-10-18 04:28:24',1,NULL,'11670FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11671,138084,'A rare autosomal recessive familial disorder of cholesterol metabolism, characterized by extremely low HDL-cholesterol, reduced total cholesterol, and increased triglyceride levels in serum. Clinical features include the onset before age 20 years of HEPATOMEGALY; SPLENOMEGALY; the deposition of cholesterol in each TONSIL (creating a yellow-orange appearance); and RETINITIS PIGMENTOSA. A sensorimotor or distal sensory POLYNEUROPATHY occurs in approximately 50% of affected individuals. The condition is associated with decreased synthesis and increased catabolism of APOLIPOPROTEIN A-I and APOLIPOPROTEIN A-II, and a defect in cellular signaling and mobilization of lipids. (From Nat Genet 1998 Sep;20(1):96-8; Adams et al., Principles of Neurology, 6th ed, pp1347-8; Menkes, Textbook of Child Neurology, 5th ed, p118)','en',1,'2007-10-18 04:28:24',1,NULL,'11671FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11672,138088,'Adrenocortical hypofunction includes all conditions in which adrenal steroid hormone secretion falls below the requirements of the body. Adrenal insufficiency may be divided into two general categories: (1) those associated with primary inability of the adrenal to elaborate sufficient quantities of hormone and (2) those associated with a secondary failure due to a primary failure in the elaboration of adrenocorticotropin. (Harrison''s Principles of Internal Medicine, 13th ed, p1970)','en',1,'2007-10-18 04:28:24',1,NULL,'11672FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
