(11681,138106,'A plasma cell dyscrasia resembling leukemia with cells of lymphocytic, plasmacytic, or intermediate morphology, which secrete an IgM M component. There is diffuse infiltration of bone marrow and also, in many cases, of the spleen, liver, or lymph nodes. The circulating macroglobulin produces symptoms of hyperviscosity syndrome: weakness, fatigue, bleeding disorders, and visual disturbances. Peak incidence is in the sixth and seventh decades. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11681FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11682,138107,'A plasma cell dyscrasia resembling leukemia with cells of lymphocytic, plasmacytic, or intermediate morphology, which secrete an IgM M component. There is diffuse infiltration of bone marrow and also, in many cases, of the spleen, liver, or lymph nodes. The circulating macroglobulin produces symptoms of hyperviscosity syndrome: weakness, fatigue, bleeding disorders, and visual disturbances. Peak incidence is in the sixth and seventh decades. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11682FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11683,138108,'A pulmonary ventilation rate faster than is metabolically necessary for the exchange of gases. It is the result of an increased frequency of breathing, an increased tidal volume, or a combination of both. It causes an excess intake of oxygen and the blowing off of carbon dioxide.','en',1,'2007-10-18 04:28:24',1,NULL,'11683FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11684,138109,'An autosomal recessive inherited disorder with multiple forms of phenotypic expression, caused by a defect in the oxidative decarboxylation of branched-chain ammino acids (AMINO ACIDS, BRANCHED-CHAIN). These metabolites accumulate in body fluids and render a \"maple syrup\" odor. The disease is divided into classic, intermediate, intermittent, and thiamine responsive subtypes. The classic form presents in the first week of life with ketoacidosis, hypoglycemia, emesis, neonatal seizures, and hypertonia. The intermediate and intermittent forms present in childhood or later with acute episodes of ataxia and vomiting. (From Adams et al., Principles of Neurology, 6th ed, p936)','en',1,'2007-10-18 04:28:24',1,NULL,'11684FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11685,138110,'The inability of a kidney to excrete metabolites at normal plasma levels under conditions of normal loading, or the inability to retain electrolytes under conditions of normal intake. In the acute form (KIDNEY FAILURE, ACUTE), it is marked by uremia and usually by oliguria or anuria, with hyperkalemia and pulmonary edema. The chronic form (KIDNEY FAILURE, CHRONIC) is irreversible and requires hemodialysis.','en',1,'2007-10-18 04:28:24',1,NULL,'11685FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11686,138112,'A group of disorders which have in common elevations of tyrosine in the blood and urine secondary to an enzyme deficiency. Type I tyrosinemia features episodic weakness, self-mutilation, hepatic necrosis, renal tubular injury, and seizures and is caused by a deficiency of the enzyme fumarylacetoacetase. Type II tyrosinemia features mental retardation, painful corneal ulcers, and keratoses of the palms and plantar surfaces and is caused by a deficiency of the enzyme TYROSINE TRANSAMINASE. Type III tyrosinemia features mental retardation and is caused by a deficiency of the enzyme 4-HYDROXYPHENYLPYRUVATE DIOXYGENASE. (Menkes, Textbook of Child Neurology, 5th ed, pp42-3)','en',1,'2007-10-18 04:28:24',1,NULL,'11686FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11687,138113,'A group of disorders which have in common elevations of tyrosine in the blood and urine secondary to an enzyme deficiency. Type I tyrosinemia features episodic weakness, self-mutilation, hepatic necrosis, renal tubular injury, and seizures and is caused by a deficiency of the enzyme fumarylacetoacetase. Type II tyrosinemia features mental retardation, painful corneal ulcers, and keratoses of the palms and plantar surfaces and is caused by a deficiency of the enzyme TYROSINE TRANSAMINASE. Type III tyrosinemia features mental retardation and is caused by a deficiency of the enzyme 4-HYDROXYPHENYLPYRUVATE DIOXYGENASE. (Menkes, Textbook of Child Neurology, 5th ed, pp42-3)','en',1,'2007-10-18 04:28:24',1,NULL,'11687FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11688,138114,'Misalignment of the visual axes of the eyes. In comitant strabismus the degree of ocular misalignment does not vary with the direction of gaze. In noncomitant strabismus the degree of misalignment varies depending on direction of gaze or which eye is fixating on the target. (Miller, Walsh & Hoyt''s Clinical Neuro-Ophthalmology, 4th ed, p641)','en',1,'2007-10-18 04:28:24',1,NULL,'11688FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
