(11690,138122,'Enlargement of the thymus. A condition described in the late 1940''s and 1950''s as pathological thymic hypertrophy was status thymolymphaticus and was treated with radiotherapy. Unnecessary removal of the thymus was also practiced. It later became apparent that the thymus undergoes normal physiological hypertrophy, reaching a maximum at puberty and involuting thereafter. The concept of status thymolymphaticus has been abandoned. Thymus hyperplasia is present in two thirds of all patients with myasthenia gravis. (From Segen, Dictionary of Modern Medicine, 1992; Cecil Textbook of Medicine, 19th ed, p1486)','en',1,'2007-10-18 04:28:24',1,NULL,'11690FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
