(11702,138154,'An inflammatory, pruritic disease of the skin and mucous membranes, which can be either generalized or localized. It is characterized by distinctive purplish, flat-topped papules having a predilection for the trunk and flexor surfaces. The lesions may be discrete or coalesce to form plaques. Histologically, there is a \"saw-tooth\" pattern of epidermal hyperplasia and vacuolar alteration of the basal layer of the epidermis along with an intense upper dermal inflammatory infiltrate composed predominantly of T-cells. Etiology is unknown.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 15:22:29','11702FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
