(11722,138197,'Brain dysfunction or damage resulting from MALIGNANT HYPERTENSION, usually associated with a diastolic blood pressure in excess of 125 mmHg. Clinical manifestations include headache, nausea, emesis, seizures, altered mental status (in some cases progressing to COMA), PAPILLEDEMA, and RETINAL HEMORRHAGE. Focal neurologic signs may develop. Pathologically, this condition may be associated with the formation of ischemic lesions in the brain (BRAIN ISCHEMIA).','en',1,'2007-10-18 04:28:24',1,'2013-04-09 19:31:27','11722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
