(11728,138218,'Increased levels of prolactin in the blood, which may be associated with AMENORRHEA and GALACTORRHEA. Relatively common etiologies include PROLACTINOMA, medication effect, KIDNEY FAILURE, granulomatous diseases of the pituitary gland, and disorders which interfere with the hypothalamic inhibition of prolactin release. Ectopic (non-pituitary) production of prolactin may also occur. (From Joynt, Clinical Neurology, 1992, Ch36, pp77-8)','en',1,'2007-10-18 04:28:24',1,NULL,'11728FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
