(11732,138234,'Inappropriate secretion of anterior pituitary gland hormones. The most common hormones involved in over-secretion are SOMATOTROPIN (which may cause ACROMEGALY) and PROLACTIN (which results in HYPERPROLACTINEMIA). THYROTROPIN; luteinizing hormone (LH); CORTICOTROPIN; and follicle stimulating hormone (FSH) may also be secreted at inappropriate levels. Hypersecretion syndromes are frequently associated with the presence of a pituitary ADENOMA (see also PITUITARY NEOPLASMS).','en',1,'2007-10-18 04:28:24',1,NULL,'11732FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
