(11763,138307,'A condition, more commonly seen in females, due to hyperadrenocorticism resulting from neoplasms of the adrenal cortex or the anterior lobe of the pituitary, or to prolonged excessive intake of glucocorticoids for therapeutic purposes. The symptoms and signs may include rapidly developing adiposity of the face, neck, and trunk, kyphosis caused by osteoporosis of the spine, hypertension, diabetes mellitus, amenorrhea, hypertrichosis in females, impotence in males, dusky complexion with purple markings, polycythemia, pain in the abdomen and back, and muscular wasting and weakness. When secondary to excessive pituitary secretion of adrenocorticotropin, it is known as Cushing''s disease. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11763FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
