(11790,138364,'A common congenital midline defect of fusion of the vertebral arch without protrusion of the spinal cord or meninges. The lesion is also covered by skin. L5 and S1 are the most common vertebrae involved. The condition may be associated with an overlying area of hyperpigmented skin, a dermal sinus, or an abnormal patch of hair. The majority of individuals with this malformation are asymptomatic although there is an increased incidence of tethered cord syndrome and lumbar SPONDYLOSIS. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'11790FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11791,138365,'Abnormal smallness of the head, usually associated with mental retardation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11791FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11792,138368,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'11792FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11793,138371,'Excessive accumulation of cerebrospinal fluid within the cranium which may be associated with dilation of cerebral ventricles, INTRACRANIAL HYPERTENSION; HEADACHE; lethargy; URINARY INCONTINENCE; and ATAXIA (and in infants macrocephaly). This condition may be caused by obstruction of cerebrospinal fluid pathways due to neurologic abnormalities, INTRACRANIAL HEMORRHAGES; CENTRAL NERVOUS SYSTEM INFECTIONS; BRAIN NEOPLASMS; CRANIOCEREBRAL TRAUMA; and other conditions. Impaired resorption of cerebrospinal fluid from the arachnoid villi results in a communicating form of hydrocephalus. Hydrocephalus ex-vacuo refers to ventricular dilation that occurs as a result of brain substance loss from CEREBRAL INFARCTION and other conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'11793FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
