(11798,138380,'A vesicular and bullous eruption having a tendency to recur in summer during childhood and commonly appearing on sun-exposed skin. The lesions are surrounded by an erythematous zone and resemble a vaccination. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11798FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11799,138381,'Rare, chronic, papulo-vesicular disease characterized by an intensely pruritic eruption consisting of various combinations of symmetrical, erythematous, papular, vesicular, or bullous lesions. The disease is strongly associated with the presence of HLA-B8 and HLA-DR3 antigens. A variety of different autoantibodies has been detected in small numbers in patients with dermatitis herpetiformis.','en',1,'2007-10-18 04:28:24',1,NULL,'11799FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11800,138382,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'11800FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11801,138383,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'11801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11802,138384,'A congenital condition where the greater portions of the cerebral hemispheres and CORPUS STRIATUM are replaced by CSF and glial tissue. The meninges and the skull are well formed, which is consistent with earlier normal embryogenesis of the telencephalon. Bilateral occlusions of the internal carotid arteries in utero is a potential mechanism. Clinical features include intact brainstem reflexes without evidence of higher cortical activity. (Menkes, Textbook of Child Neurology, 5th ed, p307)','en',1,'2007-10-18 04:28:24',1,NULL,'11802FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11803,138385,'A congenital condition where the greater portions of the cerebral hemispheres and CORPUS STRIATUM are replaced by CSF and glial tissue. The meninges and the skull are well formed, which is consistent with earlier normal embryogenesis of the telencephalon. Bilateral occlusions of the internal carotid arteries in utero is a potential mechanism. Clinical features include intact brainstem reflexes without evidence of higher cortical activity. (Menkes, Textbook of Child Neurology, 5th ed, p307)','en',1,'2007-10-18 04:28:24',1,NULL,'11803FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11804,138387,'A trophoblastic disease characterized by hydrops of the mesenchymal portion of the villus. Its karyotype is paternal and usually homozygotic. The tumor is indistinguishable from chorioadenoma destruens or invasive mole ( = HYDATIDIFORM MOLE, INVASIVE) except by karyotype. There is no apparent relation by karyotype to CHORIOCARCINOMA. Hydatidiform refers to the presence of the hydropic state of some or all of the villi (Greek hydatis, a drop of water).','en',1,'2007-10-18 04:28:24',1,NULL,'11804FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11805,138391,'Hereditary, progressive degeneration of the neuroepithelium of the retina characterized by night blindness and progressive contraction of the visual field.','en',1,'2007-10-18 04:28:24',1,NULL,'11805FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11806,138392,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'11806FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11807,138393,'An abnormal congenital condition characterized by premature aging in children, where all the changes of cell senescence occur. It is manifested by premature greying, hair loss, hearing loss, cataracts, arthritis,osteoporosis, diabetes mellitus, atrophy of subcutaneous fat, skeletal hypoplasia, and accelerated atherosclerosis. Many affected individuals develop malignant tumors, especially sarcomas.','en',1,'2007-10-18 04:28:24',1,NULL,'11807FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11808,138394,'A familial disorder inherited as an autosomal dominant trait and characterized by the onset of progressive CHOREA and DEMENTIA in the fourth or fifth decade of life. Common initial manifestations include paranoia; poor impulse control; DEPRESSION; HALLUCINATIONS; and DELUSIONS. Eventually intellectual impairment; loss of fine motor control; ATHETOSIS; and diffuse CHOREA involving axial and limb musculature develops, leading to a vegetative state within 10-15 years of disease onset. The juvenile variant has a more fulminant course including SEIZURES; ATAXIA; dementia; and chorea. (From Adams et al., Principles of Neurology, 6th ed, pp1060-4)','en',1,'2007-10-18 04:28:24',1,NULL,'11808FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11809,138395,'Group of lysosomal storage diseases each caused by an inherited deficiency of an enzyme involved in the degradation of glycosaminoglycans (mucopolysaccharides). The diseases are progressive and often display a wide spectrum of clinical severity within one enzyme deficiency.','en',1,'2007-10-18 04:28:24',1,NULL,'11809FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11810,138396,'Group of lysosomal storage diseases each caused by an inherited deficiency of an enzyme involved in the degradation of glycosaminoglycans (mucopolysaccharides). The diseases are progressive and often display a wide spectrum of clinical severity within one enzyme deficiency.','en',1,'2007-10-18 04:28:24',1,NULL,'11810FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11811,138397,'A condition of the bladder occurring predominantly in women, with an inflammatory lesion, usually in the vertex, and involving the entire thickness of the wall, appearing as a small patch of brownish red mucosa, surrounded by a network of radiating vessels. The lesions, known as Fenwick-Hunner or Hunner ulcers, may heal superficially, and are notoriously difficult to detect. Typically, there is urinary frequency and pain on bladder filling and at the end of micturition. It is also called chronic interstitial cystitis. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11811FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11812,138401,'Conditions in which inhalation of organic dusts results in hypersensitivity reactions at the alveolar level, associated with the production of precipitins.','en',1,'2007-10-18 04:28:24',1,NULL,'11812FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
