(11820,138429,'A syndrome associated with defective sympathetic innervation to one side of the face, including the eye. Clinical features include MIOSIS; mild BLEPHAROPTOSIS; and hemifacial ANHIDROSIS (decreased sweating)(see HYPOHIDROSIS). Lesions of the BRAIN STEM; cervical SPINAL CORD; first thoracic nerve root; apex of the LUNG; CAROTID ARTERY; CAVERNOUS SINUS; and apex of the ORBIT may cause this condition. (From Miller et al., Clinical Neuro-Ophthalmology, 4th ed, pp500-11)','en',1,'2007-10-18 04:28:24',1,NULL,'11820FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11821,138432,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'11821FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11822,138434,'Purulent infection of one of the sebaceous glands of Zeis along the eyelid margin (external) or of the meibomian gland on the conjunctival side of the eyelid (internal).','en',1,'2007-10-18 04:28:24',1,NULL,'11822FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11823,138436,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'11823FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11824,138437,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'11824FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
