(11826,138439,'Sexual attraction or relationship between members of the same sex.','en',1,'2007-10-18 04:28:24',1,NULL,'11826FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11827,138440,'Partial or complete loss of vision in one half of the visual field(s) of one or both eyes. Subtypes include altitudinal hemianopsia, characterized by a visual defect above or below the horizontal meridian of the visual field. Homonymous hemianopsia refers to a visual defect that affects both eyes equally, and occurs either to the left or right of the midline of the visual field. Binasal hemianopsia consists of loss of vision in the nasal hemifields of both eyes. Bitemporal hemianopsia is the bilateral loss of vision in the temporal fields. Quadrantanopsia refers to loss of vision in one quarter of the visual field in one or both eyes.','en',1,'2007-10-18 04:28:24',1,NULL,'11827FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11828,138443,'An autosomal recessive inborn error of methionine metabolism usually caused by a deficiency of CYSTATHIONINE BETA-SYNTHASE and associated with elevations of homocysteine in plasma and urine. Clinical features include a tall, slender habitus, SCOLIOSIS, arachnodactyly, MUSCLE WEAKNESS, genu varis, thin blond hair, malar flush, lens dislocations, an increased incidence of MENTAL RETARDATION, and a tendency to develop fibrosis of arteries, frequently complicated by CEREBROVASCULAR ACCIDENTS and MYOCARDIAL INFARCTION. (From Adams et al., Principles of Neurology, 6th ed, p979)','en',1,'2007-10-18 04:28:24',1,NULL,'11828FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(11829,138444,'An autosomal recessive inborn error of methionine metabolism usually caused by a deficiency of CYSTATHIONINE BETA-SYNTHASE and associated with elevations of homocysteine in plasma and urine. Clinical features include a tall, slender habitus, SCOLIOSIS, arachnodactyly, MUSCLE WEAKNESS, genu varis, thin blond hair, malar flush, lens dislocations, an increased incidence of MENTAL RETARDATION, and a tendency to develop fibrosis of arteries, frequently complicated by CEREBROVASCULAR ACCIDENTS and MYOCARDIAL INFARCTION. (From Adams et al., Principles of Neurology, 6th ed, p979)','en',1,'2007-10-18 04:28:24',1,NULL,'11829FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
