(11946,138659,'The inflammation of a sweat gland (usually of the apocrine type). The condition can be idiopathic or occur as a result of or in association with another underlying condition. Neutrophilic eccrine hidradenitis is a relatively rare variant that has been reported in patients undergoing chemotherapy, usually for non-Hodgkin lymphomas or leukemic conditions.','en',1,'2007-10-18 04:28:24',1,NULL,'11946FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
