(11988,138720,'Originally, a state characterized by the presence of both male and female sex organs. In humans, true hermaphroditism is caused by anomalous differentiation of the gonads, with the presence of both ovarian and testicular tissue and of ambiguous morphologic criteria of sex. If only testicular tissue is present, but there are some female morphological criteria of sex, it is known as male PSEUDOHERMAPHRODITISM. If only ovarian tissue is present, but there are some male morphological criteria of sex, it is known as female PSEUDOHERMAPHRODITISM. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'11988FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
