(11999,138737,'A group of inherited diseases that share similar phenotypes but are genetically diverse. Different genetic loci for autosomal recessive, autosomal dominant, and x-linked forms of hereditary spastic paraplegia have been identified. Clinically, patients present with slowly progessive distal limb weakness and lower extremity spasticity. Peripheral sensory neurons may be affected in the later stages of the disease. (J Neurol Neurosurg Psychiatry 1998 Jan;64(1):61-6; Curr Opin Neurol 1997 Aug;10(4):313-8)','en',1,'2007-10-18 04:28:24',1,NULL,'11999FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
