(12001,138739,'A group of inherited disorders characterized by degeneration of dorsal root and autonomic ganglion cells, and clinically by loss of sensation and autonomic dysfunction. There are five subtypes. Type I features autosomal dominant inheritance and distal sensory involvement. Type II is characterized by autosomal inheritance and distal and proximal sensory loss. Type III is DYSAUTONOMIA, FAMILIAL. Type IV features insensitivity to pain, heat intolerance, and mental deficiency. Type V is characterized by a selective loss of pain with intact light touch and vibratory sensation. (From Joynt, Clinical Neurology, 1995, Ch51, pp142-4)','en',1,'2007-10-18 04:28:24',1,NULL,'12001FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12002,138740,'A group of inherited disorders characterized by degeneration of dorsal root and autonomic ganglion cells, and clinically by loss of sensation and autonomic dysfunction. There are five subtypes. Type I features autosomal dominant inheritance and distal sensory involvement. Type II is characterized by autosomal inheritance and distal and proximal sensory loss. Type III is DYSAUTONOMIA, FAMILIAL. Type IV features insensitivity to pain, heat intolerance, and mental deficiency. Type V is characterized by a selective loss of pain with intact light touch and vibratory sensation. (From Joynt, Clinical Neurology, 1995, Ch51, pp142-4)','en',1,'2007-10-18 04:28:24',1,NULL,'12002FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12003,138741,'A group of inherited disorders characterized by degeneration of dorsal root and autonomic ganglion cells, and clinically by loss of sensation and autonomic dysfunction. There are five subtypes. Type I features autosomal dominant inheritance and distal sensory involvement. Type II is characterized by autosomal inheritance and distal and proximal sensory loss. Type III is DYSAUTONOMIA, FAMILIAL. Type IV features insensitivity to pain, heat intolerance, and mental deficiency. Type V is characterized by a selective loss of pain with intact light touch and vibratory sensation. (From Joynt, Clinical Neurology, 1995, Ch51, pp142-4)','en',1,'2007-10-18 04:28:24',1,NULL,'12003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12004,138742,'An intrinsic defect of erythrocytes inherited as an autosomal dominant trait. The erythrocytes assume an oval or elliptical shape.','en',1,'2007-10-18 04:28:24',1,NULL,'12004FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12005,138745,'A disorder characterized by reduced synthesis of the beta chains of hemoglobin. There is retardation of hemoglobin A synthesis in the heterozygous form (thalassemia minor), which is asymptomatic, while in the homozygous form (thalassemia major, Cooley''s anemia, Mediterranean anemia, erythroblastic anemia), which can result in severe complications and even death, hemoglobin A synthesis is absent.','en',1,'2007-10-18 04:28:24',1,NULL,'12005FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12007,138752,'Hereditary conditions that feature progressive visual loss in association with optic atrophy. Relatively common forms include autosomal dominant optic atrophy and Leber hereditary optic neuropathy. The latter is a rare, maternal linked, genetic disorder that is characterized by progressive bilateral optic nerve degeneration. Male offspring are predominantly affected and develop a loss of central vision in the second or third decade of life. Retinal ganglion cells and optic nerve axons that subserve central vision degenerate. The disease is associated with missense mutations of mitochondrial DNA. In some pedigrees this condition is associated with DYSTONIA, sensory neuropathies, PRE-EXCITATION SYNDROMES, and other disorders. (From Biochim Biophys Acta 1999 Feb 9;1410(2):147-58)','en',1,'2007-10-18 04:28:24',1,NULL,'12007FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12008,138753,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12008FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12010,138755,'A rare congenital and familial form of diabetes insipidus, resulting from failure of the renal tubules to absorb water. There is excessive production of antidiuretic hormones but the tubules fail to respond to it. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12010FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12011,138756,'Hereditary disease characterized initially by hematuria and slowly progressing to renal insufficiency. It is sometimes associated with perceptual deafness and/or congenital ocular defects.','en',1,'2007-10-18 04:28:24',1,NULL,'12011FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12012,138757,'Diseases characterized by a selective degeneration of the motor neurons of the spinal cord, brainstem, or motor cortex. Clinical subtypes are distinguished by the major site of degeneration. In AMYOTROPHIC LATERAL SCLEROSIS there is involvment of upper, lower, and brainstem motor neurons. In progressive muscular atrophy and related syndromes (see MUSCULAR ATROPHY, SPINAL) the motor neurons in the spinal cord are primarily affected. With progressive bulbar palsy (BULBAR PALSY, PROGRESSIVE), the initial degeneration occurs in the brainstem. In primary lateral sclerosis, the cortical neurons are affected in isolation. (Adams et al., Principles of Neurology, 6th ed, p1089)','en',1,'2007-10-18 04:28:24',1,NULL,'12012FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12013,138758,'A group of slowly progressive inherited disorders affecting motor and sensory peripheral nerves. Subtypes include HMSNs I-VII. HMSN I and II both refer to CHARCOT-MARIE-TOOTH DISEASE. HMSN III refers to hypertrophic neuropathy of infancy, HMSN IV refers to REFSUM DISEASE, HMSN V refers to a condition marked by a hereditary motor and sensory neuropathy associated with spastic paraplegia (see SPASTIC PARAPLEGIA, HEREDITARY). HMSN VI refers to HMSN associated with an inherited optic atrophy (OPTIC ATROPHIES, HEREDITARY), and HMSN VII refers to HMSN associated with retinitis pigmentosa. (From Adams et al., Principles of Neurology, 6th ed, p1343)','en',1,'2007-10-18 04:28:24',1,NULL,'12013FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12014,138759,'Hereditary conditions that feature progressive visual loss in association with optic atrophy. Relatively common forms include autosomal dominant optic atrophy and Leber hereditary optic neuropathy. The latter is a rare, maternal linked, genetic disorder that is characterized by progressive bilateral optic nerve degeneration. Male offspring are predominantly affected and develop a loss of central vision in the second or third decade of life. Retinal ganglion cells and optic nerve axons that subserve central vision degenerate. The disease is associated with missense mutations of mitochondrial DNA. In some pedigrees this condition is associated with DYSTONIA, sensory neuropathies, PRE-EXCITATION SYNDROMES, and other disorders. (From Biochim Biophys Acta 1999 Feb 9;1410(2):147-58)','en',1,'2007-10-18 04:28:24',1,NULL,'12014FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
