(12020,138771,'An autosomal recessive fructose metabolism disorder due to deficient fructose-1-phosphate aldolase (EC 2.1.2.13) activity, resulting in accumulation of fructose-1-phosphate. The accumulated fructose-1-phosphate inhibits glycogenolysis and gluconeogenesis, causing severe hypoglycemia following ingestion of fructose. Prolonged fructose ingestion in infants leads ultimately to hepatic failure and death. Patients develop a strong distaste for sweet food, and avoid a chronic course of the disease by remaining on a fructose- and sucrose-free diet.','en',1,'2007-10-18 04:28:24',1,NULL,'12020FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12021,138772,'Fibrin stabilizing factor. It is a glycoprotein activated by thrombin in the presence of calcium to form factor XIIIa. Factor XIII is found evenly distributed between plasma and platelets. Its function is to stabilize the formation of the fibrin polymer (clot) which culminates the coagulation cascade.','en',1,'2007-10-18 04:28:24',1,NULL,'12021FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
