(12125,139041,'A spiral bacterium active as a human gastric pathogen. It is a gram-negative, urease-positive, curved or slightly spiral organism initially isolated in 1982 from patients with lesions of gastritis or peptic ulcers in Western Australia. Helicobacter pylori was originally classified in the genus CAMPYLOBACTER, but RNA sequencing, cellular fatty acid profiles, growth patterns, and other taxonomic characteristics indicate that the micro-organism should be included in the genus HELICOBACTER. It has been officially transferred to Helicobacter gen. nov. (see Int J Syst Bacteriol 1989 Oct;39(4):297-405).','en',1,'2007-10-18 04:28:24',1,NULL,'12125FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12126,139042,'An idiopathic systemic inflammatory granulomatous disorder comprised of epithelioid and multinucleated giant cells with little necrosis. It usually invades the lungs with fibrosis and may also involve lymph nodes, skin, liver, spleen, eyes, phalangeal bones, and parotid glands.','en',1,'2007-10-18 04:28:24',1,NULL,'12126FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12127,139046,'A name applied to several itchy skin eruptions of unknown cause. The characteristic course is the formation of a dome-shaped papule with a small transient vesicle on top, followed by crusting over or lichenification. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12127FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12129,139051,'A spectrum of conditions ranging from a benign plasma cell hyperplasia to a highly malignant lymphoma of the small intestine.','en',1,'2007-10-18 04:28:24',1,NULL,'12129FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12130,139052,'An effect of excessive exposure to heat occurring commonly among workers in furnace rooms, foundries, etc., although it may occur from exposure to the sun''s heat (SUNSTROKE). It is marked by subnormal temperature, with dizziness, headache, nausea, and sometimes delirium and/or collapse. It is distinguished from HEAT STROKE, in which the body temperature may be dangerously elevated. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12130FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12131,139056,'An effect of excessive exposure to heat occurring commonly among workers in furnace rooms, foundries, etc., although it may occur from exposure to the sun''s heat (SUNSTROKE). It is marked by subnormal temperature, with dizziness, headache, nausea, and sometimes delirium and/or collapse. It is distinguished from HEAT STROKE, in which the body temperature may be dangerously elevated. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2013-05-10 22:51:22','12131FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12132,139058,'A group of conditions due to overexposure to or overexertion in excess environmental temperature. It includes heat cramps, which are non-emergent and treated by salt replacement; HEAT EXHAUSTION, which is more serious, treated with fluid and salt replacement; and HEAT STROKE, a condition most commonly affecting extremes of age, especially the elderly, accompanied by convulsions, delusions, or coma and treated with cooling the body and replacement of fluids and salts. (From Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'12132FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12133,139063,'Abnormal heart sounds heard during auscultation caused by alterations in the flow of blood into a chamber, through a valve, or by a valve opening or closing abnormally. They are classified by the time of occurrence during the cardiac cycle, the duration, and the intensity of the sound on a scale of I to V.','en',1,'2007-10-18 04:28:24',1,NULL,'12133FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12134,139069,'Heart decompensation in which the heart is unable to maintain adequate circulation of blood in the tissues of the body or to pump out the venous blood returned to it by the venous circulation.','en',1,'2007-10-18 04:28:24',1,'2015-11-03 02:54:51','12134FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12135,139073,'Impairment of conduction in heart excitation. It is often applied specifically to atrioventricular heart block. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12135FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12136,139075,'Conditions that impair the transmission or perception of auditory impulses and information from the level of the ear to the temporal cortices, including the sensorineural pathways.','en',1,'2007-10-18 04:28:24',1,NULL,'12136FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12137,139080,'Motor behavior that is repetitive, often seemingly driven, and nonfunctional. This behavior markedly interferes with normal activities or results in severe bodily self-injury. The behavior is not due to the direct physiological effects of a substance or a general medical condition. (DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'12137FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12138,139081,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-10-18 04:28:24',1,'2015-07-24 01:14:39','12138FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12139,139082,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-10-18 04:28:24',1,NULL,'12139FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
