(12142,139092,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'12142FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12143,139097,'Progressive enlargement of the thyroid gland, often associated with hypothyroidism.','en',1,'2007-10-18 04:28:24',1,NULL,'12143FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12144,139098,'Diseases of the lacrimal apparatus.','en',1,'2007-10-18 04:28:24',1,'2016-07-23 18:36:24','12144FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12145,139100,'Corneal and conjunctival dryness due to deficient tear production, predominantly in menopausal and post-menopausal women. Filamentary keratitis or erosion of the conjunctival and corneal epithelium may be caused by these disorders. Sensation of the presence of a foreign body in the eye and burning of the eyes may occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12145FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12146,139103,'A chronic, congenital ichthyosis inherited as an autosomal recessive trait. Infants are usually born encased in a collodion membrane which sheds within a few weeks. Scaling is generalized and marked with grayish-brown quadrilateral scales, adherent at their centers and free at the edges. In some cases, scales are so thick that they resemble armored plate.','en',1,'2007-10-18 04:28:24',1,NULL,'12146FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12147,139108,'A syndrome characterized by bilateral granulomatous UVEITIS with IRITIS and secondary GLAUCOMA, premature ALOPECIA, symmetrical VITILIGO, poliosis circumscripta (a strand of depigmented hair), HEARING DISORDERS, and meningeal signs (neck stiffness and headache). Examination of the cerebrospinal fluid reveals a pattern consistent with MENINGITIS, ASEPTIC. (Adams et al., Principles of Neurology, 6th ed, p748; Surv Ophthalmol 1995 Jan;39(4):265-292)','en',1,'2007-10-18 04:28:24',1,NULL,'12147FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12148,139109,'One of the sickle cell disorders characterized by the presence of both hemoglobin S and hemoglobin C. It is similar to, but less severe than sickle cell anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'12148FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12149,139110,'Hemolytic anemia due to various intrinsic defects of the erythrocyte.','en',1,'2007-10-18 04:28:24',1,NULL,'12149FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12150,139111,'A primary, chronic disease with genetic, psychosocial, and environmental factors influencing its development and manifestations. The disease is often progressive and fatal. It is characterized by impaired control over drinking, preoccupation with the drug alcohol, use of alcohol despite adverse consequences, and distortions in thinking, most notably denial. Each of these symptoms may be continuous or periodic. (Morse & Flavin for the Joint Commission of the National Council on Alcoholism and Drug Dependence and the American Society of Addiction Medicine to Study the Definition and Criteria for the Diagnosis of Alcoholism: in JAMA 1992;268:1012-4)','en',1,'2007-10-18 04:28:24',1,NULL,'12150FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12151,139113,'An inflammatory reaction involving the folds of the skin surrounding the fingernail. It is characterized by acute or chronic purulent, tender, and painful swellings of the tissues around the nail, caused by an abscess of the nail fold. The pathogenic yeast causing paronychia is most frequently Candida albicans. Saprophytic fungi may also be involved. The causative bacteria are usually Staphylococcus, Pseudomonas aeruginosa, or Streptococcus. (Andrews'' Diseases of the Skin, 8th ed, p271)','en',1,'2007-10-18 04:28:24',1,NULL,'12151FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12152,139114,'General term for the abnormal appearance of histiocytes in the blood. Based on the pathological features of the cells involved rather than on clinical findings, the histiocytic diseases are subdivided into three groups:  HISTIOCYTOSIS, LANGERHANS CELL; HISTIOCYTOSIS, NON-LANGERHANS CELL; and HISTIOCYTIC DISORDERS, MALIGNANT.','en',1,'2007-10-18 04:28:24',1,NULL,'12152FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12153,139124,'A focal malformation resembling a neoplasm, composed of an overgrowth of mature cells and tissues that normally occur in the affected area.','en',1,'2007-10-18 04:28:24',1,NULL,'12153FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12154,139129,'A trophoblastic disease characterized by hydrops of the mesenchymal portion of the villus. Its karyotype is paternal and usually homozygotic. The tumor is indistinguishable from chorioadenoma destruens or invasive mole ( = HYDATIDIFORM MOLE, INVASIVE) except by karyotype. There is no apparent relation by karyotype to CHORIOCARCINOMA. Hydatidiform refers to the presence of the hydropic state of some or all of the villi (Greek hydatis, a drop of water).','en',1,'2007-10-18 04:28:24',1,NULL,'12154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
