(12163,139147,'An oculomandibulofacial syndrome principally characterized by dyscephaly (usually brachycephaly), parrot nose, mandibular hypoplasia, proportionate nanism, hypotrichosis, bilateral congenital cataracts, and microphthalmia. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12163FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12164,139151,'Excess hair in females and children with an adult male pattern of distribution. The concept does not include HYPERTRICHOSIS, which is localized or generalized excess hair.','en',1,'2007-10-18 04:28:24',1,NULL,'12164FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12165,139152,'A modification of the epidermis found on almost every surface of the body except the palms of the hands, soles of the feet, and the glans penis. It is a filament of KERATIN consisting of a shaft, a root, and a point.','en',1,'2007-10-18 04:28:24',1,NULL,'12165FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12166,139155,'Symmetrical osteitis of the four limbs, chiefly localized to the phalanges and the terminal epiphyses of the long bones of the forearm and leg, sometimes extending to the proximal ends of the limbs and the flat bones, and accompanied by dorsal kyphosis and joint involvement. It is often secondary to chronic conditions of the lungs and heart. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12166FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12169,139159,'BACTERIAL INFECTIONS of the nervous system caused by HAEMOPHILUS organisms, and marked by prominent inflammation of the meninges. HAEMOPHILUS INFLUENZAE TYPE B is the most common causative organism. The condition primarily affects children under 6 years of age but may occur in adults. Clinical manifestations include fever; nuchal rigidity; PHOTOPHOBIA; SEIZURES; HEARING LOSS; SENSORINEURONAL; COMA; and cerebrovascular thrombosis. The organism tends to enter the central nervous system following infections of adjacent structures, including the middle ear (see also OTITIS MEDIA), sinuses, and pharynx. (From Menkes, Textbook of Child Neurology, 5th ed, pp396-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12169FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12170,139160,'Pneumonia caused by various species of bacteria. Bacterial pneumonia commonly results from bronchogenic spread of infection following microaspiration of secretions. The largest category of this disease arises from community-acquired pneumonias.','en',1,'2007-10-18 04:28:24',1,NULL,'12170FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12173,139164,'BACTERIAL INFECTIONS of the nervous system caused by HAEMOPHILUS organisms, and marked by prominent inflammation of the meninges. HAEMOPHILUS INFLUENZAE TYPE B is the most common causative organism. The condition primarily affects children under 6 years of age but may occur in adults. Clinical manifestations include fever; nuchal rigidity; PHOTOPHOBIA; SEIZURES; HEARING LOSS; SENSORINEURONAL; COMA; and cerebrovascular thrombosis. The organism tends to enter the central nervous system following infections of adjacent structures, including the middle ear (see also OTITIS MEDIA), sinuses, and pharynx. (From Menkes, Textbook of Child Neurology, 5th ed, pp396-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12173FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12174,139171,'The pathologic wearing away of the tooth substance by brushing, bruxism, clenching, and other mechanical causes. It is differentiated from TOOTH ATTRITION in that this type of wearing away is the result of tooth-to-tooth contact, as in mastication, occurring only on the occlusal, incisal, and proximal surfaces. It differs also from TOOTH EROSION, the progressive loss of the hard substance of a tooth by chemical processes not involving bacterial action. (From Jablonski, Dictionary of Dentistry, 1992, p2)','en',1,'2007-10-18 04:28:24',1,NULL,'12174FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12175,139175,'An acneiform eruption occurring mostly in middle-aged adults and appearing generally on the forehead, cheeks, nose, and chin. Three types are recognized: granulomatous, glandular hyperplastic with rhinophyma, and ocular.','en',1,'2007-10-18 04:28:24',1,NULL,'12175FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
