(12181,139212,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,'2015-12-31 16:04:16','12181FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12182,139222,'A rare autosomal recessive disorder of the urea cycle. It is caused by a deficiency of the hepatic enzyme type I ARGINASE. Arginine is elevated in the blood and cerebrospinal fluid, and periodic hyperammonemia may occur. Disease onset is usually in infancy or early childhood. Clinical manifestations include seizures, microcephaly, progressive mental impairment, hypotonia, ataxia, spastic diplegia, and quadriparesis. (From Hum Genet 1993 Mar;91(1):1-5; Menkes, Textbook of Child Neurology, 5th ed, p51)','en',1,'2007-10-18 04:28:24',1,NULL,'12182FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12183,139223,'Excessive development of the male mammary glands, even to the functional state. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12183FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12184,139225,'Tumors or cancer of the OVARY.','en',1,'2007-10-18 04:28:24',1,NULL,'12184FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12185,139226,'An autonomic disorder characterized by excessive sweating of the forehead, upper lip, perioral region, or sternum subsequent to gustatory stimuli. The auriculotemporal syndrome features facial flushing or sweating limited to the distribution of the auriculotemporal nerve and may develop after trauma to the parotid gland, in association with PAROTID NEOPLASMS, or following their surgical removal. (From Ann Neurol 1997 Dec;42(6):973-5)','en',1,'2007-10-18 04:28:24',1,NULL,'12185FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12186,139227,'Clinical or subclinical disturbances of cortical function due to a sudden, abnormal, excessive, and disorganized discharge of brain cells. Clinical manifestations include abnormal motor, sensory and psychic phenomena. Recurrent seizures are usually referred to as EPILEPSY or \"seizure disorder.\"','en',1,'2007-10-18 04:28:24',1,NULL,'12186FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12187,139228,'An autonomic disorder characterized by excessive sweating of the forehead, upper lip, perioral region, or sternum subsequent to gustatory stimuli. The auriculotemporal syndrome features facial flushing or sweating limited to the distribution of the auriculotemporal nerve and may develop after trauma to the parotid gland, in association with PAROTID NEOPLASMS, or following their surgical removal. (From Ann Neurol 1997 Dec;42(6):973-5)','en',1,'2007-10-18 04:28:24',1,NULL,'12187FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
