(12190,139231,'A systemic non-venereal infection of the tropics caused by Treponema pallidum subspecies pertenue.','en',1,'2007-10-18 04:28:24',1,NULL,'12190FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12191,139232,'Infections of the central nervous system caused by TREPONEMA PALLIDUM which present with a variety of clinical syndromes. The initial phase of infection usually causes a mild or asymptomatic meningeal reaction. The meningovascular form may present acutely as BRAIN INFARCTION. The infection may also remain subclinical for several years. Late syndromes include general paresis; TABES DORSALIS; meningeal syphilis; syphilitic OPTIC ATROPHY; and spinal syphilis. General paresis is characterized by progressive DEMENTIA; DYSARTHRIA; TREMOR; MYOCLONUS; SEIZURES; and Argyll-Robertson pupils. (Adams et al., Principles of Neurology, 6th ed, pp722-8)','en',1,'2007-10-18 04:28:24',1,NULL,'12191FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12192,139233,'An acute inflammatory autoimmune neuritis caused by T cell- mediated cellular immune response directed towards peripheral myelin. Demyelination occurs in peripheral nerves and nerve roots. The process is often preceded by a viral or bacterial infection, surgery, immunization, lymphoma, or exposure to toxins. Common clinical manifestations include progressive weakness, loss of sensation, and loss of deep tendon reflexes. Weakness of respiratory muscles and autonomic dysfunction may occur. (From Adams et al., Principles of Neurology, 6th ed, pp1312-1314)','en',1,'2007-10-18 04:28:24',1,'2016-02-12 19:33:25','12192FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12193,139239,'A form of dwarfism due to deficient release of SOMATOTROPIN which may result from dysfunction of the hypothalamus or anterior pituitary gland.','en',1,'2007-10-18 04:28:24',1,NULL,'12193FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12194,139240,'A form of dwarfism due to deficient release of SOMATOTROPIN which may result from dysfunction of the hypothalamus or anterior pituitary gland.','en',1,'2007-10-18 04:28:24',1,NULL,'12194FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12195,139245,'A rare, progressive inherited disorder resulting from extensive basophilic degeneration of elastic tissue, usually presenting after puberty and involving the skin, eye, and cardiovascular system. Characteristic manifestations are small, circumscribed yellowish patches at sites of considerable movement of the skin, ANGIOID STREAKS in the retina, and a tendency towards hemorrhage and arterial insufficiency.','en',1,'2007-10-18 04:28:24',1,NULL,'12195FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12196,139250,'A focal dystonia characterized by a sustained spasmodic contraction of neck muscles. The trapezius and sternocleidomastoid muscles are primarily involved, resulting in twisting of the neck and an unnatural position of the head. Torticollis may occur as a primary disease process or in association with another condition (e.g., NECK INJURIES, the use of ANTIPSYCHOTIC AGENTS, etc.). (From Adams et al., Principles of Neurology, 6th ed, p107)','en',1,'2007-10-18 04:28:24',1,NULL,'12196FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12197,139251,'Normal, appropriate sorrowful response to an immediate cause. It is self-limiting and gradually subsides within a reasonable time.','en',1,'2007-10-18 04:28:24',1,NULL,'12197FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12198,139254,'A type of acute or chronic skin reaction in which sensitivity is manifested by reactivity to materials or substances coming in contact with the skin. It may involve allergic or non-allergic mechanisms.','en',1,'2007-10-18 04:28:24',1,NULL,'12198FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12200,139260,'Hyperthyroidism associated with a diffuse hyperplastic goiter resulting from production of an antibody directed against the thyroid-stimulating hormone (TSH) receptor, which acts as an agonist of TSH. (Braverman, The Thyroid, 6th ed, p648)','en',1,'2007-10-18 04:28:24',1,'2013-07-29 13:43:17','12200FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12201,139261,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'12201FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12202,139270,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'12202FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12203,139271,'An idiopathic syndrome characterized by one or more of the following; recurrent orofacial swelling, relapsing facial paralysis, and fissured tongue (lingua plicata). The onset is usually in childhood and relapses are common. Cheilitis granulomatosa is a monosymptomatic variant of this condition. (Dermatol Clin 1996 Apr;14(2):371-9; Magalini & Magalini, Dictionary of Medical Syndromes, 4th ed, p531)','en',1,'2007-10-18 04:28:24',1,NULL,'12203FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12204,139277,'Anogenital ulcers caused by Calymmatobacterium granulomatis as distinguished from lymphogranuloma inguinale (see LYMPHOGRANULOMA VENEREUM) caused by CHLAMYDIA TRACHOMATIS. Diagnosis is made by demonstration of typical intracellular Donovan bodies in crushed-tissue smears.','en',1,'2007-10-18 04:28:24',1,NULL,'12204FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12205,139280,'Benign granulomatous disease of unknown etiology characterized by a ring of localized or disseminated papules or nodules on the skin and palisading histiocytes surrounding necrobiotic tissue resulting from altered collagen structures.','en',1,'2007-10-18 04:28:24',1,'2015-04-06 16:27:35','12205FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12206,139282,'A decrease in the number of GRANULOCYTES (BASOPHILS, EOSINOPHILS, and NEUTROPHILS).','en',1,'2007-10-18 04:28:24',1,NULL,'12206FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12207,139289,'Bilateral hereditary disorders of the cornea, usually autosomal dominant, which may be present at birth but more frequently develop during adolescence and progress slowly throughout life. Central macular dystrophy is transmitted as an autosomal recessive defect.','en',1,'2007-10-18 04:28:24',1,NULL,'12207FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12208,139290,'Chronic mental disorders in which there has been an insidious development of a permanent and unshakeable delusional system (persecutory delusions or delusions of jealousy), accompanied by preservation of clear and orderly thinking. Emotional responses and behavior are consistent with the delusional state.','en',1,'2007-10-18 04:28:24',1,NULL,'12208FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12209,139293,'A prolonged seizure or seizures repeated frequently enough to prevent recovery between episodes occurring over a period of 20-30 minutes. The most common subtype is generalized tonic-clonic status epilepticus, a potentially fatal condition associated with neuronal injury and respiratory and metabolic dysfunction. Nonconvulsive forms include petit mal status and complex partial status, which may manifest as behavioral disturbances. Simple partial status epilepticus consists of persistent motor, sensory, or autonomic seizures that do not impair cognition (see also EPILEPSIA PARTIALIS CONTINUA). Subclinical status epilepticus generally refers to seizures occurring in an unresponsive or comatose individual in the absence of overt signs of seizure activity. (From N Engl J Med 1998 Apr 2;338(14):970-6; Neurologia 1997 Dec;12 Suppl 6:25-30)','en',1,'2007-10-18 04:28:24',1,NULL,'12209FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12210,139294,'A generalized seizure disorder characterized by recurrent major motor seizures. The initial brief tonic phase is marked by trunk flexion followed by diffuse extension of the trunk and extremities. The clonic phase features rhythmic flexor contractions of the trunk and limbs, pupillary dilation, elevations of blood pressure and pulse, urinary incontinence, and tongue biting. This is followed by a profound state of depressed consciousness (post-ictal state) which gradually improves over minutes to hours. The disorder may be cryptogenic, familial, or symptomatic (caused by an identified disease process). (From Adams et al., Principles of Neurology, 6th ed, p329)','en',1,'2007-10-18 04:28:24',1,NULL,'12210FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12211,139298,'An immunological attack mounted by a graft against the host because of tissue incompatibility when immunologically competent cells are transplanted to an immunologically incompetent host; the resulting clinical picture is that of GRAFT VS HOST DISEASE.','en',1,'2007-10-18 04:28:24',1,NULL,'12211FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12212,139299,'An immune response with both cellular and humoral components, directed against an allogeneic transplant, whose tissue antigens are not compatible with those of the recipient.','en',1,'2007-10-18 04:28:24',1,NULL,'12212FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12213,139302,'Hereditary metabolic disorder characterized by recurrent acute arthritis, hyperuricemia and deposition of sodium urate in and around the joints, sometimes with formation of uric acid calculi.','en',1,'2007-10-18 04:28:24',1,NULL,'12213FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
