(12267,139385,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'12267FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
