(12273,139401,'Diseases of the ninth cranial (glossopharyngeal) nerve or its nuclei in the medulla. The nerve may be injured by diseases affecting the lower brain stem, floor of the posterior fossa, jugular foramen, or the nerve''s extracranial course. Clinical manifestations include loss of sensation from the pharynx, decreased salivation, and syncope. Glossopharyngeal neuralgia refers to a condition that features recurrent unilateral sharp pain in the tongue, angle of the jaw, external auditory meatus and throat that may be associated with SYNCOPE. Episodes may be triggered by cough, sneeze, swallowing, or pressure on the tragus of the ear. (Adams et al., Principles of Neurology, 6th ed, p1390)','en',1,'2007-10-18 04:28:24',1,NULL,'12273FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
