(12282,139415,'An autosomal recessive inherited sphingolipidosis caused by a deficiency of GALACTOSYLCERAMIDASE leading to an accumulation of PSYCHOSINE in LYSOSOMES of the BRAIN; PERIPHERAL NERVES; LIVER; KIDNEY; and LEUKOCYTES. In the nervous sytem there is prominent central and peripheral demyelination. The infantile form presents at age 4-6 months with psychomotor retardation, MUSCLE SPASTICITY, and tonic spasms induced by minor stimuli. Death occurs within two years. Later onset forms of this disease are characterized by a less fulminant course. (From Menkes, Textbook of Child Neurology, 5th ed, pp195-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12282FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12283,139416,'An autosomal recessive inherited sphingolipidosis caused by a deficiency of GALACTOSYLCERAMIDASE leading to an accumulation of PSYCHOSINE in LYSOSOMES of the BRAIN; PERIPHERAL NERVES; LIVER; KIDNEY; and LEUKOCYTES. In the nervous sytem there is prominent central and peripheral demyelination. The infantile form presents at age 4-6 months with psychomotor retardation, MUSCLE SPASTICITY, and tonic spasms induced by minor stimuli. Death occurs within two years. Later onset forms of this disease are characterized by a less fulminant course. (From Menkes, Textbook of Child Neurology, 5th ed, pp195-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12283FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12284,139417,'Congenital open-angle glaucoma that results from dysgenesis of the angle structures accompanied by increased intraocular pressure and enlargement of the eye. Treatment is both medical and surgical.','en',1,'2007-10-18 04:28:24',1,NULL,'12284FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
