(12286,139431,'An ocular disease, occurring in many forms, having as its primary characteristics an unstable or a sustained increase in the intraocular pressure which the eye cannot withstand without damage to its structure or impairment of its function. The consequences of the increased pressure may be manifested in a variety of symptoms, depending upon type and severity, such as excavation of the optic disk, hardness of the eyeball, corneal anesthesia, reduced visual acuity, seeing of colored halos around lights, disturbed dark adaptation, visual field defects, and headaches. (Dictionary of Visual Science, 4th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12286FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12287,139433,'A congenital bleeding disorder with prolonged bleeding time, absence of aggregation of platelets in response to most agents, especially ADP, and impaired or absent clot retraction. Platelet membranes are deficient in or have a defect in the glycoprotein IIb-IIIa complex (PLATELET GLYCOPROTEIN GPIIB-IIIA COMPLEX).','en',1,'2007-10-18 04:28:24',1,NULL,'12287FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
