(12294,139447,'A group of conditions of diverse etiologies characterized by the accumulation of insoluble fibrillar proteins (amyloid) in various organs and tissues of the body such that vital function is compromised. The associated disease states may be inflammatory, hereditary, or neoplastic, and the deposition can be localized or generalized or systemic. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12294FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12295,139448,'Disorders characterized by recurrent TICS that may interfere with speech and other activities. Tics are sudden, rapid, nonrhythmic, stereotyped motor movements or vocalizations which may be exacerbated by stress and are generally attenuated during absorbing activities. Tic disorders are distinguished from conditions which feature other types of abnormal movements that may accompany general medical conditions. (From DSM-IV, 1994)','en',1,'2007-10-18 04:28:24',1,NULL,'12295FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
