(12307,139471,'A non-neoplastic inflammatory lesion, usually of the jaw or gingiva, containing large, multinucleated cells. It includes reparative giant cell granuloma. Peripheral giant cell granuloma refers to the gingiva (giant cell epulis); central refers to the jaw.','en',1,'2007-10-18 04:28:24',1,NULL,'12307FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12308,139472,'A systemic autoimmune vasculitis occurring primarily in people over the age of 50. Pathologic features include a necrotizing panarteritis including granulomas and giant cells. There is a predilection for involvement of central nervous system blood vessels and the most frequent neurologic complication is an OPTIC NEUROPATHY, ISCHEMIC. Large blood vessels may become involved, including the aorta. Clinical manifestations may include myalgias, weight loss, headache, visual loss, necrosis of the skin or tongue, and chest discomfort. Superficial scalp arteries may become tender and enlarged. A related condition, juvenile temporal arteritis, tends to occur in the first or second decade of life. (From Adams et al., Principles of Neurology, 6th ed, p856)','en',1,'2007-10-18 04:28:24',1,NULL,'12308FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12309,139474,'Maladaptive reactions to identifiable psychosocial stressors occurring within a short time after onset of the stressor. They are manifested by either impairment in social or occupational functioning or by symptoms (depression, anxiety, etc.) that are in excess of a normal and expected reaction to the stressor.','en',1,'2007-10-18 04:28:24',1,NULL,'12309FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12311,139476,'A group of cognitive disorders characterized by the inability to perform previously learned skills that cannot be attributed to deficits of motor or sensory function. The two major subtypes of this condition are ideomotor (see APRAXIA, IDEOMOTOR) and ideational apraxia, which refers to loss of the ability to mentally formulate the processes involved with performing an action. For example, dressing apraxia may result from an inability to mentally formulate the act of placing clothes on the body. Apraxias are generally associated with lesions of the dominant PARIETAL LOBE and supramarginal gyrus. (From Adams et al., Principles of Neurology, 6th ed, pp56-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12311FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12312,139477,'A trophoblastic disease characterized by hydrops of the mesenchymal portion of the villus. Its karyotype is paternal and usually homozygotic. The tumor is indistinguishable from chorioadenoma destruens or invasive mole ( = HYDATIDIFORM MOLE, INVASIVE) except by karyotype. There is no apparent relation by karyotype to CHORIOCARCINOMA. Hydatidiform refers to the presence of the hydropic state of some or all of the villi (Greek hydatis, a drop of water).','en',1,'2007-10-18 04:28:24',1,NULL,'12312FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12313,139478,'A trophoblastic disease characterized by hydrops of the mesenchymal portion of the villus. Its karyotype is paternal and usually homozygotic. The tumor is indistinguishable from chorioadenoma destruens or invasive mole ( = HYDATIDIFORM MOLE, INVASIVE) except by karyotype. There is no apparent relation by karyotype to CHORIOCARCINOMA. Hydatidiform refers to the presence of the hydropic state of some or all of the villi (Greek hydatis, a drop of water).','en',1,'2007-10-18 04:28:24',1,NULL,'12313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12314,139479,'Transplacental infection of the fetus with rubella usually in the first trimester of pregnancy, as a consequence of maternal infection, resulting in various developmental abnormalities in the newborn infant. They include cardiac and ocular lesions, deafness, microcephaly, mental retardation, and generalized growth retardation. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12314FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
