(12322,139510,'Invasion and multiplication of microorganisms in body tissues, which may be clinically inapparent or result in local cellular injury. A local infection may persist and spread by extension to become an acute, subacute, or chronic clinical infection or disease state. It may also become systemic when the microorganisms gain access to the lymphatic or vascular system. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12322FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
