(12326,139519,'An acute form of TUBERCULOSIS in which minute tubercles are formed in a number of organs of the body due to dissemination of the bacilli through the blood stream.','en',1,'2007-10-18 04:28:24',1,NULL,'12326FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12327,139520,'An inherited syndrome of peripheral resistance to thyroid hormones, transmitted as an autosomal recessive trait, characterized by increased serum concentrations of thyroxine and triiodothyronine, increased thyroid hormone binding ratio, and normal to slightly increased thyroid-stimulating hormone and its response to thyrotropin-releasing hormone. The affected persons are euthyroid to slightly hypothyroid. The absence of hypermetabolism and the presence of possible hypothyroidism indicate the existence of partial resistance to the peripheral action of thyroid hormone. (From Jablonski''s Dictionary of syndromes & eponymic diseases, 1991)','en',1,'2007-10-18 04:28:24',1,NULL,'12327FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12328,139521,'Anxiety disorders in which the essential feature is persistent and irrational fear of a specific object, activity, or situation that the individual feels compelled to avoid. The individual recognizes the fear as excessive or unreasonable.','en',1,'2007-10-18 04:28:24',1,'2016-07-01 16:30:35','12328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12329,139527,'A mental disorder characterized by chronic fatigue and concomitant physiologic symptoms.','en',1,'2007-10-18 04:28:24',1,NULL,'12329FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12330,139528,'Generic term for diseases caused by an abnormal metabolic process. It can be congenital due to inherited enzyme abnormality (METABOLISM, INBORN ERRORS) or acquired due to disease of an endocrine organ or failure of a metabolically important organ such as the liver. (Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12330FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12331,139529,'A disorder of cardiac function caused by insufficient blood flow to the muscle tissue of the heart. The decreased blood flow may be due to narrowing of the coronary arteries (CORONARY ARTERIOSCLEROSIS), to obstruction by a thrombus (CORONARY THROMBOSIS), or less commonly, to diffuse narrowing of arterioles and other small vessels within the heart. Severe interruption of the blood supply to the myocardial tissue may result in necrosis of cardiac muscle (MYOCARDIAL INFARCTION).','en',1,'2007-10-18 04:28:24',1,NULL,'12331FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12332,139534,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-10-18 04:28:24',1,NULL,'12332FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12333,139535,'A group of inherited metabolic disorders involving the enzymes responsible for the synthesis and degradation of glycogen. In some patients, prominent liver involvement is presented. In others, more generalized storage of glycogen occurs, sometimes with prominent cardiac involvement.','en',1,'2007-10-18 04:28:24',1,NULL,'12333FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
