(12371,139648,'A group of inherited metabolic diseases characterized by the accumulation of excessive amounts of acid mucopolysaccharides, sphingolipids, and/or glycolipids in visceral and mesenchymal cells. Abnormal amounts of sphingolipids or glycolipids are present in neural tissue. Mental retardation and skeletal changes, most notably dysostosis multiplex, occur frequently. (From Joynt, Clinical Neurology, 1992, Ch56, pp36-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12371FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
