(12376,139658,'A common, acute infection usually caused by the Epstein-Barr virus (HERPESVIRUS 4, HUMAN). There is an increase in mononuclear white blood cells and other atypical lymphocytes, generalized lymphadenopathy, splenomegaly, and occasionally hepatomegaly with hepatitis.','en',1,'2007-10-18 04:28:24',1,NULL,'12376FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12377,139660,'A disorder of immunoglobulin synthesis in which large quantities of abnormal heavy chains are excreted in the urine. The amino acid sequences of the N- (amino-) terminal regions of these chains are normal, but they have a deletion extending from part of the variable domain through the first domain of the constant region, so that they cannot form cross-links to the light chains. The defect arises through faulty coupling of the variable (V) and constant (C) region genes.','en',1,'2007-10-18 04:28:24',1,NULL,'12377FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12378,139670,'An autosomal recessive inherited sphingolipidosis caused by a deficiency of GALACTOSYLCERAMIDASE leading to an accumulation of PSYCHOSINE in LYSOSOMES of the BRAIN; PERIPHERAL NERVES; LIVER; KIDNEY; and LEUKOCYTES. In the nervous sytem there is prominent central and peripheral demyelination. The infantile form presents at age 4-6 months with psychomotor retardation, MUSCLE SPASTICITY, and tonic spasms induced by minor stimuli. Death occurs within two years. Later onset forms of this disease are characterized by a less fulminant course. (From Menkes, Textbook of Child Neurology, 5th ed, pp195-7)','en',1,'2007-10-18 04:28:24',1,NULL,'12378FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12379,139671,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'12379FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12380,139672,'A group of inherited enzyme deficiencies which feature elevations of GALACTOSE in the blood. This condition may be associated with deficiencies of GALACTOKINASE; UDPGLUCOSE-HEXOSE-1-PHOSPHATE URIDYLYLTRANSFERASE; or UDPGLUCOSE 4-EPIMERASE. The classic form is caused by UDPglucose-Hexose-1-Phosphate Uridylyltransferase deficiency, and presents in infancy with FAILURE TO THRIVE; VOMITING; and INTRACRANIAL HYPERTENSION. Affected individuals also may develop MENTAL RETARDATION; JAUNDICE; hepatosplenomegaly; ovarian failure (OVARIAN FAILURE, PREMATURE); and cataracts. (From Menkes, Textbook of Child Neurology, 5th ed, pp61-3)','en',1,'2007-10-18 04:28:24',1,NULL,'12380FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
