(12422,139739,'Inflammation, acute or chronic, of the esophagus caused by bacteria, chemicals, or trauma.','en',1,'2007-10-18 04:28:24',1,'2016-03-12 03:01:47','12422FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12423,139741,'Arthritis caused by bacteria, rickettsiae, mycoplasmas, viruses, fungi, or parasites. Bacterial arthritis is frequently caused by Staphylococcus aureus, Streptococcus pneumoniae, Haemophilus influenzae, and Neisseria gonorrhoeae. Viral arthritis is less common than bacterial arthritis and may be a manifestation of such viral diseases as mumps, rubella, hepatitis, etc.','en',1,'2007-10-18 04:28:24',1,NULL,'12423FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12424,139742,'Hereditary, progressive degeneration of the neuroepithelium of the retina characterized by night blindness and progressive contraction of the visual field.','en',1,'2007-10-18 04:28:24',1,NULL,'12424FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12425,139744,'The inability to see or the loss or absence of perception of visual stimuli. This condition may be the result of EYE DISEASES; OPTIC NERVE DISEASES; OPTIC CHIASM diseases; or BRAIN DISEASES affecting the VISUAL PATHWAYS or OCCIPITAL LOBE.','en',1,'2007-10-18 04:28:24',1,NULL,'12425FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12426,139747,'Abnormal heart sounds heard during auscultation caused by alterations in the flow of blood into a chamber, through a valve, or by a valve opening or closing abnormally. They are classified by the time of occurrence during the cardiac cycle, the duration, and the intensity of the sound on a scale of I to V.','en',1,'2007-10-18 04:28:24',1,NULL,'12426FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12427,139750,'A recessive X-linked defect of leukocyte function in which phagocytic cells ingest but fail to digest bacteria, resulting in recurring bacterial infections with granuloma formation.','en',1,'2007-10-18 04:28:24',1,NULL,'12427FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12428,139756,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'12428FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12429,139763,'A group of disorders which have in common elevations of tyrosine in the blood and urine secondary to an enzyme deficiency. Type I tyrosinemia features episodic weakness, self-mutilation, hepatic necrosis, renal tubular injury, and seizures and is caused by a deficiency of the enzyme fumarylacetoacetase. Type II tyrosinemia features mental retardation, painful corneal ulcers, and keratoses of the palms and plantar surfaces and is caused by a deficiency of the enzyme TYROSINE TRANSAMINASE. Type III tyrosinemia features mental retardation and is caused by a deficiency of the enzyme 4-HYDROXYPHENYLPYRUVATE DIOXYGENASE. (Menkes, Textbook of Child Neurology, 5th ed, pp42-3)','en',1,'2007-10-18 04:28:24',1,NULL,'12429FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12430,139765,'Pneumoconiosis due to the inhalation of dust of stone, sand, or flint containing silicon dioxide, with formation of generalized, nodular fibrotic changes in both lungs. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12430FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12431,139773,'A mitochondrial encephalomyopathy characterized clinically by a mixed seizure disorder, myoclonus, progressive ataxia, spasticity, and a mild myopathy. Dysarthria, optic atrophy, growth retardation, deafness, and dementia may also occur. This condition tends to present in childhood and to be transmitted via maternal lineage. Muscle biopsies reveal ragged-red fibers and respiratory chain enzymatic defects. (From Adams et al., Principles of Neurology, 6th ed, p986)','en',1,'2007-10-18 04:28:24',1,NULL,'12431FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12432,139774,'Sudden temporary alterations in the normally integrative functions of consciousness.','en',1,'2007-10-18 04:28:24',1,NULL,'12432FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12433,139775,'An autosomal recessive lysosomal storage disease caused by a deficiency of ALPHA-L-FUCOSIDASE activity resulting in an accumulation of fucose containing SPHINGOLIPIDS, GLYCOPROTEINS, and mucopolysaccharides (GLYCOSAMINOGLYCANS) in lysosomes. The infantile form (type I) features psychomotor deterioration, MUSCLE SPASTICITY, coarse facial features, growth retardation, skeletal abnormalities, visceromegaly, SEIZURES, recurrent infections, and MACROGLOSSIA, with death occurring in the first decade of life. Juvenile fucosidosis (type II) is the more common variant and features a slowly progressive decline in neurologic function and angiokeratoma corporis diffusum. Type II survival may be through the fourth decade of life. (From Menkes, Textbook of Child Neurology, 5th ed, p87; Am J Med Genet 1991 Jan;38(1):111-31)','en',1,'2007-10-18 04:28:24',1,NULL,'12433FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12434,139777,'Disorder caused by loss of endothelium of the central cornea. It is characterized by hyaline endothelial outgrowths on Descemet''s membrane, epithelial blisters, reduced vision, and pain.','en',1,'2007-10-18 04:28:24',1,NULL,'12434FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12435,139779,'Inappropriate secretion of anterior pituitary gland hormones. The most common hormones involved in over-secretion are SOMATOTROPIN (which may cause ACROMEGALY) and PROLACTIN (which results in HYPERPROLACTINEMIA). THYROTROPIN; luteinizing hormone (LH); CORTICOTROPIN; and follicle stimulating hormone (FSH) may also be secreted at inappropriate levels. Hypersecretion syndromes are frequently associated with the presence of a pituitary ADENOMA (see also PITUITARY NEOPLASMS).','en',1,'2007-10-18 04:28:24',1,NULL,'12435FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12436,139781,'An autosomal recessive fructose metabolism disorder due to deficient fructose-1-phosphate aldolase (EC 2.1.2.13) activity, resulting in accumulation of fructose-1-phosphate. The accumulated fructose-1-phosphate inhibits glycogenolysis and gluconeogenesis, causing severe hypoglycemia following ingestion of fructose. Prolonged fructose ingestion in infants leads ultimately to hepatic failure and death. Patients develop a strong distaste for sweet food, and avoid a chronic course of the disease by remaining on a fructose- and sucrose-free diet.','en',1,'2007-10-18 04:28:24',1,NULL,'12436FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12437,139782,'An autosomal recessive fructose metabolism disorder due to absent or deficient fructose-1,6-diphosphatase activity. Gluconeogenesis is impaired, resulting in accumulation of gluconeogenic precursors (e.g., amino acids, lactate, ketones) and manifested as hypoglycemia, ketosis, and lactic acidosis. Episodes in the newborn infant are often lethal. Later episodes are often brought on by fasting and febrile infections. As patients age through early childhood, tolerance to fasting improves and development becomes normal.','en',1,'2007-10-18 04:28:24',1,NULL,'12437FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12438,139783,'An autosomal recessive fructose metabolism disorder due to deficient fructose-1-phosphate aldolase (EC 2.1.2.13) activity, resulting in accumulation of fructose-1-phosphate. The accumulated fructose-1-phosphate inhibits glycogenolysis and gluconeogenesis, causing severe hypoglycemia following ingestion of fructose. Prolonged fructose ingestion in infants leads ultimately to hepatic failure and death. Patients develop a strong distaste for sweet food, and avoid a chronic course of the disease by remaining on a fructose- and sucrose-free diet.','en',1,'2007-10-18 04:28:24',1,NULL,'12438FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12439,139789,'Damage to tissues as the result of low environmental temperatures.','en',1,'2007-10-18 04:28:24',1,NULL,'12439FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12440,139790,'An acquired organic mental disorder with loss of intellectual abilities of sufficient severity to interfere with social or occupational functioning. The dysfunction is multifaceted and involves memory, behavior, personality, judgment, attention, spatial relations, language, abstract thought, and other executive functions. The intellectual decline is usually progressive, and initially spares the level of consciousness.','en',1,'2007-10-18 04:28:24',1,NULL,'12440FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12441,139793,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12441FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12444,139797,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12444FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
