(12529,140076,'Severe or complete loss of motor function in all four limbs which may result from BRAIN DISEASES; SPINAL CORD DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; NEUROMUSCULAR DISEASES; or rarely MUSCULAR DISEASES. The locked-in syndrome is characterized by quadriplegia in combination with cranial muscle paralysis. Consciousness is spared and the only retained voluntary motor activity may be limited eye movements. This condition is usually caused by a lesion in the upper BRAIN STEM which injures the descending cortico-spinal and cortico-bulbar tracts.','en',1,'2007-10-18 04:28:24',1,NULL,'12529FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12530,140077,'Severe or complete loss of motor function in the lower extremities and lower portions of the trunk. This condition is most often associated with SPINAL CORD DISEASES, although BRAIN DISEASES; PERIPHERAL NERVOUS SYSTEM DISEASES; NEUROMUSCULAR DISEASES; and MUSCULAR DISEASES may also cause bilateral leg weakness.','en',1,'2007-10-18 04:28:24',1,NULL,'12530FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12531,140078,'Disorders of speech articulation caused by imperfect coordination of pharnyx, larnyx, tongue, or face muscles. This may result from CRANIAL NERVE DISEASES; NEUROMUSCULAR DISEASES; CEREBELLAR DISEASES; BASAL GANGLIA DISEASES; BRAIN STEM diseases; or diseases of the corticobulbar tracts (see PYRAMIDAL TRACTS). The cortical language centers are intact in this condition. (From Adams et al., Principles of Neurology, 6th ed, p489)','en',1,'2007-10-18 04:28:24',1,NULL,'12531FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
