(12561,140192,'Historically, a heterogeneous group of acute and chronic diseases, including rheumatoid arthritis, systemic lupus erythematosus, progressive systemic sclerosis, dermatomyositis, etc. This classification was based on the notion that \"collagen\" was equivalent to \"connective tissue\", but with the present recognition of the different types of collagen and the aggregates derived from them as distinct entities, the term \"collagen diseases\" now pertains exclusively to those inherited conditions in which the primary defect is at the gene level and affects collagen biosynthesis, post-translational modification, or extracellular processing directly. (From Cecil Textbook of Medicine, 19th ed, p1494)','en',1,'2007-10-18 04:28:24',1,NULL,'12561FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
