(12596,140496,'A common congenital midline defect of fusion of the vertebral arch without protrusion of the spinal cord or meninges. The lesion is also covered by skin. L5 and S1 are the most common vertebrae involved. The condition may be associated with an overlying area of hyperpigmented skin, a dermal sinus, or an abnormal patch of hair. The majority of individuals with this malformation are asymptomatic although there is an increased incidence of tethered cord syndrome and lumbar SPONDYLOSIS. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'12596FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12597,140497,'A localized infection of mucous membranes or skin caused by toxigenic strains of CORYNEBACTERIUM DIPHTHERIAE. It is characterized by the presence of a pseudomembrane at the site of infection. DIPHTHERIA TOXIN, produced by C. diphtheriae, can cause myocarditis, polyneuritis, and other systemic toxic effects.','en',1,'2007-10-18 04:28:24',1,NULL,'12597FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12598,140498,'Yellow discoloration of the liver due to fatty degeneration of liver parenchymal cells. (Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12598FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12599,140502,'Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','en',1,'2007-10-18 04:28:24',1,NULL,'12599FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12600,140503,'A group of genetic, infectious, or sporadic degenerative human and animal nervous system disorders associated with abnormal PRIONS. These diseases are characterized by conversion of the normal prion protein to an abnormal configuration via a post-translational process. In humans, these conditions generally feature DEMENTIA, ataxia, and a fatal outcome. Diseases in this category include CREUTZFELDT-JAKOB SYNDROME; GERSTMANN-STRAUSSLER-SCHEINKER SYNDROME; KURU; SCRAPIE; fatal familial insomnia; bovine spongiform encephalopathy (see ENCEPHALOPATHY, BOVINE SPONGIFORM); transmissible mink encephalopathy; and chronic wasting disease of mule deer and elk. Pathologic features include a spongiform encephalopathy without evidence of inflammation. The literature occasionally refers to these as unconventional SLOW VIRUS DISEASES. (From Proc Natl Acad Sci USA 1998 Nov 10;95(23):13363-83)','en',1,'2007-10-18 04:28:24',1,NULL,'12600FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12602,140510,'Embolism caused by fat entering the circulation. It is often seen after fractures of large bones or after corticosteriod administration.','en',1,'2007-10-18 04:28:24',1,NULL,'12602FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12604,140512,'An abnormally diminished concentration of glucose in the blood, which may lead to tremulousness, cold sweat, piloerection, hypothermia, and headache, accompanied by irritability, confusion, hallucinations, bizarre behavior, and ultimately, convulsions and coma. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12604FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12605,140513,'Helminth infection of the liver caused by species of Fasciola.','en',1,'2007-10-18 04:28:24',1,NULL,'12605FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12606,140514,'Inflammation of the fascia. There are three major types: 1) Eosinophilic fasciitis, an inflammatory reaction with eosinophilia, producing hard thickened skin with an orange-peel configuration suggestive of scleroderma and considered by some a variant of scleroderma; 2) Necrotizing fasciitis (FASCIITIS, NECROTIZING), a serious fulminating infection (usually by a beta hemolytic streptococcus) causing extensive necrosis of superficial fascia; 3) Nodular/Pseudosarcomatous /Proliferative fasciitis, characterized by a rapid growth of fibroblasts with mononuclear inflammatory cells and proliferating capillaries in soft tissue, often the forearm; it is not malignant but is sometimes mistaken for fibrosarcoma.','en',1,'2007-10-18 04:28:24',1,NULL,'12606FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12607,140515,'Involuntary contraction of the muscle fibers innervated by a motor unit. Fasciculations can often by visualized and take the form of a muscle twitch or dimpling under the skin, but usually do not generate sufficient force to move a limb. They may represent a benign condition or occur as a manifestation of MOTOR NEURON DISEASE or PERIPHERAL NERVOUS SYSTEM DISEASES. (Adams et al., Principles of Neurology, 6th ed, p1294)','en',1,'2007-10-18 04:28:24',1,NULL,'12607FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
