(12613,140538,'Familial disorder characterized by hypophosphatemia associated with decreased renal tubular reabsorption of inorganic phosphorus. It is sometimes associated with osteomalacia or rickets which do not respond to the usual doses of vitamin D.','en',1,'2007-10-18 04:28:24',1,NULL,'12613FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
