(12615,140542,'Glycosuria occurring when there is only the normal amount of sugar in the blood, due to inherited inability of the renal tubules to reabsorb glucose completely. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12615FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12616,140543,'A group of disorders characterized by the excessive production of porphyrins or their precursors that arises from abnormalities in the regulation of the porphyrin-heme pathway. The porphyrias are usually divided into three broad groups, erythropoietic (PORPHYRIA, ERYTHROPOIETIC), hepatic (PORPHYRIA, HEPATIC), and erythrohepatic (PORPHYRIA, ERYTHROHEPATIC), according to the major sites of abnormal porphyrin synthesis.','en',1,'2007-10-18 04:28:24',1,NULL,'12616FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12617,140544,'A heterogenous group of inherited disorders characterized by recurring attacks of rapidly progressive flaccid paralysis or myotonia. These conditions have in common a mutation of the gene encoding the alpha subunit of the sodium channel in skeletal muscle. They are frequently associated with fluctuations in serum potassium levels. Periodic paralysis may also occur as a non-familial process secondary to THYROTOXICOSIS and other conditions. (From Adams et al., Principles of Neurology, 6th ed, p1481)','en',1,'2007-10-18 04:28:24',1,NULL,'12617FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
