(12620,140548,'Increase in body weight beyond skeletal and physical standards as the result of an excessive accumulation of fat in the body. More than two times the ideal weight is considered OBESITY, MORBID.','en',1,'2007-10-18 04:28:24',1,NULL,'12620FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
