(12624,140561,'A megaloblastic anemia occurring in children but more commonly in later life, characterized by histamine-fast achlorhydria, in which the laboratory and clinical manifestations are based on malabsorption of vitamin B 12 due to a failure of the gastric mucosa to secrete adequate and potent intrinsic factor. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12624FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12625,140562,'An autosomal recessive inherited disease characterized by episodic fever, severe abdominal pain, pleurisy, arthritis, and a characteristic ankle rash. Disease flare-ups tend to last 3 days, and individuals are asymptomatic between attacks. Orchitis, a benign recurrent MENINGITIS, headaches, and amyloid nephropathy may also occur. (From Medicine (Baltimore) 1998 Jul;77(4):268-97)','en',1,'2007-10-18 04:28:24',1,NULL,'12625FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
