(12637,140579,'Group of disorders which feature accumulations of active histiocytes and lymphocytes, but where the histiocytes are not Langerhans cells.  The group includes hemophagocytic lymphohistiocytosis, infection-associated hemophagocytic syndrome, sinus histiocytosis, xanthogranuloma, reticulohistiocytoma, juvenile xanthoma, xanthoma disseminatum, as well as the lipid storage diseases (sea-blue histiocyte syndrome and Niemann-Pick disease).','en',1,'2007-10-18 04:28:24',1,NULL,'12637FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12638,140580,'A condition characterized by throbbing headaches which are preceded or accompanied by reversible symptoms that reflect cortical or brain stem dysfunction. The most common type of aura consists of a positive visual phenomenon, usually in the form of a scintillating scotoma. An aura may also take the form of other focal neurologic symptoms or signs, including loss of sensation or weakness in an extremity. In general, the aura precedes the headache by less than 60 minutes, develops over 4 minutes or longer, and has a duration of less than one hour. (From Adams et al., Principles of Neurology, 6th ed, p172; Cephalalgia 1988;8:Suppl 7:1-96)','en',1,'2007-10-18 04:28:24',1,NULL,'12638FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12639,140582,'A collection of rare conditions resulting from defective fat metabolism and characterized by atrophy of the subcutaneous fat. They include total, congenital or acquired, partial, abdominal infantile, and localized lipodystrophy.','en',1,'2007-10-18 04:28:24',1,NULL,'12639FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12640,140583,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'12640FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12641,140584,'Abnormal increase in eosinophils in the blood, tissues or organs.','en',1,'2007-10-18 04:28:24',1,NULL,'12641FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12642,140585,'An autosomal disorder of the peripheral and autonomic nervous systems limited to individuals of Ashkenazic Jewish descent. Clinical manifestations are present at birth and include diminished lacrimation, defective thermoregulation, orthostatic hypotension (HYPOTENSION, ORTHOSTATIC), fixed pupils, excessive SWEATING, loss of pain and temperature sensation, and absent reflexes. Pathologic features include reduced numbers of small diameter peripheral nerve fibers and autonomic ganglion neurons. (From Adams et al., Principles of Neurology, 6th ed, p1348; Nat Genet 1993;4(2):160-4)','en',1,'2007-10-18 04:28:24',1,NULL,'12642FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
