(12668,140804,'An autosomal recessive characteristic or a coagulation disorder acquired in association with VITAMIN K DEFICIENCY. FACTOR VII is a Vitamin K dependent glycoprotein essential to the extrinsic pathway of coagulation.','en',1,'2007-10-18 04:28:24',1,NULL,'12668FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12669,140805,'A deficiency of blood coagulation factor V (known as proaccelerin or accelerator globulin or labile factor) leading to a rare hemorrhagic tendency known as Owren''s disease or parahemophilia. It varies greatly in severity. Factor V deficiency is an autosomal recessive trait. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12669FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
