(12671,140812,'An autosomal dominant degenerative muscle disease characterized by slowly progressive weakness of the muscles of the face, upper-arm, and shoulder girdle. The onset of symptoms usually occurs in the first or second decade of life. Affected individuals usually present with impairment of upper extremity elevation. This tends to be followed by facial weakness, primarily involving the orbicularis oris and orbicuaris oculi muscles. (Neuromuscul Disord 1997;7(1):55-62; Adams et al., Principles of Neurology, 6th ed, p1420)','en',1,'2007-10-18 04:28:24',1,NULL,'12671FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12672,140813,'Severe or complete loss of facial muscle motor function. This condition may result from central or peripheral lesions. Damage to CNS motor pathways from the cerebral cortex to the facial nuclei in the pons leads to facial weakness that generally spares the forehead muscles. FACIAL NERVE DISEASES generally results in generalized hemifacial weakness. NEUROMUSCULAR JUNCTION DISEASES and MUSCULAR DISEASES may also cause facial paralysis or paresis.','en',1,'2007-10-18 04:28:24',1,NULL,'12672FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12673,140816,'Severe or complete loss of facial muscle motor function. This condition may result from central or peripheral lesions. Damage to CNS motor pathways from the cerebral cortex to the facial nuclei in the pons leads to facial weakness that generally spares the forehead muscles. FACIAL NERVE DISEASES generally results in generalized hemifacial weakness. NEUROMUSCULAR JUNCTION DISEASES and MUSCULAR DISEASES may also cause facial paralysis or paresis.','en',1,'2007-10-18 04:28:24',1,NULL,'12673FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12674,140819,'Two syndromes of oral, facial, and digital malformations. Type I (Papillon-Leage and Psaume syndrome, Gorlin-Psaume syndrome) is inherited as an X-linked dominant trait and is found only in females and XXY males. Type II (Mohr syndrome) is inherited as an autosomal recessive trait.','en',1,'2007-10-18 04:28:24',1,NULL,'12674FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12675,140822,'A syndrome characterized by slowly progressive unilateral atrophy of facial subcutaneous fat, muscle tissue, skin, cartilage, and bone. The condition typically progresses over a period of 2-10 years and then stabilizes.','en',1,'2007-10-18 04:28:24',1,NULL,'12675FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
