(12677,140825,'Involuntary reddening, especially of the face, associated with feelings of embarrassment, confusion or shame.','en',1,'2007-10-18 04:28:24',1,NULL,'12677FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12678,140827,'Abnormal responses to sunlight or artificial light due to extreme reactivity of light-absorbing molecules in tissues. It refers almost exclusively to skin photosensitivity, including sunburn, reactions due to repeated prolonged exposure in the absence of photosensitizing factors, and reactions requiring photosensitizing factors such as photosensitizing agents and certain diseases. With restricted reference to skin tissue, it does not include photosensitivity of the eye to light, as in photophobia or photosensitive epilepsy.','en',1,'2007-10-18 04:28:24',1,NULL,'12678FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12679,140832,'Suppurative inflammation of the tissues of the internal structures of the eye; not all layers of the uvea are affected. Fungi, necrosis of intraocular tumors, and retained intraocular foreign bodies often cause a purulent endophthalmitis.','en',1,'2007-10-18 04:28:24',1,NULL,'12679FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12680,140835,'Presence of fluid in the pleural cavity resulting from excessive transudation or exudation from the pleural surfaces. It is a sign of disease and not a diagnosis in itself.','en',1,'2007-10-18 04:28:24',1,NULL,'12680FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12681,140837,'A series of gastrointestinal disorders which share in common the excessive loss of protein, mainly albumin, across the gut wall. They occur in the stomach (Menetrier disease), as well as the small bowel (intestinal lymphangiectases, assorted inflammatory states). They are also occasionally associated with congestive heart failure (again a small bowel protein loss).','en',1,'2007-10-18 04:28:24',1,NULL,'12681FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12682,140838,'Separation of the inner layers of the retina (neural retina) from the pigment epithelium. Retinal detachment occurs more commonly in men than in women, in eyes with degenerative myopia, in aging and in aphakia. It may occur after an uncomplicated cataract extraction, but it is seen more often if vitreous humor has been lost during surgery. (Dorland, 27th ed; Newell, Ophthalmology: Principles and Concepts, 7th ed, p310-12).','en',1,'2007-10-18 04:28:24',1,NULL,'12682FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
