(12691,140855,'A heterogeneous group of disorders that share glucose intolerance in common.','en',1,'2007-10-18 04:28:24',1,NULL,'12691FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12693,140864,'A demyelinating condition affecting the PONS and characterized clinically by an acute progressive QUADRIPLEGIA; DYSARTHRIA; DYSPHAGIA; and alterations of consciousness. Pathologic features include prominent demyelination in the central PONS with sparing of axons and neurons. This condition is usually associated with systemic disorders such as HYPONATREMIA; chronic ALCOHOLISM; LIVER FAILURE; severe BURNS; malignant NEOPLASMS; hemorrhagic PANCREATITIS; HEMODIALYSIS; and SEPSIS. The rapid medical correction of hyponatremia has been cited as a cause of this condition. (From Adams et al., Principles of Neurology, 6th ed, pp1125-6)','en',1,'2007-10-18 04:28:24',1,NULL,'12693FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12694,140867,'A rare cutaneous neoplasm that occurs in the elderly. It develops more frequently in women and predominantly involves apocrine gland-bearing areas, especially the vulva, scrotum, and perianal areas. The lesions develop as erythematous scaly patches that progress to crusted, pruritic, erythematous plaques. The clinical differential diagnosis includes squamous cell carcinoma in situ and superficial fungal infection. It is generally thought to be an adenocarcinoma of the epidermis, from which it extends into the contiguous epithelium of hair follicles and eccrine sweat ducts. (DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1478)','en',1,'2007-10-18 04:28:24',1,NULL,'12694FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12696,140886,'Resorption of calcified dental tissue, involving demineralization due to reversal of the cation exchange and lacunar resorption by osteoclasts. There are two types: external (as a result of tooth pathology) and internal (apparently initiated by a peculiar inflammatory hyperplasia of the pulp). (From Jablonski, Dictionary of Dentistry, 1992, p676)','en',1,'2007-10-18 04:28:24',1,NULL,'12696FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12697,140890,'A condition in which tissue more or less perfectly resembling the uterine mucous membrane (the endometrium) and containing typical endometrial granular and stromal elements occurs aberrantly in various locations in the pelvic cavity.','en',1,'2007-10-18 04:28:24',1,NULL,'12697FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12698,140894,'Congenital eversion of the urinary bladder. It is characterized by the absence of a portion of the lower abdominal wall and the anterior vesical wall, with eversion of the posterior vesical wall through the deficit.','en',1,'2007-10-18 04:28:24',1,NULL,'12698FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12699,140895,'Congenital eversion of the urinary bladder. It is characterized by the absence of a portion of the lower abdominal wall and the anterior vesical wall, with eversion of the posterior vesical wall through the deficit.','en',1,'2007-10-18 04:28:24',1,NULL,'12699FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12701,140898,'Conditions characterized by language abilities (comprehension and expression of speech and writing) that are below the expected level for a given age, generally in the absence of an intellectual impairment. These conditions may be associated with DEAFNESS; BRAIN DISEASES; MENTAL DISORDERS; or environmental factors.','en',1,'2007-10-18 04:28:24',1,NULL,'12701FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12702,140899,'A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','en',1,'2007-10-18 04:28:24',1,NULL,'12702FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
