(12704,140904,'Cognitive disorders including delirium, dementia, and other cognitive disorders. These may be the result of substance use, trauma, or other causes.','en',1,'2007-10-18 04:28:24',1,NULL,'12704FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12705,140905,'Hearing loss from exposure to noise. The loss is often in the frequency range 4000-6000 hertz.','en',1,'2007-10-18 04:28:24',1,NULL,'12705FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12706,140911,'An experimental animal model for central nervous system demyelinating disease. Inoculation with a white matter emulsion combined with FREUND''S ADJUVANT, myelin basic protein, or purified central myelin triggers a T cell-mediated immune response directed towards central myelin. The pathologic features are similar to MULTIPLE SCLEROSIS, including perivascular and periventricular foci of inflammation and demyelination. Subpial demyelination underlying meningeal infiltrations also occurs, which is also a feature of ENCEPHALOMYELITIS, ACUTE DISSEMINATED. Passive immunization with T-cells from an afflicted animal to a normal animal also induces this condition. (From Immunol Res 1998;17(1-2):217-27; Raine CS, Textbook of Neuropathology, 2nd ed, p604-5)','en',1,'2007-10-18 04:28:24',1,NULL,'12706FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12707,140913,'Transplacental infection of the fetus with rubella usually in the first trimester of pregnancy, as a consequence of maternal infection, resulting in various developmental abnormalities in the newborn infant. They include cardiac and ocular lesions, deafness, microcephaly, mental retardation, and generalized growth retardation. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12707FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12708,140914,'A form of ocular misalignment where the visual axes diverge inappropriately. For example, medial rectus muscle weakness may produce this condition as the affected eye will deviate laterally upon attempted forward gaze. An exotropia occurs due to the relatively unopposed force exerted on the eye by the lateral rectus muscle, which pulls the eye in an outward direction.','en',1,'2007-10-18 04:28:24',1,NULL,'12708FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12710,140919,'Abnormal protrusion of both eyes; may be caused by endocrine gland malfunction, malignancy, injury, or paralysis of the extrinsic muscles of the eye.','en',1,'2007-10-18 04:28:24',1,NULL,'12710FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12711,140920,'A disorder in which fantasies about or the act of exposing the genitals to an unsuspecting stranger produces sexual excitement with no attempt at further sexual activity with the stranger.','en',1,'2007-10-18 04:28:24',1,NULL,'12711FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12712,140925,'The deposition of flaky, translucent fibrillar material most conspicuous on the anterior lens capsule and pupillary margin but also in both surfaces of the iris, the zonules, trabecular meshwork, ciliary body, corneal endothelium, and orbital blood vessels. It sometimes forms a membrane on the anterior iris surface. Exfoliation refers to the shedding of pigment by the iris. (Newell, Ophthalmology, 7th ed, p380)','en',1,'2007-10-18 04:28:24',1,NULL,'12712FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12713,140926,'A form of bronchial disorder associated with airway obstruction, marked by recurrent attacks of paroxysmal dyspnea, with wheezing due to spasmodic contraction of the bronchi.','en',1,'2007-10-18 04:28:24',1,NULL,'12713FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12714,140927,'The symptom of paroxysmal pain consequent to myocardial ischemia usually of distinctive character, location and radiation, and provoked by a transient stressful situation during which the oxygen requirements of the myocardium exceed the capacity of the coronary circulation to supply it.','en',1,'2007-10-18 04:28:24',1,NULL,'12714FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12715,140928,'Congenital malformations of the central nervous system and adjacent structures related to defective neural tube closure during the first trimester of pregnancy generally occurring between days 18-29 of gestation. Ectodermal and mesodermal malformations (mainly involving the skull and vertebrae) may occur as a result of defects of neural tube closure. (From Joynt, Clinical Neurology, 1992, Ch55, pp31-41)','en',1,'2007-10-18 04:28:24',1,NULL,'12715FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12716,140935,'A pulmonary ventilation rate faster than is metabolically necessary for the exchange of gases. It is the result of an increased frequency of breathing, an increased tidal volume, or a combination of both. It causes an excess intake of oxygen and the blowing off of carbon dioxide.','en',1,'2007-10-18 04:28:24',1,NULL,'12716FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12717,140938,'Production or presence of gas in the gastrointestinal tract which may be expelled through the anus.','en',1,'2007-10-18 04:28:24',1,NULL,'12717FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12718,140939,'A drive stemming from a physiological need for water.','en',1,'2007-10-18 04:28:24',1,'2015-12-31 17:02:43','12718FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
