(12720,140941,'Excessive sweating. In the localized type, the most frequent sites are the palms, soles, axillae, inguinal folds, and the perineal area. Its chief cause is thought to be emotional. Generalized hyperhidrosis may be induced by a hot, humid environment, by fever, or by vigorous exercise.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 02:38:00','12720FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12721,140946,'A transient reddening of the face that may be due to fever, certain drugs, exertion, stress, or a disease process.','en',1,'2007-10-18 04:28:24',1,NULL,'12721FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12722,140953,'Diseases in which skin eruptions or rashes are a prominent manifestation. Classically, six such diseases were described with similar rashes; they were numbered in the order in which they were reported. Only the fourth (Duke''s disease), fifth (ERYTHEMA INFECTIOSUM), and sixth (EXANTHEMA SUBITUM) numeric designations survive as occasional synonyms in current terminology.','en',1,'2007-10-18 04:28:24',1,NULL,'12722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12723,140954,'A malignant tumor of the bone which always arises in the medullary tissue, occurring more often in cylindrical bones. There are conspicuous foci of necrosis in association with irregular masses of small, regular, rounded or ovoid cells with very scanty cytoplasm. The tumor occurs usually before the age of 20, about twice as frequently in males as in females. (From Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12723FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12724,140963,'The act or practice of putting to death people or animals suffering from incurable conditions or diseases.','en',1,'2007-10-18 04:28:24',1,NULL,'12724FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12725,140966,'A disease caused by various fungi (Madurella mycetomi) or actinomycetes (Nocardia brasiliensis). It usually affects the foot, hand, and legs with tissues becoming necrosed and swollen after infection.','en',1,'2007-10-18 04:28:24',1,NULL,'12725FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12726,140977,'Subacute inflammation of the inguinal lymph glands caused by certain immunotypes of CHLAMYDIA TRACHOMATIS. It is a sexually transmitted disease in the U.S. but is more widespread in developing countries. It is distinguished from granuloma venereum (see GRANULOMA INGUINALE), which is caused by Calymmatobacterium granulomatis.','en',1,'2007-10-18 04:28:24',1,NULL,'12726FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12727,140978,'Pain in the pelvic region of genital and non-genital origin and of organic or psychogenic etiology. Frequent causes of pain are distension or contraction of hollow viscera, rapid stretching of the capsule of a solid organ, chemical irritation, tissue ischemia, and neuritis secondary to inflammatory, neoplastic, or fibrotic processes in adjacent organs. (Kase, Weingold & Gershenson: Principles and Practice of Clinical Gynecology, 2d ed, pp479-508)','en',1,'2007-10-18 04:28:24',1,NULL,'12727FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12728,140979,'An illusion of movement, either of the external world revolving around the individual or of the individual revolving in space. Vertigo may be associated with disorders of the inner ear, vestibular nerve, brainstem, and cerebral cortex. Lesions in the temporal and parietal lobes may be associated with FOCAL SEIZURES that may feature vertigo as an ictal manifestation. (From Adams et al., Principles of Neurology, 6th ed, pp300-1)','en',1,'2007-10-18 04:28:24',1,NULL,'12728FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12729,140980,'A relatively common disorder characterized by a fairly specific pattern of tremors which are most prominent in the upper extremities and neck, inducing titubations of the head. The tremor is usually mild, but when severe may be disabling. An autosomal dominant pattern of inheritance may occur in some families (i.e., familial tremor). (Mov Disord 1988;13(1):5-10)','en',1,'2007-10-18 04:28:24',1,NULL,'12729FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12730,140987,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'12730FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12731,140988,'Excessive amount of sodium in the blood. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12731FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12732,140990,'An autosomal recessive fructose metabolism disorder due to deficient fructose-1-phosphate aldolase (EC 2.1.2.13) activity, resulting in accumulation of fructose-1-phosphate. The accumulated fructose-1-phosphate inhibits glycogenolysis and gluconeogenesis, causing severe hypoglycemia following ingestion of fructose. Prolonged fructose ingestion in infants leads ultimately to hepatic failure and death. Patients develop a strong distaste for sweet food, and avoid a chronic course of the disease by remaining on a fructose- and sucrose-free diet.','en',1,'2007-10-18 04:28:24',1,NULL,'12732FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
