(12775,141089,'A common, acute infection usually caused by the Epstein-Barr virus (HERPESVIRUS 4, HUMAN). There is an increase in mononuclear white blood cells and other atypical lymphocytes, generalized lymphadenopathy, splenomegaly, and occasionally hepatomegaly with hepatitis.','en',1,'2007-10-18 04:28:24',1,NULL,'12775FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
