(12777,141092,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'12777FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12778,141093,'A group of hereditary hemolytic anemias in which there is decreased synthesis of one or more hemoglobin polypeptide chains. There are several genetic types with clinical pictures ranging from barely detectable hematologic abnormality to severe and fatal anemia.','en',1,'2007-10-18 04:28:24',1,NULL,'12778FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12780,141096,'A malignant skin neoplasm that seldom metastasizes but has potentialities for local invasion and destruction. Clinically it is divided into types: nodular, cicatricial, morphaic, and erythematoid (pagetoid). More than 95% of these carcinomas occur in patients over 40. They develop on hair-bearing skin, most commonly on sun-exposed areas. Approximately 85% are found on the head and neck area and the remaining 15% on the trunk and limbs. (From Dorland, 27th ed; DeVita Jr et al., Cancer: Principles & Practice of Oncology, 3d ed, p1471)','en',1,'2007-10-18 04:28:24',1,NULL,'12780FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12781,141097,'A benign tumor derived from smooth muscle tissue, also known as a fibroid tumor. They rarely occur outside of the uterus and the gastrointestinal tract but can occur in the skin and subcutaneous tissues, probably arising from the smooth muscle of small blood vessels in these tissues.','en',1,'2007-10-18 04:28:24',1,NULL,'12781FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12782,141098,'A tumor of medium-to-large veins, composed of plump-to-spindled endothelial cells that bulge into vascular spaces in a tombstone-like fashion. These tumors are thought to have \"borderline\" aggression, where one-third develop local recurrences, but only rarely metastasize. It is unclear whether the epithelioid hemangioendothelioma is truly neoplastic or an exuberant tissue reaction, nor is it clear if this is equivalent to Kimura''s disease (see ANGIOLYMPHOID HYPERPLASIA WITH EOSINOPHILIA). (Segen, Dictionary of Modern Medicine, 1992)','en',1,'2007-10-18 04:28:24',1,NULL,'12782FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12783,141101,'Congenital absence of the upper wall of the urethra.','en',1,'2007-10-18 04:28:24',1,NULL,'12783FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12784,141102,'Idiopathic inflammation of the vestibular nerve, characterized clinically by the acute or subacute onset of vertigo, nausea, and imbalance. The cochlear nerve is typically spared and hearing loss and tinnitus do not usually occur. Symptoms usually resolve over a period of days to weeks. (Adams et al., Principles of Neurology, 6th ed, p304)','en',1,'2007-10-18 04:28:24',1,NULL,'12784FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12785,141106,'A syndrome characterized by daily episodes of intense periorbital pain that recur over a period of 6-12 weeks that may be followed by a period of remission of months to years. The pain is non-throbbing, has a duration of 30-60 minutes and tends to occur at night or at regular intervals during the day. Unilateral rhinorrhea, conjunctival injection, lacrimation, facial flushing, and miosis frequently accompany the headaches, which primarily affect young adult males. (Adams et al., Principles of Neurology, 6th ed, p181)','en',1,'2007-10-18 04:28:24',1,NULL,'12785FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12786,141110,'Refers to any inflammation of the sclera including episcleritis, a benign condition affecting only the episclera, which is generally short-lived and easily treated. Classic scleritis, on the other hand, affects deeper tissue and is characterized by higher rates of visual acuity loss and even mortality, particularly in necrotizing form. Its characteristic symptom is severe and general head pain. Scleritis has also been associated with systemic collagen disease. Etiology is unknown but is thought to involve a local immune response. Treatment is difficult and includes administration of anti-inflammatory and immunosuppressive agents such as corticosteroids. Inflammation of the sclera may also be secondary to inflammation of adjacent tissues, such as the conjunctiva.','en',1,'2007-10-18 04:28:24',1,NULL,'12786FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12787,141111,'Macular degeneration characterized by edema and cystic spaces which may lead to a macular depression or hole.','en',1,'2007-10-18 04:28:24',1,NULL,'12787FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12789,141118,'Diseases of the lacrimal apparatus.','en',1,'2007-10-18 04:28:24',1,NULL,'12789FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12790,141120,'Clinical or subclinical disturbances of cortical function due to a sudden, abnormal, excessive, and disorganized discharge of brain cells. Clinical manifestations include abnormal motor, sensory and psychic phenomena. Recurrent seizures are usually referred to as EPILEPSY or \"seizure disorder.\"','en',1,'2007-10-18 04:28:24',1,'2011-12-15 06:27:34','12790FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12791,141121,'Recurrent conditions characterized by epileptic seizures which arise diffusely and simultaneously from both hemispheres of the brain. Classification is generally based upon motor manifestations of the seizure (e.g., convulsive, nonconvulsive, akinetic, atonic, etc.) or etiology (e.g., idiopathic, cryptogenic, and symptomatic). (From Mayo Clin Proc, 1996 Apr;71(4):405-14)','en',1,'2007-10-18 04:28:24',1,NULL,'12791FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12792,141122,'Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEMS DISEASES (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus may represent a normal physiologic event or occur as the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','en',1,'2007-10-18 04:28:24',1,NULL,'12792FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12793,141123,'Recurrent conditions characterized by epileptic seizures which arise diffusely and simultaneously from both hemispheres of the brain. Classification is generally based upon motor manifestations of the seizure (e.g., convulsive, nonconvulsive, akinetic, atonic, etc.) or etiology (e.g., idiopathic, cryptogenic, and symptomatic). (From Mayo Clin Proc, 1996 Apr;71(4):405-14)','en',1,'2007-10-18 04:28:24',1,NULL,'12793FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12794,141128,'Sensation of discomfort, distress, or agony in the abdominal region.','en',1,'2007-10-18 04:28:24',1,'2016-09-21 18:56:43','12794FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12795,141134,'Diseases characterized by injury or dysfunction involving multiple peripheral nerves and nerve roots. The process may primarily affect myelin or nerve axons. Two of the more common demyelinating forms are acute inflammatory polyradiculopathy (GUILLAIN-BARRE SYNDROME) and POLYRADICULONEUROPATHY, CHRONIC INFLAMMATORY DEMYELINATING. Polyradiculoneuritis refers to inflammation of multiple peripheral nerves and spinal nerve roots.','en',1,'2007-10-18 04:28:24',1,NULL,'12795FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
