(12797,141144,'Form of epidermolysis bullosa characterized by autosomal dominant inheritance and by serous bullae that heal without scarring.','en',1,'2007-10-18 04:28:24',1,NULL,'12797FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12798,141145,'Group of genetically determined disorders characterized by the blistering of skin and mucosae. There are four major forms: acquired, simple, junctional, and dystrophic. Each of the latter three has several varieties.','en',1,'2007-10-18 04:28:24',1,NULL,'12798FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12800,141147,'Intradermal or subcutaneous saclike structure, the wall of which is stratified epithelium containing keratohyalin granules.','en',1,'2007-10-18 04:28:24',1,NULL,'12800FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
