(12803,141152,'Infection with any of the rotaviruses. Specific infections include human infantile diarrhea, neonatal calf diarrhea, and epidemic diarrhea of infant mice.','en',1,'2007-10-18 04:28:24',1,NULL,'12803FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12804,141153,'An acute, febrile, infectious disease generally occurring in epidemics, most often seen in persons under the age of 20. It is usually caused by COXSACKIEVIRUSES B and sometimes by COXSACKIEVIRUSES A, ECHOVIRUSES, and other enteroviruses. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12804FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12805,141154,'Infectious diseases of cattle, sheep, and goats, characterized by blepharospasm, lacrimation, conjunctivitis, and varying degrees of corneal opacity and ulceration. In cattle the causative agent is MORAXELLA (MORAXELLA) BOVIS; in sheep, MYCOPLASMA, RICKETTSIA, CHLAMYDIA, or ACHOLEPLASMA; in goats, RICKETTSIA.','en',1,'2007-10-18 04:28:24',1,NULL,'12805FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12806,141155,'A highly contagious disease characterized by subconjunctival hemorrhage, sudden swelling of the eyelids and congestion, redness, and pain in the eye. Epidemic conjunctivitis caused by Enterovirus 70 (EV-70) was first described in Africa in 1969. It is caused also by Coxsackievirus A24 variant (CA24v). Epidemics by this organism have appeared most frequently in Asia.','en',1,'2007-10-18 04:28:24',1,NULL,'12806FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12807,141156,'Infections of the brain caused by arthopod-borne viruses (i.e., arboviruses) primarily from the families TOGAVIRIDAE; FLAVIVIRIDAE; BUNYAVIRIDAE; REOVIRIDAE; and RHABDOVIRIDAE. Life cycles of these viruses are characterized by ZOONOSES, with birds and lower mammals serving as intermediate hosts. The virus is transmitted to humans by the bite of mosquitoes (CULICIDAE) or TICKS. Clinical manifestations include fever, headache, alterations of mentation, focal neurologic deficits, and COMA. (From Clin Microbiol Rev 1994 Jan;7(1):89-116; Walton, Brain''s Diseases of the Nervous System, 10th ed, p321)','en',1,'2007-10-18 04:28:24',1,NULL,'12807FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12808,141160,'An acute infectious disease of humans, particularly children, caused by any of three serotypes of human poliovirus (POLIOVIRUSES, HUMAN 1-3). Usually the infection is limited to the gastrointestinal tract and nasopharynx, and is often asymptomatic. The central nervous system, primarily the spinal cord, may be affected, leading to rapidly progressive paralysis, coarse FASCICULATION and hyporeflexia. Motor neurons are primarily affected. Encephalitis may also occur. The virus replicates in the nervous system, and may cause significant neuronal loss, most notably in the spinal cord. A rare related condition, nonpoliovirus poliomyelitis, may result from infections with nonpoliovirus enteroviruses. (From Adams et al., Principles of Neurology, 6th ed, pp764-5)','en',1,'2007-10-18 04:28:24',1,NULL,'12808FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12809,141162,'A condition characterized by pain in or near the lateral humeral epicondyle or in the forearm extensor muscle mass as a result of unusual strain. It occurs in tennis players as well as housewives, artisans, and violinists.','en',1,'2007-10-18 04:28:24',1,NULL,'12809FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12810,141164,'Disorders of increased melanin pigmentation that develop without preceding inflammatory disease.','en',1,'2007-10-18 04:28:24',1,'2015-04-09 22:47:56','12810FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12811,141166,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-10-18 04:28:24',1,NULL,'12811FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12812,141169,'A syndrome characterized by headache, neck stiffness, low grade fever, and CSF lymphocytic pleocytosis in the absence of an acute bacterial pathogen. Viral meningitis is the most frequent cause although MYCOPLASMA INFECTIONS; RICKETTSIA INFECTIONS; diagnostic or therapeutic procedures; NEOPLASTIC PROCESSES; septic perimeningeal foci; and other conditions may result in this syndrome. (From Adams et al., Principles of Neurology, 6th ed, p745)','en',1,'2007-10-18 04:28:24',1,NULL,'12812FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
