(12816,141182,'A disease characterized by pulmonary infiltrations of eosinophils and blood eosinophilia.','en',1,'2007-10-18 04:28:24',1,NULL,'12816FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12817,141183,'A complex systemic syndrome with inflammatory and autoimmune components that affect the skin, fascia, muscle, nerve, blood vessels, lung, and heart. Diagnostic features generally include EOSPINOPHILIA, myalgia severe enough to limit usual activities of daily living, and the absence of coexisting infectious, autoimmune or other conditions that may induce eosinophilia. Biopsy of affected tissue reveals a microangiopathy associated with diffuse inflammation involving connective tissue. (From Spitzer et al., J Rheumatol Suppl 1996 Oct;46:73-9; Blackburn WD, Semin Arthritis Rheum 1997 Jun;26(6):788-93)','en',1,'2007-10-18 04:28:24',1,NULL,'12817FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
