(12851,141299,'The constant presence of diseases or infectious agents within a given geographic area or population group. It may also refer to the usual prevalence of a given disease with such area or group. It includes holoendemic and hyperendemic diseases. A holoendemic disease is one for which a high prevalent level of infection begins early in life and affects most of the child population, leading to a state of equilibrium such that the adult population shows evidence of the disease much less commonly than do children (malaria in many communities is a holendemic disease). A hyperendemic disease is one that is constantly present at a high incidence and/or prevalence rate and affects all groups equally. (Last, A Dictionary of Epidemiology, 3d ed, p53, 78, 80)','en',1,'2007-10-18 04:28:24',1,NULL,'12851FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12852,141300,'A condition due to congenital lack of thyroid hormone, marked by arrested physical and mental development, dystrophy of the bones and soft parts, and lowered basal metabolism. It is the congenital form of thyroid deficiency, while MYXEDEMA is the acquired form. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12852FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
