(12858,141311,'A heterogeneous group of primarily familial disorders characterized by myoclonic seizures, tonic-clonic seizures, ataxia, progressive intellectual deterioration, and neuronal degeneration. These include LAFORA DISEASE; MERRF SYNDROME; NEURONAL CEROID-LIPOFUSCINOSIS; sialidosis (see MUCOLIPIDOSES), and UNVERRICHT-LUNDBORG SYNDROME.','en',1,'2007-10-18 04:28:24',1,NULL,'12858FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12859,141313,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12859FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12860,141314,'Softening or loss of brain tissue following CEREBRAL INFARCTION; cerebral ischemia (see BRAIN ISCHEMIA), infection, CRANIOCEREBRAL TRAUMA, or other injury. The term is often used during gross pathologic inspection to describe blurred cortical margins and decreased consistency of brain tissue following infarction. Multicystic encephalomalacia refers to the formation of multiple cystic cavities of various sizes in the cerebral cortex of neonates and infants following injury, most notably perinatal hypoxia-ischemic events. (From Davis et al., Textbook of Neuropathology, 2nd ed, p665; J Neuropathol Exp Neurol, 1995 Mar;54(2):268-75)','en',1,'2007-10-18 04:28:24',1,NULL,'12860FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(12861,141315,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'12861FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
